INSERT INTO `pages` (`id`, `title`, `heading`, `image`, `description`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Privacy Policy', 'Privacy Policy', NULL, '<p><strong>Privacy Policy</strong></p>\n\n<p><strong>It is hereby informed to every individuals who are using UESI E-commerce Business platform, Otrixweb Business shall not be responsible for any lost delivery, false delivery, false delivery of product, broken delivery, permanent or temporary loss of product, only delivery partners are answerable for above terms. We at (original ecommerce) respect the trust you place in us and recognize the importance of secure transactions and information privacy. here our Privacy Policy illustrate that how Otrixweb E-commerce business Private Limited and its affiliates (collectively “Otrixweb business, we, our, us”) collect, use, share or otherwise process your personal information through Otrixweb website www.Otrixwebbusiness.com, its mobile application, and m-site (hereinafter referred to as the “Platform”).</strong></p>\n\n<p><strong>By visiting our Platform, you agree in providing your information or availing our product/service, you agree to be bound by the terms and conditions of this Privacy Policy, the Terms of Use and the applicable service/product terms and conditions. If you do not agree, please do not access or use our Platform.</strong></p>\n\n<p><strong>1. Collection and storage of Your Information</strong></p>\n\n<p><strong> Except making our platform easy, user friendly, interactive and transparent,  we outsource most of the operations (like payments, delivery, buying, selling, advertising, etc. ) to third party vendors hence we are not responsible for any kind of conflicts, disputes, disagreement, any kind of visible or invisible issue or loss faced by anyone. When you chose to use our Platform, we collect and store your information which is provided by you from time to time. In general, you can browse the Platform without telling us who you are or revealing any personal information about yourself. Once you give us your personal information, you are the part of family to us. we indicate which fields are required and which fields are optional. You always have the option not to provide information by choosing not to use a particular service, product or feature on the Platform.</strong></p>\n\n<p><strong>at Otrixweb service we may track your buying habits, preferences, and other information that you choose to provide on our Platform. We use this information to do internal research on our users- interests, and habits to better understand, protect and serve you better. This information is compiled and analyzed on an aggregated basis. This information may include the URL that you just came from (whether this URL is on our Platform or not), which URL you next go to (whether this URL is on our Platform or not), your computer browser information, and your IP address. our service also  collects personal information (such as email address, delivery address, name, phone number, credit card/debit card and other payment instrument details) from you when you set up an account or transact with us. While you can browse some sections of our Platform without being a registered member, certain activities (such as placing an order or consuming our online content  or services) do require registration. We do use your contact information to send you offers based on your previous orders and your interests.</strong></p>\n\n<p><strong>If you choose to post messages on our message boards, chat rooms or other message areas or leave feedback or if you use voice commands to shop on the Platform, we will collect that information you provide to us. We retain this information as necessary to resolve disputes, provide customer support and troubleshoot problems as permitted by law.</strong></p>\n\n<p><strong>If you send us personal correspondence, such as emails or letters, or if other users or third parties send us correspondence about your activities or postings on the Platform, we may collect such information into a file specific to you.</strong></p>\n\n<p><strong>If you are eligible into our O-Coins Loyalty Program, we will collect and store your personal information such as name, contact number, email address, communication address, date of birth, gender, zip code, lifestyle information, demographic and work details etc. which is provided by you to Otrixweb E- commerce business private ltd  or a third-party business partner that operates online/offline establishments or platforms where you can earns O-Coins for purchase of goods and services, and redeem O-Coins. We will also collect your information related to your transactions on Otrixweb business platform and such third-party business partner platforms. When such a third-party business partner collects your personal information directly from you, you will be governed by their privacy policies. Otrixweb e-commerce shall not be responsible for the third-party business partner’s privacy practices or the content of their privacy policies, and we request you to read their privacy policies prior to disclosing any information.</strong></p>\n\n<p><strong>Otrixweb has onboarded certain third-party business partners on the Platform who specialize in the categories like travel ticket reservations, booking online movie tickets, paying online bills and more (Ultra-Partners). If you use the services of Ultra-Partners, you will be redirected to Ultra-Partners websites/applications and your entry to Ultra-Partners websites/applications will be based on your Otrixweb login credentials after seeking your permissions to share the data further. Otrixweb shall not be responsible for the Ultra-Partner’s privacy practices or the content of their privacy policies, and we request you to read their privacy policies prior to disclosing any information.</strong></p>\n\n<p><strong>2. Use of Demographic / Profile Data / Your Information</strong></p>\n\n<p><strong>We at Otrixweb business E- commerce private limited uses your personal information to provide the product and services you request. To the extent we use your personal information to market to you, we will provide you the ability to opt-out of such uses. We use your personal information to assist sellers and business partners in handling and fulfilling orders; enhancing customer experience; resolve disputes; troubleshoot problems; help promote a safe service; collect money; measure consumer interest in our products and services; inform you about online and offline offers, products, services, and updates; customize and enhance your experience; detect and protect us against error, fraud and other criminal activity; enforce our terms and conditions; and as otherwise described to you at the time of collection of information.</strong></p>\n\n<p><strong>With your consent, we will have access to your SMS, contacts in your directory, location and device information. We may also request you to provide your PAN, GST Number, Government issued ID cards/number and Know-Your-Customer (KYC) details to:</strong></p>\n\n<p><strong> (1.) check your eligibility for certain products and services including but not limited to credit and payment products;</strong></p>\n\n<p><strong> (2.) issue GST invoice for the products and services purchased for your business requirements; </strong></p>\n\n<p><strong>(3.) enhance your experience on the Platform and provide you access to the products and services being offered by us, sellers, affiliates or lending partners. You understand that your access to these products/services may be affected in the event consent is not provided to us.</strong></p>\n\n<p><strong>In our efforts to continually improve our product and service offerings, we and our affiliates collect and analyze demographic and profile data about our users\' activity on our Platform. We identify and use your IP address to help diagnose problems with our server, and to administer our Platform. Your IP address is also used to help identify you and to gather broad demographic information.</strong></p>\n\n<p><strong> </strong></p>\n\n<p><strong>We will occasionally ask you to participate in optional surveys conducted either by us or through a third party market research agency. These surveys may ask you for personal information, contact information, date of birth, demographic information (like zip code, age, or income level), attributes such as your interests, household or lifestyle information, your purchasing habits or history, preferences, and other such information that you may choose to provide. The surveys may involve collection of voice data or video recordings, the participation of which would purely be voluntary in nature. We use this data to tailor your experience at our Platform, providing you with content that we think you might be interested in and to display content according to your preferences.</strong></p>\n\n<p><strong>3. Cookies</strong></p>\n\n<p><strong>We use data collection devices such as \"cookies\" on certain pages of the Platform to help analyze our web page flow, measure promotional effectiveness, and promote trust and safety. \"Cookies\" are small files placed on your hard drive that assist us in providing our services. Cookies do not contain any of your personal information. We offer certain features that are only available through the use of a \"cookie\". We also use cookies to allow you to enter your password less frequently during a session. Cookies can also help us provide information that is targeted to your interests. Most cookies are \"session cookies,\" meaning that they are automatically deleted from your hard drive at the end of a session. You are always free to decline/delete our cookies if your browser permits, although in that case you may not be able to use certain features on the Platform and you may be required to re-enter your password more frequently during a session. Additionally, you may encounter \"cookies\" or other similar devices on certain pages of the Platform that are placed by third parties. We do not control the use of cookies by third parties. We use cookies from third-party partners such as Google Analytics for marketing and analytical purposes. Google Analytics help us understand how our customers use the site. You can read more about how Google uses your Personal Information. You can also opt-out of Google Analytics.</strong></p>\n\n<p><strong>4. Sharing of personal information</strong></p>\n\n<p><strong>We may share personal information with our other corporate entities and affiliates for purposes of providing products and services offered by them, such as, the deferred payment options at Otrixweb through its lending partners. These entities and affiliates may share such information with their affiliates, business partners and other third parties for the purpose of providing you their products and services, and may market to you as a result of such sharing unless you explicitly opt-out.</strong></p>\n\n<p><strong>We may disclose your personal information to third parties, such as sellers, business partners. This disclosure may be required for us to provide you access to our products and services; for fulfilment of your orders; for enhancing your experience; for providing feedback on products; to collect payments from you; to comply with our legal obligations; to conduct market research or surveys; to enforce our Terms of Use; to facilitate our marketing and advertising activities; to analyze data; for customer service assistance; to prevent, detect, mitigate, and investigate fraudulent or illegal activities related to our product and services. We do not disclose your personal information to third parties for their marketing and advertising purposes without your explicit consent.</strong></p>\n\n<p><strong>We may disclose personal information if required to do so by law or in the good faith belief that such disclosure is reasonably necessary to respond to subpoenas, court orders, or other legal process. We may disclose personal information to law enforcement agencies, third party rights owners, or others in the good faith belief that such disclosure is reasonably necessary to: enforce our Terms of Use or Privacy Policy; respond to claims that an advertisement, posting or other content violates the rights of a third party; or protect the rights, property or personal safety of our users or the general public.</strong></p>\n\n<p><strong>We and our affiliates will share / sell some or all of your personal information with another business entity should we (or our assets) plan to merge with, or be acquired by that business entity, or re-organization, amalgamation, restructuring of business. Should such a transaction occur that other business entity (or the new combined entity) will be required to follow this Privacy Policy with respect to your personal information.</strong></p>\n\n<p><strong>5. Links to Other Sites</strong></p>\n\n<p><strong>Our Platform may provide links to other websites or application that may collect personal information about you. We are not responsible for the privacy practices or the content of those linked websites.</strong></p>\n\n<p><strong>6. Security Precautions</strong></p>\n\n<p><strong>We maintain reasonable physical, electronic and procedural safeguards to protect your information. Whenever you access your account information, we offer the use of a secure server. Once your information is in our possession we adhere to our security guidelines to protect it against unauthorized access. However, by using the Platform, the users accept the inherent security implications of data transmission over the internet and the World Wide Web which cannot always be guaranteed as completely secure, and therefore, there would always remain certain inherent risks regarding use of the Platform. Users are responsible for ensuring the protection of login and password records for their account.</strong></p>\n\n<p><strong>7. Choice/Opt-Out</strong></p>\n\n<p><strong>We provide all users with the opportunity to opt-out of receiving non-essential (promotional, marketing-related) communications after setting up an account with us. If you do not wish to receive promotional communications from us then please login into the Notification Preference page of Platform to unsubscribe/opt-out.</strong></p>\n\n<p><strong>8. Advertisements on Platform</strong></p>\n\n<p><strong>We use third-party advertising companies to serve ads when you visit our Platform. These companies may use information (not including your name, address, email address, or telephone number) about your visits to this and other websites in order to provide advertisements about goods and services of interest to you.</strong></p>\n\n<p><strong>9. Children Information</strong></p>\n\n<p><strong>We do not knowingly solicit or collect personal information from children under the age of 18 and use of our Platform is available only to persons who can form a legally binding contract under the Indian Contract Act, 1872. If you are under the age of 18 years then you must use the Platform, application or services under the supervision of your parent, legal guardian, or any responsible adult.</strong></p>\n\n<p><strong>10. Data Retention</strong></p>\n\n<p><strong>We retain your personal information in accordance with applicable laws, for a period no longer than is required for the purpose for which it was collected or as required under any applicable law. However, we may retain data related to you if we believe it may be necessary to prevent fraud or future abuse or if required by law or for other legitimate purposes. We may continue to retain your data in anonymized form for analytical and research purposes.</strong></p>\n\n<p><strong>11. Your Consent</strong></p>\n\n<p><strong>By visiting our Platform or by providing your information, you consent to the collection, use, storage, disclosure and otherwise processing of your information (including sensitive personal information) on the Platform in accordance with this Privacy Policy. If you disclose to us any personal information relating to other people, you represent that you have the authority to do so and to permit us to use the information in accordance with this Privacy Policy.</strong></p>\n\n<p><strong>You, while providing your personal information over the Platform or any partner platforms or establishments, consent to us (including our other corporate entities, affiliates, lending partners, technology partners, marketing channels, business partners and other third parties) to contact you through SMS, instant messaging apps, call and/or e-mail for the purposes specified in this Privacy Policy.</strong></p>\n\n<p><strong>12. Changes to this Privacy Policy</strong></p>\n\n<p><strong>Please check our Privacy Policy periodically for changes. We may update this Privacy Policy to reflect changes to our information practices. We will alert you to significant changes by posting the date our policy got last updated, placing a notice on our Platform, or by sending you an email when we are required to do so by applicable law.</strong></p>\n\n<p><strong>14. Queries</strong></p>\n\n<p><strong>If you have any query, issue, concern, or complaint in relation to collection or usage of your personal information under this Privacy Policy, please contact us at the contact information provided above.</strong></p>', '2021-12-14 01:38:01', '2023-09-16 06:21:25', NULL),
(2, 'Terms and Conditions', 'Terms and Conditions', NULL, '<p><strong>Terms &amp; Conditions</strong></p>\n\n<p><strong>1. It is hereby informed to every individuals who are using Otrixweb E-commerce Business platform, Otrixweb Business shall not be responsible for any lost delivery, false delivery, false delivery of product, broken delivery, permanent or temporary loss of product, only delivery partners are answerable for above terms.</strong></p>\n\n<p><strong>2. It is hereby informed that neither we at Otrixweb E-commerce Business are manufacturer nor we are trader we are only providing the platform from where anyone globally make a purchasing request for their wished product manufacturer and we are a bridge between seller and customer.</strong></p>\n\n<p><strong>3. Here at Otrixweb E-commerce Business we try our best to establish a transparent relation between customers and sellers in order to maintain the dignity of original products deliver to you.</strong></p>\n\n<p><strong>4. Except making our platform easy, user friendly, interactive and transparent, &nbsp;we outsource most of the operations (like payments, delivery, buying, selling, advertising, etc. ) to third party vendors hence we are not responsible for any kind of conflicts, disputes, disagreement, any kind of visible or invisible issue or loss faced by anyone.</strong></p>\n\n<p><strong>5. We reserve all direct and indirect rights related to Otrixweb E-commerce Business with us, hence we emphasis on policy i.e. at Otrixweb E-commerce Business we can modify or discontinue any privacy policy, any agreements, contracts, terms and conditions with any partner, collaborations with any third party vendor, partner or costumers without any prior notice, in case of misuse noticed. It is entirely the responsibility of our partners, collaborations, and our customers to follow our terms and condition, privacy policies and contract update regularly.</strong></p>\n\n<p><strong>6. Sharing of personal information</strong></p>\n\n<p><strong>We may share personal information with our other corporate entities and affiliates for purposes of providing products and services offered by them, such as, the deferred payment options at Otrixweb through its lending partners. These entities and affiliates may share such information with their affiliates, business partners and other third parties for the purpose of providing you their products and services, and may market to you as a result of such sharing unless you explicitly opt-out.</strong></p>\n\n<p><strong>7.We may disclose your personal information to third parties, such as sellers, business partners. This disclosure may be required for us to provide you access to our products and services; for fulfilment of your orders; for enhancing your experience; for providing feedback on products; to collect payments from you; to comply with our legal obligations; to conduct market research or surveys; to enforce our Terms of Use; to facilitate our marketing and advertising activities; to analyze data; for customer service assistance; to prevent, detect, mitigate, and investigate fraudulent or illegal activities related to our product and services. We do not disclose your personal information to third parties for their marketing and advertising purposes without your explicit consent.</strong></p>\n\n<p><strong>8. We respect, follow and adhere the law and order of all the states, territories and nationwide but &nbsp;we shall not be responsible for any legal actions or allegation taking against Otrixweb E-commerce Business Private LTD, in or at the spot of allegation or difficulty faced by any company, partners, or customers in their home town. We respond each and every legal queries or complaint filled against us and will be entertained only in law and order body operational in capital of India &nbsp;at origin of our headquarters, only in the case when our customer handling team unable to solve the allegations or any difficulties faced by anyone across.</strong></p>', '2021-12-14 01:46:43', '2022-03-09 02:08:41', NULL);
