INSERT INTO `songs` (`id`, `song_type`, `song_json`) VALUES
(1, 'telugu', '[\n    {\n        \"local_id\": \"1\",\n        \"local_title\": \"అంజూరపు చెట్లు పూయకుండినను\",\n        \"local_hint\": \"anjurapu chetlu\",\n        \"local_text\": \"అంజూరపు చెట్లు పూయకుండినను ద్రాక్షచెట్లు ఫలియింపకను\\nఓలీవచెట్లు కాయకను చేనిలోని పైరు పంటకు రాకపోయినను\\nగొర్రెలు దొడ్డిలో లేకున్నా - శాలలో పశువులు లేకున్నా\\nయెహోవయందానందము - నా దేవునిలో సంతోషము\\nప్రభువగు యెహోవయే నాకు గల బలము\\nనాదు కాళ్ళను లేడి కాళ్ళగ చేయువాడు ఆయనే\\nఉన్నతంబౌ స్థలములందున - నన్ను నడిపించున్‌\\nగొర్రెలు దొడ్డిలో లేకున్నా - శాలలో పశువులు లేకున్నా\\nయెహోవయందానందము - నా దేవునిలో సంతోషము\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"1. అంజూరపు చెట్లు\",\n                \"artist\": \"...పీటర్ సింగ్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/1.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"2\",\n        \"local_title\": \"అంతా నూతనమే యేసులో\",\n        \"local_hint\": \"anta nutaname yesulo\",\n        \"local_text\": \"అంతా నూతనమే యేసులో అంతా నూతనమే\\nపాతవి గతించి క్రొత్తవి వచ్చెన్‌ అంతా నూతనమే\\nచింతలు బాధలు శోధన వ్యధలే పీడించెను మునుపు\\nపాపము తుడిచి నూతనపర్చి ప్రేమతో నింపెను నా ప్రభువే\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"G\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"2\",\n                \"title\": \"2. అంతా నూతనమే యేసులో\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/2.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"3\",\n        \"local_title\": \"అందరి ప్రభువు ఆ యేసే\",\n        \"local_hint\": \"andari prabhuvu a yese\",\n        \"local_text\": \"అందరి ప్రభువు ఆ యేసే - సుందర రక్షకుడాయేసే\\nడెందము నందలి మందిరమందే - పొందుగ ప్రభువుగ ప్రతిష్ఠించుడి\\nహల్లెలూయా స్తుతి పాడుదాం-హల్లెలూయా పూజించుదాం\\nహల్లెలూయా అర్పించుదాం - ప్రభువైన యేసు క్రీస్తును‌\\n\\n1.కృప కనికరముల సంపన్నుడు - నెపములనెంచక రక్షించును\\nఅద్వితీయుడు ఆ ప్రభువే - అసమాన తేజోమయుడు\\n\\n2. ప్రతి మోకాలు వంగునుగా - ప్రతి నాలుక ఘనపరచునుగా\\nప్రభునామం శుభనామం - విభుడేసు రక్షణనామం\\n\\n3. ప్రభుచిత్తమును చేయకయే - ప్రభువా ప్రభువని పిలువకుము\\nప్రభునాత్మ ప్రభువాక్యం - అభయంబుతో బలమిచ్చును\\n\\n4. ప్రభు మహిమార్ధం జీవించుదాం - ప్రభుపేరిట పని జరిగించుదాం\\nప్రభుకొరకై క్షమియించుదాం - ప్రభు ప్రేమనే ప్రకటించుదాం\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"F\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"3\",\n                \"title\": \"3. అందరి ప్రభువు ఆ యేసే\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/3.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"4\",\n        \"local_title\": \"అందాల ఆశాకిరణం\",\n        \"local_hint\": \"andhala aasakiranam\",\n        \"local_text\": \"అందాల ఆశాకిరణం - డెందాల చీకటి బాపెన్‌ \\nఉదయించె చూడు సదయుండు  యేసు - నిజ సంతస క్రిస్మస్ నేడు \\n \\n1.యువతర భవితవ్యం యేసే - నవతర చైతన్యం యేసే \\nప్రభవించెను దివిరాజ్యం ధరలో - ప్రభువిచ్చెను శుభసందేశం.  \\n \\n2.దరిలేని దూరాలలో- గురిలేని వలయాలలో \\nతిరుగాడు మానవులకుతోడై - భరియించున్‌ పలు భారములన్‌.\\n \\n3.అరుణోదయ దర్శనమిదియే - అసమాన తేజోమయుడే \\nఅరుదెంచెను ఆశ్చర్యకరుడై - అందించెను అద్భుత ప్రేమన్‌.\",\n        \"local_category\": [\n            \"christmas\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"Em\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"4\",\n                \"title\": \"4. అందాల ఆశాకిరణం\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/4.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"5\",\n        \"local_title\": \"అదిగో బహుమానము\",\n        \"local_hint\": \"adigo bahumanamu\",\n        \"local_text\": \"అదిగో బహుమానము - క్రీస్తు చెంత నున్నది\\nపదరా పరుగెత్తుము - బహుమతిని పొందగా\\n\\n1. గురియొద్దకే పరుగెత్తుము - మరి తిరుగకు వెనుదారిని \\nవరమిచ్చులే నీ పరుగుకు - పరమందున వరదాతుడు\\n\\n2. క్రమశిక్షణ గల జెట్టిలా - ఎమారకు నీ పరుగును\\nవిమలాత్మతో ప్రభువార్తను - వినిపించురా ఫలమొందురా\\n\\n3. సరిపోరును పోరాడుము - నీ పరుగును కడతేర్చుము \\nస్థిరపరచుకో విశ్వాసము - నీతి కిరీటం నీదెగా\\n\\n4. మితిమీరక నీవుండుము - హితబోధకు చెవియొగ్గుము\\nఅతి శ్రేష్టము అక్షయము - ప్రభువిచ్చెడి బహుమానము\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"2\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"F\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"5\",\n                \"title\": \"అదిగో బహుమానము\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"6\",\n        \"local_title\": \"అద్వితీయ సత్యదేవుడు\",\n        \"local_hint\": \"advitiya satyadevudu\",\n        \"local_text\": \"అద్వితీయ సత్యదేవుడు - క్రీస్తేసె నిత్యజీవము \\nవెలుగైన జీవము - వెలిగించుచున్నాడు\\n\\n1. పాపమునకు జీతం - మరణం, నిత్య మరణం \\nయేసులో కృపాదానం - జీవం, నిత్యజీవం \\nహల్లెలూయా హల్లెలూయా(2)\\n\\n2. సిలువలో మరణించి - లేచెను, తిరిగి లేచెను. \\nపాపము శాపమును - మోసెను, బాపివేసెను \\nహల్లెలూయా హల్లెలూయా(2)\\n\\n3. మరణపు మార్గమును - వీడుము, వేగవీడుము \\nయేసులో జీవమును - కోరుము, నీవు కోరుము \\nహల్లెలూయా హల్లెలూయా(2)\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"A\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"6\",\n                \"title\": \"6. అద్వితీయ సత్యదేవుడు\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/6.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"7\",\n        \"local_title\": \"అనుదినం నిను ధ్యానింతుము\",\n        \"local_hint\": \"anudinam ninu dhyanintumu\",\n        \"local_text\": \"అనుదినం నిను ధ్యానింతుము\\nఅనుక్షణం నిను స్తుతియింతుము\\nనీవే అండగా నీ తోడుండగా\\nప్రేమించి ప్రార్ధించి పని చేసెదం\\n\\n1. ప్రథమము ప్రభువని ప్రస్తుతిన్‌ చేసెదం\\nనీ పరిపూర్ణ పరిశుద్ధ మార్గం\\nపయనించుటే మాకు జీవం\\n\\n2. వాక్యము ధ్యానము మరువక చేసెదం\\nనీ దివ్య మధురంపు వాక్యం\\nధ్యానించుటే గొప్ప భాగ్యం\\n\\n3. ప్రభుపని చేయుచూ రయమున వెళ్ళెదం\\nనీ సువార్త చాటింతుం నిత్యం\\nప్రకటించి నీ ప్రేమ సత్యం\\n\\n4. నశించు ఆత్మలన్‌ విడువక గెలిచెదం\\nనీ కృపచేత కరుణించి మమ్ము\\nనీ పరిచర్యనే చేయనిమ్ము\\n\\n5. శ్రమలలో మనసులో సంతసం పొందెదం\\nఆ దాతృత్వ పరిచర్యన్‌ మేము\\nసాగింప సామర్థ్య మిమ్ము\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"2\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"Dm\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"7\",\n                \"title\": \"7. అనుదినం నిను ధ్యానింతుము\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/7.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"8\",\n        \"local_title\": \"అపవిత్రతకు దూరముగా మీరు పారిపోవుడి\",\n        \"local_hint\": \"apavitrataku duramuga\",\n        \"local_text\": \"అపవిత్రతకు దూరముగా మీరు పారిపోవుడి\\nఅపవాది మోసము నుండి విడిపింపబడియుండుడి\\nగొప్ప తీర్మానముతో ప్రభునిల ఘనపరచుడి\\nఅపురూపుడు పరిశుద్దుడు ప్రభుయేసుని పోలియుండుడి\\n\\n1. చీకటితో నీకేమి పొత్తు దుర్నీతి సాంగత్యమేల\\nబెలియాలుతో సంబంధమేల అవిశ్వాసితో పాలేది నీకు\\nజీవముగల దేవుని ఆలయమే పరిశుద్ధ దేవుని ప్రజలే\\nప్రత్యేక పరచుకొనుచు పరిశుద్ధత సంపూర్తి పరచు \\n\\n2. మనస్సాక్షిని కాపాడుకొనుడి పరిపూర్ణ పరివర్తనతో\\nమనసంతా నూతన పరచి రూపాంతరము పొందుడి\\nతన ప్రాణ రక్తము చిందించిన ఆప్రభుని ప్రేమించుడి\\nతన దివ్య ప్రేమను అందించిన మన ప్రభుని స్తుతించుడి \\n\\n3. బలహీనుల కభ్యంతరము కలుగజేయకుడి\\nఇలక్రీస్తు స్వాతంత్ర్యమును పాడు చేయకుడి\\nబలమైన సజీవ సాక్ష్యము లోకానికి చూపించుడి\\nఫలభరిత పవిత్ర సాక్ష్యము అందరికి అందించుడి \\n\\n4. నిలుచుంటినని గర్వపడకు పడకుండ చూచుకొనుము\\nపలు విధముల స్వాతంత్ర్యము కలదు సకలంబు క్షేమంబు కాదు\\nఅలనాడు జరిగిన సంగతులే హెచ్చరికగా మనకియ్యబడెను\\nఎల్లప్పుడు ప్రభుకిష్టులముగా ప్రార్ధనతో ప్రణమిల్లుదాం \",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"Em\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"8\",\n                \"title\": \"అపవిత్రతకు దూరముగా మీరు పారిపోవుడి\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"9\",\n        \"local_title\": \"అపవిత్రతను దూరపరచుము\",\n        \"local_hint\": \"apavitratanu duraparacumu\",\n        \"local_text\": \"అపవిత్రతను దూరపరచుము\\nనేశుద్దునిగా చూచుకొందును\\nప్రభువా నా దేవా తండ్రీ నా రాజా\\n\\n1. నీ ప్రియునిగా నేనుండుటే నా యెడల నీ సంకల్పము\\nనీ భయముతో పరిశుద్దునిగా జీవించుటే నీ చిత్తము\\nశరీరమునకు నా ఆత్మకు కూడా\\nకలుగుచున్న కల్మషము కడిగి వేయుము\\nకలుగుచున్న కల్మషము కడిగి వేయుము\\n\\n2. నీ భోజనము నీపానమును పుచ్చుకొనుటె నీ ఉద్దేశ్యము\\nఏ నియమముతో అపవిత్రము కాకుండుటయె నీ కిష్టము\\nయజమానులకును అధికారులకును\\nకృపాకటాక్షము నాపై కలుగ జేయుము\\n\\n3. నా చదువులో నాపనులలో నీసాక్షిగా నన్నుంచుము\\nసహవాసములో పరిచర్యలో నీ శక్తితో సాగింపుము\\nనానిర్ణయములు తీర్మానములను\\nనెరవేర్చుటకు నాకు బలము నీయుము\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"2\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"Dm\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"9\",\n                \"title\": \"9. అపవిత్రతను దూరపరచుము\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/9.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"10\",\n        \"local_title\": \"అర్పింతు దేవా - ప్రాణాత్మదేహం\",\n        \"local_hint\": \"arpintu deva\",\n        \"local_text\": \"అర్పింతు దేవా - ప్రాణాత్మదేహం\\nనీ సేవ చేయగ - నీ మాట చాటగ అర్పింతు దేవా\\n\\n1. నను నీకై జేసితివి - ననుకోరి చేరితివి\\nనను కొనగ నా కొరకై - క్రయధనము నిచ్చితివి\\nనను నీదు సొత్తుగజేసి - కృపచేత బ్రోచితివి\\nనను నీదు సంకల్పములో - స్థిరపరచి గాచితివి\\nఅర్పింతు జీవితం - అంగీకరించుమా\\nయజమానుడా దేవా - సర్వాధికారివి\\n\\n2. విద్యార్థి లోకంలో - నిను నేను సేవింపన్‌\\nబాధ్యతల నిచ్చితివి - భారంబు మోపితివి\\nశుద్ధికరించితివి - శుభవార్త నొసగితివి\\nఉద్యోగ వరములతో - దీవెనలు నింపితివి\\nఅర్పింతు జీవితం - నీ సేవచేయగా\\nయజమానుడా దేవ - సర్వాధికారివి\\n\\n3.నీ వాక్యం ధ్యానింతున్‌ - బోధించి నేర్పింతున్\\nనీ వాక్యం పాటింతున్‌ - ప్రార్ధించి ప్రకటింతున్\\nనీ వాక్య సత్యాలే - సవాళ్ళు లోకంలో\\nనీ వాక్య భావాలే - బాధలకు ఔషధముల్\\nఅర్పింతు జీవితం - నీ వాక్య సేవకై\\nయజమానుడా దేవ - సర్వాధికారివి\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"3\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"Cm\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"10\",\n                \"title\": \"10. అర్పింతు దేవా - ప్రాణాత్మదేహం\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/10.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"11\",\n        \"local_title\": \"అరెరరె నేడో రేపో వస్తాడేసయ్యా\",\n        \"local_hint\": \"arerare nedo repo\",\n        \"local_text\": \"అరెరరె నేడో రేపో వస్తాడేసయ్యా\\nరాజులకు రాజై అందరినేల వస్తాడు\\nప్రభువులకు ప్రభువై మేఘాల మీద వస్తాడు\\nశిక్ష కావాలా నీకు రక్షణ కావాలా?\\n\\n1. అక్రమం అన్యాయం - అంతులేక పెరుగుతాయి\\nబుద్ధిలేని బూటకాలు - హద్దు మీరిపోతాయి\\nదయ్యాలు చెలరేగి - కయ్యములు రేపుతాయి\\nఈలోక నాటకాలు - నాశనం అవుతాయి\\n\\n2. కరువు కాటకాలింక - చెలరేగి వస్తాయి\\nనెరవేసి భూమి కూడ - బద్దలై పోతాది\\nసాగరము ఘోషపెట్టి - ఉప్పెనై పోతాది\\nసూర్య చంద్ర చుక్కలన్ని - సూచనలు చూపుతాయి\\n\\n3. పంచభూతాలన్ని - అంచనాల కందవింక\\nమిక్కుటపు వేండ్రముతో - లయమై పోతాయి\\nభూలోక జనులంతా - గుండెలవిసి కూలెదరు\\nకొండబండ సందులలో - మాటులలో దాగెదరు\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"2\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"Em\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"11\",\n                \"title\": \"11. అరెరరె నేడో రేపో వస్తాడేసయ్యా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/11.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"12\",\n        \"local_title\": \"అల్ఫా ఓమేగ - ఆశ్చర్యుడా\",\n        \"local_hint\": \"alpha omega\",\n        \"local_text\": \"అల్ఫా ఓమేగ - ఆశ్చర్యుడా ఆద్యంతుడా - అద్వితీయా\\nఅభిషిక్తుడా - ఆసన్నుడా అత్యున్నత - ఆసీనుడా \\nస్తుతి ఆరాధన నీకే ప్రభూ - నిత్యము నీకే హృదయార్పణ\\nహల్లెలూయా - హల్లెలూయా హల్లెలూయా - ఆమేన్\\n\\n1. పరిశుద్దుడా - ప్రేమరూప పరలోక తేజ - ప్రకాశితుడ\\nప్రధాన కాపరి - పరమ ప్రభూ పరిపూర్ణుడా - ప్రియుడా\\nస్తుతి ఆరాధన నీకే ప్రభూ - నిత్యము నీకే హృదయార్పణ\\nహల్లెలూయా - హల్లెలూయా హల్లెలూయా - ఆమేన్\\n\\n2. జీవాధిపతి - జీవాధారం జీవింపజేయు - జీవాహారం\\nజీవంపు వెలుగు - జీవ వాక్యం జీవ జయ జలమా\\nస్తుతి ఆరాధన నీకే ప్రభూ - నిత్యము నీకే హృదయార్పణ\\nహల్లెలూయా - హల్లెలూయా హల్లెలూయా - ఆమేన్‌\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"2\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"A\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"12\",\n                \"title\": \"అల్ఫా ఓమేగ - ఆశ్చర్యుడా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"13\",\n        \"local_title\": \"ఆకాశములు దేవుని మహిమ\",\n        \"local_hint\": \"akasamulu devuni\",\n        \"local_text\": \"ఆకాశములు దేవుని మహిమ - వివరించుచున్నవి\\nఅంతరిక్షములు ఆయన పనిని - ప్రచురపరచుచున్నవి\\n\\n1. పగటికి పగలు బోధను చేసి - రాత్రికి రాత్రి జ్ఞానము తెలిపి\\nభాషలు లేక మాటలు లేక (2) - ప్రచురపరచుచున్నవి\\n\\n2. యదార్థమైనది నీ ధర్మశాస్త్రం - తెప్పరిల్ల చేయును ప్రాణమును\\nనమ్మదగినది నీ శాసనము (2) - జ్ఞానమును పుట్టించును\\n\\n3. ఉపదేశములు నిర్జోషమైనవి - హృదయమును సంతోషపరచును\\nనిర్మలమైనది నీ ధర్మంబు (2) - కనులకు వెలుగిచ్చును\\n\\n4. యెహోవాయందలి భయము పవిత్రము - నిరతంబది నిలచును సత్యం\\nమేలిమి బంగరు తేనెల (2) - ధారల కంటెను విలువైనది\",\