"local_text\": \"ఆద్యంత రహితుడా - ఆశ్చర్య రూపుడా\\nఅర్హుడా యోగ్యుడా పాత్రుడా\\nఅందుకో నీకే మా ఆరాధన\\n\\n1. నీవేగా సృష్టించి నిర్మించావు\\nనీ ప్రాణం అర్పించి రక్షించావు\\nనీకృప చాలయ్యా - నీ ప్రేమే బలమయ్యా\\nనీ చిత్తం మాలో నెరవేరాలయ్యా\\n\\n2. నీ స్వాస్థ్యము మాకిచ్చి పోషించావు\\nనీ వాక్యం మాకిచ్చి నడిపించావు\\nనీ సన్నిధి చాలయ్యా -నీ ఆత్మే బలమయ్యా\\nనీ రూపం మాలో రూపొందాలయ్యా\\n\\n3. సీరాజ్యం మాకిచ్చి విడిపించావు\\nనీసేవలో బలమిచ్చి ఫలమిచ్చావు\\nనీ జీవంచాలయ్యా - నీవరమే చాలయ్యా\\nనీ సంఘం నిత్యం - వర్ధిల్లాలయ్యా\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"4\",\n        \"index_letter\": \"ఆ\",\n        \"song_chord\": \"G\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"15\",\n                \"title\": \"ఆద్యంత రహితుడా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"16\",\n        \"local_title\": \"ఆది అనంత దేవుడే\",\n        \"local_hint\": \"adi ananta devude\",\n        \"local_text\": \"ఆది అనంత దేవుడే - నీదు బలమై నిల్చును\\nఅధిక శక్తి సంపన్నుడే - నీకు జయము నిచ్చును\\nఓ సోదరా - ఓ సోదరీ\\nలేలెమ్ము ప్రభు పనికై - త్వరపడి రమ్ము\\n\\n1. క్రీస్తేసుని యెరిగిన వారు - బలవంతులుగా నుందురు\\nగొప్ప కార్యములెన్నెన్నో - ఈ భువిలో చేసెదరు - ఈ భువిలో చేసెదరు\\n\\n2. అపవిత్రత తొలగించుము - అపవాదిని ఎదిరించుము\\nఅనుదినమును ధ్యానించుము - అనవరతము ప్రార్ధించుము\\n\\n3. ఆసక్తిని విడనాడకుము - ఆ ప్రభుని యెడబాయకుము\\nఆత్మలో సేవించుము - ఆత్మలను రక్షించుము\\n\\n4. అర్పించుము నీ జీవితం - అర్పణగా అందించుము\\nఆనందించుము ఆత్మలో - ఆశీర్వాదము లందుకో\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"4\",\n        \"index_letter\": \"ఆ\",\n        \"song_chord\": \"Dm\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"16\",\n                \"title\": \"ఆది అనంత దేవుడే\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"17\",\n        \"local_title\": \"ఆనంద గీతములు పాడి\",\n        \"local_hint\": \"ananda gitamulu paadi\",\n        \"local_text\": \"ఆనంద గీతములు పాడి - ఆశీర్వాదం ఆదరణ పొంది\\nఆహా నా రక్షకుడు యేసే నా నాయకుడు\\nఆసక్తితో వెంబడింతును ఆ... ఆ\\n\\n1. ప్రభు యేసు మొదట నన్ను - ప్రేమించి ఏర్పరచుకొని\\nతండ్రివలె జాలితోడ - అంగీకరించె సుతునిగా\\nఆశ్చర్య ప్రేమా - శాశ్వతమౌ ప్రేమా నేననుభవించుచున్నాను. ..ఆ...ఆ (2)\\n\\n2. నమ్మిన హితులేనన్ను - శ్రమ పరచి విడువజాలిన\\nసాతాను క్రూరమైన - హింసలకు నన్ను గురిచేసిన\\nఎడబాయలేదు - యేసయ్య మాత్రమే\\nవిడిపించి విజయము నిచ్చెను... ఆ... ఆ... (2)\\n\\n3. ఏది ఏమైనా గాని - దేవా! నిన్నే ప్రేమింతును\\nలోకాశలకు లొంగిపోక - లోకానికే ప్రకటింతును\\nసజీవుడు నా విమోచకుడని...\\nసిలువ విధానం కోరుదు... ఆ... ఆ... (2)\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"3\",\n        \"index_letter\": \"ఆ\",\n        \"song_chord\": \"D\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"17\",\n                \"title\": \"17. ఆనంద గీతములు పాడి\",\n                \"artist\": \"...రాజ్ కుమార్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/17.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"18\",\n        \"local_title\": \"ఆరాధన ఆరాధన\",\n        \"local_hint\": \"aradhana aradhana\",\n        \"local_text\": \"ఆరాధన ఆరాధన ఆరాధన ఆరాధన (2)\\nసర్వలోకాధిపతి ఆరాధన\\nసజీవ సృష్టికర్తకీ ఆరాధన \\nహృదయాధీపతికి ఆరాధన \\n\\n1. మలినం లేని మనసున్న వాడవై \\nమానవాళికై భువికేతెంచిన \\nనిత్యము నిన్నే స్తుతించెదము \\nసత్యముతో వెదకెదము\\n\\n2. రక్షణ మార్గం చూపెడివాడవై \\nశిక్షించక మము ప్రేమించినావు \\nదీర్ఘశాంతుడా - దివ్య రూపుడా \\nకొలుతుము నిన్నే కొనియాడెదము\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"5\",\n        \"index_letter\": \"ఆ\",\n        \"song_chord\": \"Em\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"18\",\n                \"title\": \"18. ఆరాధన ఆరాధన\",\n                \"artist\": \"...కె.అనిల్ దేవ్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/18.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"19\",\n        \"local_title\": \"ఆరాధన - స్తుతి ఆరాధన\",\n        \"local_hint\": \"aradhana\",\n        \"local_text\": \"ఆరాధన - స్తుతి ఆరాధన ఆరాధన - నీకే ఆరాధన\\nఅర్హుడా - నీకేనయ్యా అద్వితీయా - నీకేనయ్యా\\nయేసయ్యా - నా ప్రియుడా పాత్రుడా ప్రేమామయుడా\\n\\n1. ఎనలేని కృప జూపినావు - తనువు బలిచేసి గెలిచావు\\nనను వెలిగించి విమోచించావు - మనస్సు మార్చి స్థిరపరచావు\\nయేసయ్యా - నా ప్రియుడా పాత్రుడా ప్రేమామయుడా\\n\\n2. నా మొరలన్ని ఆలించావు - వేదనలన్ని తొలగించావు\\nరక్షణకేడెం అందించావు - దక్షిణ హస్తం ఆదుకొనగ\\nయేసయ్యా - నా ప్రియుడా పాత్రుడా ప్రేమామయుడా\\n\\n3. నా దాగుచోటు నీవే - నీ నీడలో నన్ను దాచావు నీవే \\nజల్దరు వృక్షపు నీడలో నేను - ఆనందముతో అలసట తీరెద\\nయేసయ్యా - నా ప్రియుడా పాత్రుడా ప్రేమామయుడా\\n\\n4. పదివేలలో అతి ప్రియుడా - పెదవులపై దయారసమొల్కువాడ\\nహృదయము గెల్చిన నాధుడ నీవే - పదిలముగా నను పోషించావు\\nయేసయ్యా - నా ప్రియుడా పాత్రుడా ప్రేమామయుడా\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"6\",\n        \"index_letter\": \"ఆ\",\n        \"song_chord\": \"D\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"19\",\n                \"title\": \"19. ఆరాధన - స్తుతి ఆరాధన\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/19.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"20\",\n        \"local_title\": \"ఆరాధనా - స్తుతి పాత్రుడ యేసయ్యా\",\n        \"local_hint\": \"aradhana stuti\",\n        \"local_text\": \"ఆరాధనా - స్తుతి పాత్రుడ యేసయ్యా - ఏరీతి నిను నే ప్రస్తుతించెదను\\nనీరాజనములతో నీదు ప్రేమన్‌ - నిరతము స్తుతించెద నీనామమున్\\n\\n1. నా పాప భారం సిలువలో మోసి - విడుదల నిచ్చితివే\\nనాశాపమంత తొలగించితివి - శుద్దుని జేసితివే\\nరక్షణ నీవే రాజ్యము నీదే - ప్రభువా దేవా నీజాలి కృపకై\\nనిరతము స్తుతించెద - నీ నామమున్\\n\\n2. నూతన జీవం - నూతన బలము - నూతన మనసిచ్చావే\\nఅనుదిన నూతన వాత్సల్యముతో - దినదినము కరుణించావే\\nజీవము నీవే - జయమునీవే - దేవుని తనయా నీత్యాగం కొరకై\\nనిరతము స్తుతించెద - నీనామమున్\\n\\n3. సాతాను క్రియలన్ని - లయపరిచావు - చీకటి తొలగించావే\\nమరణపు ముల్లును విరిచావు నీవు - కాడిని ఖండించావే\\nవాక్యము నీవే - జయము నీదే - దేవుని తనయా నీత్యాగం కొరకై\\nనిరతము స్తుతించెద - నీనామమున్\\n\\n4. ఆత్మతో నింపి - ఆకలి తీర్చి - ఆదరణిచ్చితివే\\nఅభిషేకమిచ్చి - ఆశను తీర్చి - ఆత్మల నిచ్చితివే\\nఆత్మయునీవే - సత్యము నీవే - ఆత్మల కాపరి నీకాపుదలకై\\nనిరతము స్తుతించెద - నీ నామమున్‌\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"7\",\n        \"index_letter\": \"ఆ\",\n        \"song_chord\": \"Dm\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"20\",\n                \"title\": \"20. ఆరాధనా - స్తుతి పాత్రుడ యేసయ్యా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/20.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"21\",\n        \"local_title\": \"ఆరాధింతుము - స్తుతించెదము\",\n        \"local_hint\": \"aradhintumu\",\n        \"local_text\": \"ఆరాధింతుము - స్తుతించెదము ఆ ప్రభు త్యాగమున్‌\\nఅరుదైన - ఆ ప్రేమన్‌‌ అందరము కీర్తించెదము\\n\\n1. దైవ స్వరూపి క్రీస్తే - దైవసమానుడేసే\\nవిడిచె