్యా\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"15\",\n        \"index_letter\": \"ఓ\",\n        \"song_chord\": \"Fm\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"45\",\n                \"title\": \"ఓ ప్రభు యేసు నీవే దైవం\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"46\",\n        \"local_title\": \"ఓ ప్రభూ యేసయ్యా\",\n        \"local_hint\": \"o prabhu\",\n        \"local_text\": \"ఓ ప్రభూ యేసయ్యా, నీ పాద సన్నిధి శ్రేష్టమైనది\\nనా ప్రియ యేసయ్యా, నీవెంతో ప్రేమించి కరుణించెదవు\\n\\n1. నీ సన్నిధి కాంతియందు ఏది దాగదు\\nచేసినట్టి పాపములు కనబడునయ్యా\\nబాసచేసి సన్నిధి కాంతియందున\\nపాపమొదలి జీవించిన కనికరింతువు\\n\\n2. నీ సన్నిధి ఒక దినము నేను గడిపిన\\nఓ సహస్ర దినములంత దీవెనకరము\\nవాసిగాను నీ మాటను పాటించిన\\nత్రోసివేయక నన్ను నడిపించెదవు\\n\\n3. నీ సన్నిధి ఉత్తమము ఎల్లప్పుడు\\nమోసపుచ్చు సాతానుని, ఆశ్రయించిన\\nకాసులిలలో దొంగిలింపబడును, సత్యము\\nనీ సన్నిధి దీనులకు తీసివేయబడదు\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"5\",\n        \"index_letter\": \"ఓ\",\n        \"song_chord\": \"Fm\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"46\",\n                \"title\": \"ఓ ప్రభూ యేసయ్యా\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"47\",\n        \"local_title\": \"ఓ ప్రార్థనా సుప్రార్థనా\",\n        \"local_hint\": \"o prarthana\",\n        \"local_text\": \"1. ఓ ప్రార్థనా సుప్రార్థనా - నీ ప్రాభవంబున్‌ మరతునా\\nనా ప్రభువున్‌ ముఖాముఖిన్‌ - నే బ్రణుతింతు నీ ప్రభన్‌\\nనా ప్రాణమౌ సుష్రార్ధనా - నీ ప్రేరేణంబు చే గదా\\nనీ ప్రేమ ధార గ్రోలుదు - నో ప్రార్థనా సుప్రార్థనో\\n\\n2. పిశాచి నన్ను యుక్తితో - వశంబు చేయంజూచుచో\\nనీ శాంతమైన దీప్తియే - నా శంకలెల్ల మానుపున్‌\\nనీ శక్తి నేను మరతునా - నా శైలమైన ప్రార్ధనా\\nనా శోక మెల్లదీర్చెడు - విశేషమైన ప్రార్ధనా\\n\\n3. నీ దివ్యమైన రెక్కలే - నా దుఃఖ భారమెల్లను\\nనా దేవుండేసు చెంతకు - మోదంబు గొంచు బోవును\\nసదా శుభంబు లొందను - విధంబుజూపనీవెగా\\nనాధైర్యమిచ్చు ప్రార్ధనా - సుధా సుధార ప్రార్ధనా\\n\\n4. అరణ్యమైన భూమిలో - నారమ్యమౌ పిస్తానగంబు\\nరంగుగాను నెక్కినా - చిర గృహంబుజూతును\\nశరీరమున్‌ విదల్సినే - బరంబు బోవు వేళలో\\nకరంబు నిన్ను మెచ్చెదన్‌ - పరేసుధ్యాన ప్రార్ధనా\",\n        \"local_category\": [\n            \"prayer\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"ఓ\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"47\",\n                \"title\": \"ఓ ప్రార్థనా సుప్రార్థనా\",\n                \"artist\": \"...విలియం వాల్ ఫోర్డ్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"48\",\n        \"local_title\": \"ఓ ప్రేమ స్వరూప\",\n        \"local_hint\": \"o prema\",\n        \"local_text\": \"ఓ ప్రేమ స్వరూప - ఓ ప్రేమ స్వరూప!\\nకల్వరిలోన ప్రాణమిడిన - ఓ ప్రేమ స్వరూప (2)\\n\\n1. నా తల్లి మరచిన - నా తండ్రి విడచిన\\nనను వీడక కాపాడిన ఓ ప్రేమస్వరూప\\n\\n2. నా శోధనందున - నా బాధలందున\\nకనుపాపవలెను కాచిన - ఓ ప్రేమస్వరూప\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"16\",\n        \"index_letter\": \"ఓ\",\n        \"song_chord\": \"E\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"48\",\n                \"title\": \"48. ఓ ప్రేమ స్వరూప\",\n                \"artist\": \"...యం.క్రిష్ణయ్య\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/48.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"49\",\n        \"local_title\": \"ఓ నిరాశజీవి - నీకిక ఆశలే మిగలలేదా?\",\n        \"local_hint\": \"o nirasajivi\",\n        \"local_text\": \"ఓ నిరాశజీవి - నీకిక ఆశలే మిగలలేదా? (2)\\nఓ బాటసారి - గమ్యమే లేదని అలిసిపోతివా?\\nఒంటరి జీవితం - ఎండిన జీవితం (2)\\nఅదిగో నీ జీవితానికో వసంతం\\n\\n1. బలహీనమైనదే విత్తనం - భూమిలో పడగానె మారిందయ్యా (2)\\nజీవం ఉబికి వచ్చింది - జీవంలేని పొట్టు చీల్చుకొని (2)\\nక్రీస్తు మరణాన్ని గెలిచెనయ్య - రాతి సమాధి చీల్చుకొని (2)\\nనీలో రాతిగుండెను చీల్చి - నిత్యజీవము ఇచ్చెనయ్యా (2)\\n\\n2. వినవన్నా ఓ శుభవార్త - నీ జీవితానికో ఆశాకిరణం\\nఎంచుకో తమ్ముడా - నీ గమ్యం ఆ క్రీస్తుగా...\\nనింపుకో నీ జీవితం - సంతోషంతో\\nనడువన్నా నడువు - నీ నిత్య రాజ్యమునకు..... నిత్య రాజ్యమునకు\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"10\",\n        \"index_letter\": \"ఓ\",\n        \"song_chord\": \"F\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"49\",\n                \"title\": \"49. ఓ నిరాశజీవి - నీకిక ఆశలే మిగలలేదా?\",\n                \"artist\": \"...కె.అనిల్ దేవ్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/49.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"50\",\n        \"local_title\": \"ఓ యేసుదేవా - మా జీవన దాత\",\n        \"local_hint\": \"o yesudeva\",\n        \"local_text\": \"ఓ యేసుదేవా - మా జీవన దాత\\nమమ్ము నీలో నిలుపుము - వేరుతన్ని - మీదికెదిగి\\nఆత్మ దేవునిలో ఫలియించుటకై\\n\\n1. నీ ద్రాక్షవల్లి - కారుద్రాక్షలు కాయగ\\nనీవే నిజమైన ద్రాక్షవల్లివై - నీ లోని తీగలుగ మము మార్చితివి\\n\\n2. నీ యందు మేముండి - నీ వాక్యం మాలో నుండగా\\nమేము బహుగా నీలో ఎదిగెదము - ఆత్మఫలములతో ఫలియించుటకై\\n\\n3. నీ జీవ వాక్యముతో - నీ ప్రేమ వార్త చాటగ\\nనీ ఆత్మతో నింపి మమ్ము నడుపుము దేవా - నశియించు విద్యార్థుల రక్షణ కొరకై\\n\\n4. నీ ప్రేమ నడిపింపు ఇంతవరకిచ్చిన ప్రభువని\\nఅనుదినము నిన్నే మేము స్తుతియింతుము - మాతోడు నీడ మా సర్వమని\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"7\",\n        \"index_letter\": \"ఓ\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"50\",\n                \"title\": \"50. ఓ యేసుదేవా - మా జీవన దాత\",\n                \"artist\": \"...యం.క్రిష్ణయ్య\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/50.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"51\",\n        \"local_title\": \"ఓ యేసు నీ ప్రేమ - ఎంతో మవానీయము\",\n        \"local_hint\": \"o yesu ni prema\",\n        \"local_text\": \"ఓ యేసు నీ ప్రేమ - ఎంతో మహనీయము\\nఆకాశతార పర్వత సముద్రములకన్నా గొప్పది\\n\\n1. అగమ్య ఆనందమే - హృదయము నిండెను\\nప్రభుని కార్యములు - గంభీరమైనవి\\nప్రతి ఉదయ సాయంత్రములు - స్తుతికి యోగ్యములు\\n\\n2. సంకట సమయములో - సాగలేకున్నాను\\nదయ చూపు నామీద - అని నేను మొరపెట్టగా\\nవింటినంటిని నా మొరకు ముందె - తోడనుందునంటివి\\n\\n3. దేవుని గృహములో - సదా స్తుతించెదను\\nసంపూర్ణ హృదయముతో - సదా భజించెదను\\nస్తుతి ప్రశంసలకు యోగ్యుడేసు - హల్లెలూయ ఆమెన్\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"17\",\n        \"index_letter\": \"ఓ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"51\",\n                \"title\": \"ఓ యేసు నీ ప్రేమ - ఎంతో మవానీయము\",\n                \"artist\": \"...రెవ.టి.డి.మాథ్యూస్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"52\",\n        \"local_title\": \"ఓరన్నా - ఓరన్నా\",\n        \"local_hint\": \"oranna - oranna\",\n        \"local_text\": \"ఓరన్నా - ఓరన్నా యేసుకు సాటి వేరే లేరన్నా ల