    \"local_id\": \"55\",\n        \"local_title\": \"కడుగుము దేవా - కడు దయతో నన్ను జూడుమా\",\n        \"local_hint\": \"Kadugumu deva\",\n        \"local_text\": \"కడుగుము దేవా - కడు దయతో నన్ను జూడుమా\\nచెడుగును వీడి - నే జేరెదన్‌ నీ దరిన్‌\\nనీతి స్వరూపుడ తండ్రీ\\nమహిమ స్వరూపి ప్రభువా\\nసత్యస్వరూప దైవాత్మా సత్యస్వరూప దైవాత్మా\\n\\n1. జారచోర దురాశలు - చేరువయ్యే నిరాశలు\\nదురితంబనవరతం - నాచరితం దో.. షభరితం\\nఈ దేహం నీదు నిలయం - శుభనిలయా\\nదయగనుమా - గైకొనుమా - దైవతనయా\\n\\n2. లోకమునకు లోనైతిని - భోగభాగ్యమాశించితిన్‌\\nలోభం ధనదాహం - పైవేషం నాదు దోషం\\nఇక నీలో దాగియుందున్‌ - శుభనిలయా\\nదయగనుమా - గైకొనుమా - దైవతనయా\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"8\",\n        \"index_letter\": \"క\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"55\",\n                \"title\": \"55. కడుగుము దేవా - కడు దయతో నన్ను జూడుమా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/55.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"56\",\n        \"local_title\": \"కదలిరమ్ము క్రైస్తవ యువకా\",\n        \"local_hint\": \"Kadalirammu kraistava\",\n        \"local_text\": \"కదలిరమ్ము క్రైస్తవ యువకా - కలసి రమ్ము క్రీస్తురాజు సేవలో\\nకుడియెడములు చూడక - క్రీస్తువైపు చూచుచు\\nతీవ్రముగా తక్షణమే తరలిరా\\n\\n1. లోకనాధుడెంతయో - లోకులన్‌ జయించుచుండె\\nలోకులంతవాని క్రింద - లొంగి కృంగి కుములుచుండె\\n\\n2. యేసు నాధుడెంతయో - వేదనతో పిలచుచుండె\\nఎరుగమంచు లోకులంతా - వేరుదారి పోవుచుండె\\n\\n3. మీ యవ్వన జీవితాలే - క్రీస్తు సంఘ స్తంభాలు\\nమీ ఉన్నత సాక్ష్యాలే - మన ప్రజలకు మార్గాలు\\n\\n4. శోధనలే వచ్చినా - శ్రమలెన్నో చుట్టినా\\nశక్తిని ప్రభువిచ్చును - సదయుడు సందేహమేల\\n\\n5. సత్యవాక్య ఖడ్గముచే - శత్రువు నోడించుటకు\\nయేసువార్త చాటుచు - సంఘము పోషించుటకు\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"11\",\n        \"index_letter\": \"క\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"56\",\n                \"title\": \"56. కదలిరమ్ము క్రైస్తవ యువకా\",\n                \"artist\": \"...యం.క్రిష్ణయ్య\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/56.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"57\",\n        \"local_title\": \"కన్నులెత్తి పైరుల చూడు\",\n        \"local_hint\": \"Kannuletti pairula\",\n        \"local_text\": \"కన్నులెత్తి పైరుల చూడు - కోయగ లేరెవ్వరు\\nఓ యువకుడా ఓ యువతీ - తినుచు త్రాగుచు సుఖింతువా?\\n\\n1. పట్టణము ప్రాకారములు - కాల్చబడి కూల్చబడెన్\\nపరరాజు పాలనలో - పరిచర్య పావనమా?\\nఓ యువకుడా ఓ యువతీ - తినుచు త్రాగుచు సుఖింతువా?\\n\\n2. మందిరము పడియుండ - మందుడవై నీవుండి\\nసరంబీ గృహములలో - సంతోష సమయమిదా\\nఓ యువకుడా ఓ యువతీ - తినుచు త్రాగుచు సుఖింతువా?\\n\\n3. యుద్ధమున ప్రజలంతా - పెద్దగను సిద్ధపడన్‌\\nప్రొద్దు గ్రుంకిన వేళ - మిద్దెపయిన్‌ తిరిగెదవా?\\nఓ యువకుడా ఓ యువతీ - తినుచు త్రాగుచు సుఖింతువా?\\n\\n4. ద్రవ్యమును వస్త్రములు - తోటలకు సమయమిదా?\\nసర్వమును ప్రభుకిచ్చి - సాగెడి ఈ సమయమున\\nఓ యువకుడా ఓ యువతీ - తినుచు త్రాగుచు సుఖింతువా?\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"12\",\n        \"index_letter\": \"క\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"57\",\n                \"title\": \"57. కన్నులెత్తి పైరుల చూడు\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/57.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"58\",\n        \"local_title\": \"కలసి జీవించెదం\",\n        \"local_hint\": \"Kalasi jivinchedam\",\n        \"local_text\": \"కలసి జీవించెదం కలసి పనిచెసెదం\\nకలసి ప్రార్ధించెదం - మాదేవా \\nఎంతో గొప్పమేలు ఎంతో మనోహరము\\nఎంతో ఆశీర్వాదం - ఏకత్వం\\nఆరాధించి ఆనందింతుము\\nకృపా సత్య సంపూర్ణుడా\\nకలసి మెలసి సేవింతుము\\nఅలసిపోము నీదు కృపలో\\n\\n1. సహవాస ప్రేమ - దైవ ప్రేమ\\nఅక్కరలు తీర్చి - ఆదరించును\\nలోపంబు మన్నించి - సవరించి\\nవెలుగులో నడిచి - వెలిగించును  #ఆరాధించి#\\n\\n2. నీ ద్రాక్షతోటలో - పనిచేసి\\nనీ ప్రేమ బాటలో - వెంబడించి\\nనీ వార్త చాటుచు - పరిగెత్తి\\nనీ స్తుతి పాటతో - జయించెదం  #ఆరాధించి#\\n\\n3. ప్రార్ధించి పోరాడి - గెలిచెదము\\nవిజ్ఞాపనాత్మతో - విమలాత్మతో\\nనీదు సంకల్పం - నెరవేర \\nనీ హస్తం కదిలి - పనిచేయగా  #ఆరాధించి#\",\n        \"local_category\": [\n            \"fellowship\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"క\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"58\",\n                \"title\": \"58. కలసి జీవించెదం\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/58.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"59\",\n        \"local_title\": \"కలువరి గిరినుండి - పిలిచిన నా యేసు\",\n        \"local_hint\": \"Kaluvari girinundi\",\n        \"local_text\": \"కలువరి గిరినుండి - పిలిచిన నా యేసు\\nసిలువ మరణమును - గెలిచిన నా యేసు\\nహల్లెలూయా - హల్లెలూయా హల్లెలూయా - హల్లెలూయా\\nహల్లెలూయా - హల్లెలూయా హల్లెలూయా - హల్లెలూయా\\n హల్లెలూయా - హల్లెలూయా హల్లెలూయా - హల్లెలూయా\\n\\n1. మధుర ప్రేమను చూపించి నాపై - మదిని నెమ్మది చేకూర్చినావు\\nమారని యేసురాజా - మరువను నిన్ను దేవా  #హల్లె#\\n\\n2. బెదరి బ్రతుకున నే చెదరిపోగ - వెదకి దరిచేర్చి సమకూర్చినావు\\nవేదనలు బాపినావా - విడువను నిన్ను దేవా  #హల్లె#\\n\\n3. మర్యమైన ఇహలోకమందే - నిత్యరాజ్యము నా కొసగినావు\\nశక్తి గల నీ నామంబు నిరతం - భక్తితోనే ప్రకటింతు దేవా  #హల్లె#\",\n        \"local_category