\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/73.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"74\",\n        \"local_title\": \"క్రైస్తవా మేలుకో - క్రీస్తులో నిన్ను చూచుకో\",\n        \"local_hint\": \"Kraistavaa meloko\",\n        \"local_text\": \"క్రైస్తవా మేలుకో - క్రీస్తులో నిన్ను చూచుకో\\nక్రైస్తవా మేలుకో - క్రీస్తు నీతి ధరించుకో\\nపాపమేలా లోకమేలా - యేసురాక వేళాయె\\n\\n1. ప్రేమించి యేసు నిన్ను - అప్పగించుకొనె నీకై\\nయే శిక్ష విధిలేని - రక్షణ నొసగె నేడు\\nభయమెలా - బెదురేలా - ప్రభు యేసు ప్రేమ చాలు\\n\\n2. యేసులోని తీగెనీవు - యేసు బోలి సాగునీవు\\nయేసులో ఫలించు చుండు - యేసుకై నిలచి యుండు\\nశోధనందు - బాధలందు - యేసు జేర వేగరమ్ము\\n\\n3. నూతనంపు సృష్టి నీవు - పాత రోతనంతవీడు\\nనూతనాత్మ నీకు తోడు - నేత యేసు జాడ చూడు\\nసంతసించు - స్తోత్రించు - సత్యమందు ఆరాధించు\\n\\n4. యేసునందే నీకు జయము - యేసు ద్వారా ఘన జయము\\nయేసునందే నిత్యజీవం - యేసుతోడ నిత్య రాజ్యం\\nసంఘమందు - సమాజమందు - యేసు ప్రేమ చాటరమ్ము\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"12\",\n        \"index_letter\": \"క\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"74\",\n                \"title\": \"74. క్రైస్తవా మేలుకో - క్రీస్తులో నిన్ను చూచుకో\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/74.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"75\",\n        \"local_title\": \"గగనము చీల్చుకొని  యేసు\",\n        \"local_hint\": \"gaganamu\",\n        \"local_text\": \"గగనము చీల్చుకొని  యేసు  ఘనులను తీసుకొని\\nవేలాది దూతలతో  భువికి  వేగమె రానుండె\\n\\n1.పరలోక పెద్దలతో పరివారముతో కదలి\\nధర సంఘ వదువునకై(2) -  తరలెను వరుడదిగో\\n\\n2. మొదటను గొర్రెగను ముదమారగ వచ్చెను\\nకొదమ సిం హపురీతి కదలెను గర్జనతో \\n\\n3. కనిపెట్టు భక్తాళీ కనురెప్పలో మారెదరు\\nప్రథమమున లేచదరు పరిశుద్దులు మృతులు\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"16\",\n        \"index_letter\": \"గ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"75\",\n                \"title\": \"గగనము చీల్చుకొని  యేసు\",\n                \"artist\": \"...కె.విల్సన్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"76\",\n        \"local_title\": \"గాడాంధకారములో - నేనడచిన వేళలలో\",\n        \"local_hint\": \"Gadhandhakaramulo\",\n        \"local_text\": \"1. గాడాంధకారములో - నేనడచిన వేళలలో\\nకంటిపాపవలె నన్న - కునుకక కాపాడును\\nప్రభువైన యేసునకు - జీవితమంత పాడుదున్‌\\nజడియను - బెదరను - నా యేసు నాతో నుండగ! (2)\\n\\n2. మరణపు లోయలలో - నే నడచిన వేళలో\\nనీ దుడ్డుకర్రయు - నీ దండము ఆదరించును\\nశుద్దాత్మతో నింపెను - నాగిన్నె పొర్లుచున్నది \\n\\n3. అలలతో కొట్టబడిన - నావలో నేనుండగ\\nప్రభుయేసు కృప నన్ను - ఎడబాయక కాపాడును\\nఅభయమిచ్చి నన్ను - అద్దరికి చేర్చును\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"6\",\n        \"index_letter\": \"గ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"76\",\n                \"title\": \"గాడాంధకారములో - నేనడచిన వేళలలో\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"77\",\n        \"local_title\": \"గొప్పదేవా - నడిపించుము\",\n        \"local_hint\": \"goppadevaa\",\n        \"local_text\": \"గొప్పదేవా - నడిపించుము - అరణ్యములో యాత్రికుడను\\nతప్పులెన్నో - చేసితిని - గొప్ప కృపతో కరుణించుము\\nమహోన్నతమైన నీబాహువుతో - అత్యధికమైన - నీబలముతో \\n\\n1. పరలోకమన్నానిచ్చి - చిరజీవ దాహం తీర్చి\\nదివ్యాగ్ని మేఘంతో - నడిపించు నాదేవా\\nనీసన్నిధి కాంతి మార్గంలో - సమృద్ధి జీవ యాత్రలో\\n\\n2. సర్పాల శాపం నుండి - తాపాల తేళ్లనుండి\\nరెక్కలపై మోసి - నడిపించు నాదేవా\\nనీసన్నిధి కాంతి మార్గంలో - సమృద్ధి జీవయాత్రలో\\n\\n3. బల్యర్పణ పరిహారంతో - కరుణా పీఠముగా\\nనీ సన్నిధి మందసముతో -నడిపించు నాదేవా\\nనిర్దోషమైన మార్గంలో - ఈలోక జీవ యాత్రలో\\n\\n4. యొర్దాను దరిచేరగనే - నిర్భయముగ నేదాటగన్‌\\nమృత్యుంజయుడా - నడిపించు నాదేవా\\nనవ జీవన క్రాంతి మార్గంలో - పరలోకపట్టణ యాత్రలో\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"7\",\n        \"index_letter\": \"గ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"77\",\n                \"title\": \"గొప్పదేవా - నడిపించుము\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"78\",\n        \"local_title\": \"ఘనదైవ దివితేజ దర్శించుము\",\n        \"local_hint\": \"Ghanadaiva\",\n        \"local_text\": \"ఘనదైవ దివితేజ దర్శించుము - మహిమాత్మలొ మము నింపుము\\nయేసురాజా - మా నీతిరాజా\\n\\n1. సాక్ష్యజీవితము - సన్నగిల్లిపోయె\\nసహకార సహవాసం ప్రేమ హీనమయ్యె\\nమము కరుణించి - నూతన పరచుము\\n\\n2. ప్రార్ధన ఫలములు - పొందక పోతిమి\\nనీ సేవయందున - సోమరులమైతిమి\\nఆత్మల రక్షింపనీ - శక్తినియుమా\\n\\n3. నీదు చిత్తము చేయ - నేర్పించుమయ్యా\\nనిను వెంబడింపగ - వెలుగిమ్మయ్యా\\nఆశతో నీ దరి - జేరితిమయ్యా\\n\\n4. మా యువతరమంతా - పాడైపోయె\\nశాంతి సమాధానం - కరువైపోయె\\nప్రకటించెదము నీ - ప్రేమ సువార్త\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"17\",\n        \"index_letter\": \"ఘ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"78\",\n                \"title\": \"78. ఘనదైవ దివితేజ దర్శించుము\",\n        