  \"local_title\": \"జయమని పాడెదము - యేసుని చాటెదము\",\n        \"local_hint\": \"jayamani\",\n        \"local_text\": \"జయమని పాడెదము - యేసుని చాటెదము\\nలోకమునంతటిని - ప్రేమతో గెలిచెదము\\nయేసే క్రీస్తని, క్రీస్తే ప్రభువని - పాపుల రక్షకుడని\\n\\n1. నరరూపధారియై - భువి నుదయించెను\\nనరులను రక్షింప - మరణము నొందెను\\nమూడవ దినమున - మృత్యుంజయుడాయెన్‌\\nముదమున పాడెదము - హల్లెలూయాగీతముల్\\n\\n2. నూతన సృష్టిగా - మనలను చేసెను\\nనూతన గీతమున్‌ - మన నోట నుంచెను\\nపరిశుద్దాత్ముని - వరముగ నొసగెను\\nపాడి పొగెదడెదము - ప్రభువును మనసార\\n\\n3. శుభప్రద నిరీక్షణ - మరి మనకొసగెను\\nశుభవార్త ప్రకటించే - శిష్యులుగ చేసెను\\nఅభయప్రదాతయై - మనతో నుండెను\\nఅనిశము పొగడెదము - అరమరికలు లేక\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"20\",\n        \"index_letter\": \"జ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"89\",\n                \"title\": \"89. జయమని పాడెదము - యేసుని చాటెదము\",\n                \"artist\": \"...డా.వై.బాబ్జి\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/89.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"90\",\n        \"local_title\": \"జయముక్రీస్తూ - జయ జయ లివిగో\",\n        \"local_hint\": \"jayamukristhu\",\n        \"local_text\": \"జయము క్రీస్తూ - జయ జయ లివిగో\\nభయము దీరె మరణముతో\\nసిలువ జయము మాకోసంబే\\nతులువ బ్రోవ విజయమహో!\\n\\n1. దేవా! నవ్యసృష్టి - నీవే యిలజేసి\\nసాతానుని జాడ - సిలువలోనే దునుమాడ\\nజయగీతం రహిబాడ\\n\\n 2. పాతాళము నొంచి - పరలోకము దెరిచి\\nపాపాత్ములకెంత - భాగ్యమెంచె క్షమియించి! పాడుదమా - స్తుతియించి\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"24\",\n        \"index_letter\": \"జ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"90\",\n                \"title\": \"90. జయముక్రీస్తూ - జయ జయ లివిగో\",\n                \"artist\": \"...వసురాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/90.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"91\",\n        \"local_title\": \"జయ విజయమని పాడుదమా\",\n        \"local_hint\": \"jaya vijayamani\",\n        \"local_text\": \"జయ విజయమని పాడుదమా – జయ విజయుడగు యేసునకు\\nఅపజయమెరుగని దేవునకు – జయస్తోత్రం స్తుతి చేయుదమా\\n\\n1. ఇహమందు పలు ఆపదలు ఎన్నో కలిగినను\\nనా హస్తమును పట్టుకొని వడివడిగా నన్ను నడిపించును\\n\\n2. మహా దయాళుడు యెహోవా - నన్నిల కరుణించి\\nనా పాపములనన్నిటిని -  మన్నించి మలినము తొలగించెను\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"25\",\n        \"index_letter\": \"జ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"91\",\n                \"title\": \"91. జయ విజయమని పాడుదమా\",\n                \"artist\": \"...విశ్వవాణి\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/91.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"92\",\n        \"local_title\": \"జీవనదిని నా హృదయములో\",\n        \"local_hint\": \"Jeevanadini Naa Hrudayamulo\",\n        \"local_text\": \"జీవనదిని నా హృదయములో – ప్రవహింప చేయుమయా\\n\\n1. శరీర క్రియలన్నియు నాలో నశియి౦ప జెయుమయా\\n\\n2. బలహీన సమయములో- నీ బలము ప్రసాదించుము\\n\\n3. ఎండిన యముకలన్నియు – తిరిగి జీవింప చేయుమయా\\n\\n4. ఆత్మీయ వరములతో – నన్ను అభిషేకం చేయుమయా\",\n        \"local_category\": [\n            \"prayer\"\n        ],\n        \"local_categorycount\": \"2\",\n        \"index_letter\": \"జ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"92\",\n                \"title\": \"92. జీవనదిని నా హృదయములో\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/92.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"93\",\n        \"local_title\": \"జీవము నీవే నాకై చావగ\",\n        \"local_hint\": \"jeevamu neeve\",\n        \"local_text\": \"జీవము నీవే నాకై చావగ - నాపాపంబది ఎంతో ఘోరం దేవా\\nతలచితిని వగచితిని - నను కరుణించుము నాధా దేవా (2)\\n\\n1. పరిశుద్ధుడవు పావన చరితుడ - పలునింద పాలైనావా\\nఖలుడను నేను కడు చంచలుడను - విలువైన నీ దేహం సిలువకు గొట్టితి\\n\\n2. నాతండ్రీ ఈ పాత్రను నానుండి - తొలగించందని వేడేవా\\nవేదన హెచ్చి నీమది కృంగి - దేహం చిందెనా స్వేదం రుధిరం\\n\\n3. నాదేవా నాదేవా నన్నేల - విడనాడితి వన్నావా\\nనాకలుషంబు కఠిన చీకటిగ - క్రమ్మెనా నిన్ను కలువరి లోన\\n\\n4. దప్పిగొనుచున్నానని పలికి - లేఖనమే నెరవేర్పావా\\nనా వ్యామోహం, దోషాదాహం - దీరని దాహమై నిను వేధించె\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"26\",\n        \"index_letter\": \"జ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"93\",\n                \"title\": \"93. జీవము నీవే నాకై చావగ\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/93.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"94\",\n        \"local_title\": \"జీవించు చున్నాడు యేసు ప్రభు\",\n        \"local_hint\": \"jeevinchu\",\n        \"local_text\": \"జీవించు చున్నాడు యేసు ప్రభు - నా హృదయంలో ఉన్నాడు\\nకష్టములలో నా సహాయుడై - నిత్యము జీవించును\\n\\n1. మాటచే సాగరము - పాయలై పోయె\\nకోట గోడలు కూలి మట్టమైనవి\\nగ్రుడ్డివాడు దృష్టిపొందె - ప్రభు మాటచే\\nకుష్టురోగి శుద్దుడాయె ప్రభు ముట్టగా\\n\\n2. నన్ను వదలక పట్టుకొనుము\\nనిన్ను విడువక వెంబడింతును\\nమరణించ