arthigeethavali.com/uesi/audio_songs/telugu/songs/102.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"103\",\n        \"local_title\": \"తెలియునా నీకు ఓ మానవా\",\n        \"local_hint\": \"Teliyuna\",\n        \"local_text\": \"తెలియునా నీకు ఓ మానవా - యేసు పాపుల రక్షకుడు అని\\nయేసుని నమ్మిన మోక్షమని\\n\\n1. పాపములు మనకు శాపమని - మరణమే దానికి జీతమని\\nపాపములో మరణమొందిన(2) నరకము చేరెదవు నీవని(2)\\n\\n2. పాపములు మాని క్రీస్తును జేరిన - విశ్వాసముతో క్రీస్తును వేడిన\\nపరిశుద్ధులతో నీవు చేరిన - పరమ జీవమును పొందెదవని\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"16\",\n        \"index_letter\": \"త\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"103\",\n                \"title\": \"103. తెలియునా నీకు ఓ మానవా\",\n                \"artist\": \"...ఎస్.డి.ఆనంద్ రాజ్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/103.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"104\",\n        \"local_title\": \"ద్రాక్షవల్లి - ప్రభుయేసే\",\n        \"local_hint\": \"Draksavalli\",\n        \"local_text\": \"ద్రాక్షవల్లి - ప్రభుయేసే తీగవలె - నేనుందును\\nఫలియింపని ప్రతి తీగెను పారవేయున్ పరలోకమునకు రానియ్యడు\\nహల్లెలూయా.. హల్లెలూయా.. హల్లెలూయా.. ఆమెన్‌. హల్లెలూయా\\n\\n1. గొప్ప విశ్వాసముతో హెబేలు\\nపరిశుద్ధ దేవునితో మాట్లాడెను\\nహెబేలు వలె విశ్వాసముతో (2)\\nపరిశుద్ధ దేవునితో మాట్లాడెదను  #హల్లెలూయా#\\n\\n2. మరణము లేకయే హనోకు\\nనడిచెను దేవునితో విశ్వాసముతో\\nహనోకు వలె విశ్వాసముతో (2)\\nదేవునితో నేను నడిచెదను  #హల్లెలూయా#\\n\\n3. దేవుని మాటకు లోబడి నోవాహు\\nనిర్మించెను ఓడను విశ్వాసముతో\\nనోవాహు వలె విశ్వాసముతో (2)\\nదేవుని మాటకు నేను లోబడెదను  #హల్లెలూయా#\\n\\n4. విశ్వాసుల తండ్రి అగు అబ్రాహాము\\nనిరీక్షణతో బయలు దేరెను\\nఅబ్రాహామువలె నిరీక్షణతో (2)\\nదేవునితో నేను సాగెదను  #హల్లెలూయా#\\n\\n5. దేవుని పిలుపుననుసరించి మోషే\\nనడిపించెను ప్రజలను విశ్వాసముతో\\nమోషేవలె విశ్వాసముతో (2)\\nదేవుని పిలుపు ననుసరించెదను #హల్లెలూయా#\\n\\n6. విశ్వాసమునకు కర్త యేసుక్రీస్తే\\nదానిని కొనసాగించే యేసుని వైపు చూస్తూ\\nమన యెదుట ఉంచబడినా పందెములో (2)\\nఓపికతో నేను పరుగెత్తెదన్  #హల్లెలూయా#\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"13\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"104\",\n                \"title\": \"ద్రాక్షవల్లి - ప్రభుయేసే\",\n                \"artist\": \"...జె.వి.పద్మలత\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"105\",\n        \"local_title\": \"దినదినంబు యేసుకు దగ్గరగా చేరుతా\",\n        \"local_hint\": \"Dinadinambu\",\n        \"local_text\": \"దినదినంబు యేసుకు దగ్గరగా చేరుతా\\nఅనుక్షణంబు యేసునే నా - మదిలో కోరుతా\\nఎల్లప్పుడు యేసువైపు కన్నులెత్తి పాడుతా\\nపరమ తండ్రి నీదు మాట - బలముతోడ సాగుతా\\n\\n1. మారిపోయే లోకమందు మనుజులెంతో మారినా\\nమారునా ప్రభు యేసు ప్రేమ ఆశతోడ జేరనా\\n\\n2. ఎన్నడు ఎడబాయడు - నన్ను - విడువడు ఏ మాత్రము\\nప్రభువే నాకు అభయము - భయ - పడను నేనేమాత్రము\\n\\n3. దైవ వాక్యం - జీవవాక్యం - అనుదినంబు చదువుతా\\nప్రభువు మాట - నాదుబాట - విభునితో - మాట్లాడుతా \\n\\n4. పరిశుద్ధముగ అనుకూలముగా - జీవయాగమై నిలిచెదా!\\nసిలువ మోసి - సేవ చేయ - యేసుతోనే - కదులుతా\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"13\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"105\",\n                \"title\": \"105. దినదినంబు యేసుకు దగ్గరగా చేరుతా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/105.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"106\",\n        \"local_title\": \"దూరమరిగిన చిన్ని తనయా\",\n        \"local_hint\": \"Duramarigina\",\n        \"local_text\": \"దూరమరిగిన చిన్ని తనయా - తండ్రి యింటికి మరలి రా\\nతండ్రి కడకే కదలిరా - తండ్రి యింటికి మరలి రా\\n\\n1.స్వేచ్చ కోరుకొంటివి - వాంఛదీర చెడితివి\\nస్నేహితులతో తెలివి లేక - త్రాగి తూలెదవా - త్రాగి తూలెదవా\\n\\n2. చాలదూరము పోతివి - మేలు గానక యుంటివి\\nకఠిన లేమితో అలమటించే - కలత నిదురేలా (2)\\n\\n3. తండ్రి సంపద తరుగునా - తండ్రి ప్రేమ మారునా\\nపరుగులెత్తే హృదయ వేదన - పిలుపు వినలేవా (2)\\n\\n4. ప్రాణమిచ్చి ప్రేమ చూపిన - క్రీస్తు నీకై లేచెరా\\nపాప దాస్యము బాపి - నిత్య జీవమిచ్చునురా\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"17\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"106\",\n                \"title\": \"106. దూరమరిగిన చిన్ని తనయా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/106.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"107\",\n        \"local_title\": \"దేవ సంస్తుతి చేయవే మనసా\",\n        \"local_hint\": \"Deva sanstuti\",\n        \"local_text\": \"దేవ సంస్తుతి చేయవే మనసా - శ్రీ మంతుడగు యెహోవా సంస్తుతి చేయవే మనసా\\nదేవ సంస్తుతి చేయుమా నా - జీవమా యెహోవా దేవుని పావన నామము\\nనుతించుమా నా యంతరంగము లో వసించు నో నమస్తమా\\n\\n1. జీవమా యెహోవా నీకు - చేసిన మేళ్ళను మరువకు - నీవు చేసిన పాతకంబులను\\nమన్నించి జబ్బు - లేవియున్‌ లేకుండ జేయును - ఆ కారణముచే\\n\\n2 చావు గోతి నుండి నిన్ను - లేవనెత్తి దయను గృపను - జీవకిరీటమును వేయును - నీ\\nశిరస్సు మీద - జీవ కిరీటముగ వేయును - ఆ కారణముచే\\n\\n3. అత్యధిక ప్రేమ స్వరూపి - యైన దీర్ఘశాంతపరుడు - నిత్యము వ్యాజ్యంబు చేయడు\\nఆ కృపోన్నతుడు - నీ పయినెపుడు కోపముంచడు - ఆకారణముచే.\\n\\n4. పామరులమని ప్రత్యుపకార - ప్రతిఫలంబుల్‌ పంపలేదు - భూమికన్న\\nనాకసంబున్న - యొత్తుండు దైవ - ప్రేమ భక్తజనుల యందున - ఆ కారణముచే\\n\\n5. పడమటికి తూర్పెంత యెడమో - పాపములకున్‌ మనకు నంత - యెడము గలుగచేసి\\nయున్నాడు - మన పాపములను ఎడముగానే చేసి యున్నాడు - ఆ కారణముచే\\n\\n6. పరమ దేవ నిబంధనాజ్ఞల్‌ - భక్తితో గైకొను జనులకు - నిరతము కృపనిలిచి యుండును\\nయెహోవ నీతి - తరముల పిల్లలకు నుండును - ఆ కారణముచే\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"14\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"107\",\n                \"title\": \"దేవ సంస్తుతి చేయవే మనసా\",\n                \"artist\": \"...ముంగమూరి దేవదాసు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"108\",\n        \"local_title\": \"దేవా కొనియాడి పాడి\",\n        \"local_hint\": \"Deva koniyadi\",\n        \"local_text\": \"1. దేవా కొనియాడి పాడి కీర్తింతుము స్తుతియింతుము\\nతండ్రీ నీమాట బ్రతికించెను నీ ఊట మము నింపెను\\nకొనియాడి కీర్తింతుము మహిమోన్నతా రాజా\\nమహిమైశ్వర్య దాతా స్తుతి ఆరాధన నీకే\\nకొనియాడి కీర్తింతుము  నీ మాట.......\\n\\n2. ప్రభువా కొనియాడి పాడి కీర్తింతుము - పూజింతుము\\nతనయా - నీ రక్తం మము కడిగెను\\nనీ శక్తి మము నింపెను\\nకొనియాడి కీర్తింతుము  #మహిమోన్నతా#\\n నీ రక్తం........॥\\n\\n3. శుద్దాత్మా కొనియాడి పాడి\\nకీర్తింతుము - ఘనపరతుము\\nకర్తా - నీ సత్యం నడిపించెను\\nమము నిత్యం నడిపించును\\nకొనియాడి కీర్తింతుము  #మహిమోన్నతా#\\nనీ సత్యం......... ||\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"29\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"108\",\n                \"title\": \"108. దేవా కొనియాడి పాడి\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/108.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"109\",\n        \"local_title\": \"దేవా నీఅతిధిగా నేనుండగలనా?\",\n        \"local_hint\": \"Deva niatidhiga\",\n        \"local_text\": \"దేవా నీఅతిధిగా నేనుండగలనా?\\nనీ పర్వతముపై నివసింపగలనా?\\nయదార్ధమైన ప్రవర్తనతో నీ నీతినే అనుసరింతును\\n\\n1. హృదయ పూర్వకముగా నిజము పలికెదన్‌\\nనా నాలుకతో కొండెము లాదను\\n\\n2. చెలికానికి నే కీడు చేయను\\nపొరుగువానిపై నిందమోపను\\n\\n3. నీ భక్తులనే సన్మానించెదను\\nనష్టమొచ్చినా మాట తప్పను\\n\\n4. నా ద్రవ్యమును వడ్డీకియ్యను\\nలంచమేమియూ పుచ్చుకొనను\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"15\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"109\",\n                \"title\": \"109. దేవా నీఅతిధిగా నేనుండగలనా?\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/109.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"110\",\n        \"local_title\": \"దేవా నీ కార్యములు\",\n        \"local_hint\": \"devaa ne Karyamulu\",\n        \"local_text\": \"దేవా నీ కార్యములు - ఎంత యద్భుతములు\\nనేచూడగా - మహాద్భుతములు - మహాద్భుతములు\\n\\n1. వివరింపచాలదే - జ్ఞానమంతయు\\nమహాద్భుతకరుడా - మాగొప్పదేవుడా\\n\\n2. కల్వరి సిలువలో - కార్చిన రక్తమే\\nకడిగె పాపము - కరుణాకరుడా\\n\\n3. నీ ప్రేమ గొప్పది - నిత్యమైనట్టిది\\nచెప్పనశక్యము - గొప్పమా ప్రభువా\\n\\n4. సమస్తమును మా - మేలు కొరకెగా\\nజరిగించు చుంటివి - స్త్రొత్రము ప్రభువా\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"16\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"110\",\n                \"title\": \"దేవా నీ కార్యములు\",\n                \"artist\": \"...జి.ఎఫ్.వి.ప్రసాద్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"111\",\n        \"local_title\": \"దేవా నీ నామం పావన ధామం\",\n        \"local_hint\": \"devaa ne naamam\",\n        \"local_text\": \"దేవా నీ నామం పావన ధామం\\nబ్రోవుమయ్య ప్రేమ రూప నీదు జనులం\\nనీదు సన్నిధిలో నిను వేడుకొందుమూ వేచి యుందుము\\nనీదు కృపనొంది మేము ఉత్పహించెదం\\nజయించెదము - స్తుతించెదము\\n\\n1. శుద్ధ మనసు లేక మేము దూరమైతిమి\\nశ్రద్ధతో నీదు మార్గం వెదుకమైతిమి\\nబుద్ధి గలిగి నీదు మాట వైపు తిరిగెదం\\nతగి యుండెదం మొర్ర పెట్టెదం\\n\\n2. మెండుగా నెరవేర్చునీదు వాగ్దానం\\nదండిగా నింపు నీదు నిండు జీవము\\nఅండబండ కోట నీకై ఎదురు చూచెదం\\nబలమొందెదం - పరుగెత్తెదం\\n\\n3. విన్నపములన్ని విని క్షమియించుము\\nసన్నుతుండ స్వస్థపరచు మాదు దేశమున్‌\\nనిన్ను చాటి చూపి నీకై నిలిచి యుండెదం\\nగెలిచి వెళ్లెదం సేవ జేసెదం\",\n        \"local_category\": [\n            \"prayer\"\n        ],\n        \"local_categorycount\": \"3\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"111\",\n                \"title\": \"111. దేవా నీ నామం పావన ధామం\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/111.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"112\",\n        \"local_title\": \"దేవా నీ నామం బలమైనది\",\n        \"local_hint\": \"devaa ne naamam\",\n        \"local_text\": \"దేవా నీ నామం బలమైనది నీ నామం (2)\\nస్తుతియింతును నీ నామం\\nఘనపరతును నీ నామం\\nఅన్నిటికన్నా పై నామం\\nయేసయ్య నీ నామం (4)\\nఆశ్రయ దుర్గము నీ నామం\\nనా కొండ నా కోట (2) స్తుతియింతు........\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"30\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"112\",\n                \"title\": \"దేవా నీ నామం బలమైనది\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"113\",\n        \"local_title\": \"దేవుడు చేసిన దినమిదే\",\n        \"local_hint\": \"Devudu chesina\",\n        \"local_text\": \"దేవుడు చేసిన దినమిదే - నిన్నటి రేపటి వలె కాదు\\nప్రత్యేకంగా దీన్ని చేశాడు - పాడి యానందించుడి\\n\\n1. ప్రతిరోజు ఒక క్రొత్తరోజు - ముందెన్నడు రాలేదీ రోజు\\nమరెన్నడూ రాబోదీ రోజు - ప్రత్యేక బహుమతి క్రొత్తరోజు\\nఆనందంగా పనిచేయాలి ఈ రోజు - ఎంతో స్తుతి చెల్లించాలీ రోజు\\n\\n2. రేపటినేమో లెక్కించకు - రేపేదో బాగుంటుందనే మోజు\\nబైబిలు చేబుతుంది ఈలాగు - హెచ్చుతగ్గులుంటాయి ప్రతిరోజు\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"17\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"113\",\n                \"title\": \"దేవుడు చేసిన దినమిదే\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"114\",\n        \"local_title\": \"దేవుడొకడున్నాడని ఆలోచించవా\",\n        \"local_hint\": \"Devudokadunnadani\",\n        \"local_text\": \"దేవుడొకడున్నాడని ఆలోచించవా\\nనిన్ను కూడ చేసినోణ్ణి తెలిసికోలేవా\\nఅడవి పూల నడిగి చూడు - పడిలేచే కడలి చూడు\\nవిశ్వమంత ఏలే వాడు ఉన్నాడని తెలియదా\\nఓ అన్నా మేలుకోవా ఓ అక్కా గమనించవా\\n\\n1. చక్కనైన చుక్కలెన్నో - చెప్పకుండ చెబుతున్నా\\nరేయి పగలు మానకుండ నీతో మొత్తుకున్నా\\nసూరీడు కాంతి వలె సత్యమెంతో ప్రాకినా  #విశ్వమంత#\\n\\n2. ఆదిలోనే పలికాడు - అంధకారం బాపాడు\\nఆ మాటలన్నిటిని పొందు పరచి యిచ్చాడు\\nనీ పాపం చూపించే మాటలెన్నో చెప్పాడు    #విశ్వమంత#\\n\\n3. నీలోన మెదిలేటి అంతరాత్మ నడిగి చూడు\\nఅనుకున్న దొక్కటైతే చేసేది మరియొకటి\\nమనశ్శాంతి పోయినా మనుగడ ఓడినా  #విశ్వమంత#\\n\\n4. పాపలోకానికే పరమాత్ముడొచ్చాడు\\nపాపానికే తాను బలిగా మారాడు\\nపరలోక తలుపు తీసి స్వాగతం పలికాడు  #విశ్వమంత#\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"18\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"114\",\n                \"title\": \"114. దేవుడొకడున్నాడని ఆలోచించవా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/114.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"115\",\n        \"local_title\": \"దేవుని యెదుట యోగ్యునిగా\",\n        \"local_hint\": \"Devuni yeduta\",\n        \"local_text\": \"దేవుని యెదుట యోగ్యునిగా నీవు ఎప్పుడు కనబడుమా\\nబ్రోవగ నశించు ఆత్మలను, దైవవాక్కుతో సిద్ధపడుమా\\n\\n1. అబ్రహాము వంటి విశ్వాసము, యోసేపు వంటి పవిత్రత\\nమోషేవంటి నమ్మకత్వము, యెహోషువ వంటి స్థిర నిర్ణయం\\nయోబు వంటి భయభక్తులు - దానియేలు వంటి దైవజ్ఞానం\\nనీకు కూడా కావాలి, నీవు ఇంకా మారాలి\\n\\n2. అపోస్తలుల పరిచర్య, పౌలు చేసిన పానార్పణ\\nతిమోతిలోని వినే మనస్సు, ఎపఫ్రా చేసిన ప్రార్ధనలు\\nయేసుప్రభుని దీనత్వం, తండ్రి దేవుని వాత్సల్యం\\nనీకు కూడా కావాలి, నీవు ఇంకా మారాలి\\n\\n3. మాటలలో, విశ్వాసములో, ప్రవర్తనలో, పవిత్రతలో\\nప్రేమలో మరి అన్నిటిలో మాదిరి నీవు చూపాలి\\nసిగ్గుపడని పని వానిలా సత్యవాక్యము సరిగాను\\nనీకు కూడా కావాలి, నీవు ఇంకా ఎదగాలి\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"22\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"115\",\n                \"title\": \"దేవుని యెదుట యోగ్యునిగా\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"116\",\n        \"local_title\": \"దేవుని కొరకు నా ప్రాణము\",\n        \"local_hint\": \"Devuni koraku\",\n        \"local_text\": \"దేవుని కొరకు నా ప్రాణము - తృష్టగొనుచున్నది\\nదుప్పి నీటి వాగులకై - ఆశపడునట్లుగా\\nఆదరణ, ఆనందము - ఆయనలో అనుదినము\\n\\n1. దేవుని సన్నిధికి - నేనెప్పుడు వత్తునని\\nనిరతము ఆయన ప్రేమకొరకై - దాహము గొనుచున్నది \\nఆదరణ, ఆనందము - ఆయనలో అనుదినము\\n\\n2. మరణపు పాశములు - నను చుట్టుకొని యుండగా\\nవిడిపించి జీవములోనికి - నన్ను నడిపించెను యేసు\\nఆదరణ, ఆనందము - ఆయనలో అనుదినము\\n\\n3. దివారాత్రములు - దైవ వాక్యధ్యానము కొరకై\\nప్రార్ధన సహవాసంబు కొరకై - ఆకలి గొనుచున్నది\\nఆదరణ, ఆనందము - ఆయనలో అనుదినము\\n\\n4. భక్తి హీనుడనైయుండ - బలహీనుడనై యుండగా\\nఆత్మాభిషేకము నిచ్చి క్రీస్తు - సాక్షిగా జేసె నన్ను\\nఆదరణ, ఆనందము - ఆయనలో అనుదినము\\n\\n5. పాపులన్‌ పరికింపగా - నాలో ప్రసవ వేదన కలిగె\\nఆత్మలన్‌ సంపాదించవలెనను - దాహము గొనుచున్నది \\nఆదరణ, ఆనందము - ఆయనలో అనుదినము\\n\\n6. హల్లెలూయ సోత్రముల్‌ - ప్రభు యేసునకే మహిమ\\nనిరతము స్తుతులు కీర్తి ఘనత - ఆయన నామముకే\\nఆదరణ, ఆనందము - ఆయనలో అనుదినము\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"18\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"116\",\n                \"title\": \"116. దేవుని కొరకు నా ప్రాణము\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/116.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"117\",\n        \"local_title\": \"దేవునితో జత పనివారము\",\n        \"local_hint\": \"Devunito\",\n        \"local_text\": \"దేవునితో జత పనివారము - రయమున సాగెదము\\nసిలువను మోసి - శ్రమలు సహించి జయమని పాడెదము\\nహల్లెలూయా హల్లెలూయా హల్లెలూయా హల్లెలూయా హల్లెలూయా హల్లెలూయా\\n\\n1. క్రీస్తే మనకు నాయకుడు - ప్రేమే మన మార్గము\\nయేసును చాటుచు - ఆత్మల వెదకుచు\\nముందుకు సాగెదము ముందుకు సాగెదము  #హల్లెలూయా#\\n\\n2. మహిమ కిరీటమె బహుమానము - ఆశింపమిల నేదియు\\nనిందలు భరియించి - వాక్యము వెదజల్లి\\nయేసులో ఫలియింతుము యేసులో ఫలియింతుము  #హల్లెలూయా#\\n\\n3. చీకటి పొలమెంతో విస్తారము - పోరాట మధికము\\nయేసుని ధరియించి - వాక్యము చేబూని\\nసాతాను నోడింతుము సాతాను నోడింతుము  #హల్లెలూయా#\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"23\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"117\",\n                \"title\": \"117. దేవునితో జత పనివారము\",\n                \"artist\": \"...ఆలీస్ మేరీ\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/117.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"118\",\n        \"local_title\": \"దేవుని పిలుపును వినుము\",\n        \"local_hint\": \"Devuni pilupunu\",\n        \"local_text\": \"దేవుని పిలుపును వినుము - పరిశుద్ధపిలుపది చూడు\\nపరలోకసంబంధమైనట్టిది - ఉన్నతమైనట్టిది (2)\\nనడుచుకొనుము - తగినట్లుగా - శ్రద్ధతో ఐక్యత కాపాడుకో\\nనడుచుకొనుము - తగినట్లుగా - ప్రేమతో సహనపు వినయముతో\\n\\n1. ఆత్మీయబంధము కాపాడుకో - ఆత్మలో ప్రార్ధించు అనవరతం\\nఆత్మయందే ఆనందించుము - ఆత్మకు లోబడుము\\nఆత్మానుసారివై నడువు  #నడు#\\n\\n2. పరిశుద్దులగుటయె ప్రభు చిత్తము - పరిశుద్ధపరచెను ప్రభుక్రీస్తుడు\\nసమర్పించుము జీవితము - ప్రతిష్టించు ప్రభుకొరకే\\nప్రభునిల సేవించుటకై  #నడు#\\n\\n3. సువార్త సాక్ష్యము కాపాడుకో - సువార్త సత్యము ప్రకటించుము\\nవాక్యముతో ధ్యానముతో - సంధించు యౌవ్వనులన్‌