n            }\n        ]\n    },\n    {\n        \"local_id\": \"120\",\n        \"local_title\": \"దేవుని వారసులం\",\n        \"local_hint\": \"Devuni vaarasulam\",\n        \"local_text\": \"దేవుని వారసులం - ప్రేమ నివాసులము\\nజీవన యాత్రికులం - యేసుని దాసులము\\nనవయుగ సైనికులం - పరలోక పౌరులము - హల్లెలూయ\\nనవయుగ నైనికులం - పరలోక పౌరులము\\n\\n1. దారుణ హింసలలో - దేవుని దూతలుగా ఆరని జ్వాలలో - ఆగని జయములతో\\nమారని ప్రేమ సమర్పణతో - సర్వత్ర యేసుని కీర్తింతుము\\n\\n2. గోధుమ గింజవలె - క్రీస్తుడు చావగను\\nనాధుడు మరణములో - శాశ్వత జీవమును\\nనిధులను పండించి లేవగను - మాధుర్య రక్షణ లభియించె\\n\\n3. హత సాక్షుల కాలం - అవనిలో చెలరేగ\\nగతకాలపు సేవ - గొల్గొత గిరిచేర\\nభీతులలో బహురీతులలో - నూతన లోకము కాంక్షింతుము\\n\\n4. ప్రభువును చూచుటకై - ప్రజలందరు రాగా\\nవిభు మహిమను గాంచ - విశ్వమె మము గోర\\nశుభములు గూర్చుచు మాలోన - శోభిల్లు యేసుని జూపుదము\",\n        \"local_category\": [\n            \"missions\"\n        ],\n        \"local_categorycount\": \"6\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"120\",\n                \"title\": \"దేవుని వారసులం\",\n                \"artist\": \"...రెవ.డా.ఎ.బి.మాసిలామణి\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"121\",\n        \"local_title\": \"దేహమును దేవునికి\",\n        \"local_hint\": \"Dehamunu devuniki\",\n        \"local_text\": \"దేహమును దేవునికి - సజీవ యాగముగాను\\nఅర్పణము అంకితము - అదేగా నా నిశ్చయము\\n\\n1. అర్పణబలులేవీ - ఆయన కోరడుగా\\nనలిగినది విరిగినది - నామది నిమ్మనెను\\n\\n2. క్రీస్తే క్రయధనమై - నా కొరకీయబడె\\nతన మరణ మదినాకై - ఘనమని చాటెదము\\n\\n3. అక్రమ పాపమును - క్షమియించెను తాను\\nతన నెరిగి మెలిగినను - తన సుతునిగ నిలుపు\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"26\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"121\",\n                \"title\": \"దేహమును దేవునికి\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"122\",\n        \"local_title\": \"దైవ దర్శనం కోరుము\",\n        \"local_hint\": \"Daiva darsanam\",\n        \"local_text\": \"దైవ దర్శనం కోరుము - దైవ మహిమను వెదకుము\\nదైవదర్శనం పొందుము - ఆత్మలను రక్షించుము\\n\\n1. మండుచున్న పొదను - మోషే చూచెను\\nదేశ చరిత్ర మారిపోయెను (2)\\nజాతి చరిత్ర గతి మారెను (2)\\nఓ సోదరా, ఓ సోదరీ - జాతి చరిత్ర మార్చరావా (2)\\n\\n2. దేవుని మహిమను యెషయా - చూచెను\\nసేవ స్వరూపం మారిపోయెను (2)\\nదైవ సేవ స్వరూపం మారెను (2)\\nఓ సోదరా, ఓ సోదరా - దైవ పిలుపుకు లోబడుమా (2)\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"27\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"122\",\n                \"title\": \"దైవ దర్శనం కోరుము\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"123\",\n        \"local_title\": \"దైవసుతుని ప్రేమకన్న\",\n        \"local_hint\": \"Daivasutuni\",\n        \"local_text\": \"దైవసుతుని ప్రేమకన్న మిన్న ఏమున్నది?\\nఆ ప్రభుని కంటె వేరె దైవమేమున్నది?\\n\\n1. మనకు దైవమాయెనే - మనకు సత్యమాయెనే\\nమనకు మార్గమాయెనే - మనకు సర్వమాయనే\\n\\n2. ధరణిలోన పాపముల్‌ - కరుణతోడ బాపగన్‌\\nమానవునిగ వెలసెగా - మహిమరాజు ఆయనే\\n\\n3. దయయు సత్యమెన్నడు - నిన్ను విడువనీయడు\\nఆయనే నీ త్రోవను - సరళముగను జేయుము\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"19\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"123\",\n                \"title\": \"దైవసుతుని ప్రేమకన్న\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"124\",\n        \"local_title\": \"దైవసొత్తయిన జనమా లెమ్ము\",\n        \"local_hint\": \"Daivasottayina\",\n        \"local_text\": \"1. దైవసొత్తయిన జనమా లెమ్ము దివ్య రాజ్యంబు స్థాపించుము\\nదైవతనయుండే పునాదిగా దివ్య వాక్యంబు చేబూనుము\\nధృడ సంకల్పంతో దైవకృప తోడుగా\\nసిలువ నినాదంతో సిలువ సువార్తతో\\nవాక్యసత్యంబు బోధించుము\\n\\nపరిశోధించు - పాటించు\\nప్రభుని ప్రేమతో - నేర్పించు\\n\\n2.ఆత్మీయ సదస్సులోనే ఆత్మబలమొంది పనిచేయుము\\nఆత్మనాధుని సేవించుము ఆత్మ భారంబుతో మెలగుము\\nవాక్యమే దేవుడు వాక్యమే జీవము\\nవాక్యమే సత్యము వాక్యమే అక్షయం\\nవాక్యవెలుగులో నడిచెదము\\n\\nపరిశోధించు - పాటించు\\nప్రభుని ప్రేమతో - నేర్పించు\\n\\n3. పట్టభద్రులారా రండిక\\nపెద్ద విద్యార్దులు లెండిక\\nపట్టుకొనుడి పలువిద్యార్దులన్‌\\nదిట్టపరచండి ప్రభుక్రిస్తులో\\nమంచి శిష్యునిగా\\nమంచి విశ్వాసిగా\\nమంచి పనివానిగా\\nమంచి పౌరునిగా\\nవాక్య జ్ఞానంలో స్థిరపరచుము\\n\\nపరిశోధించు - పాటించు\\nప్రభుని ప్రేమతో - నేర్పించు\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"28\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"124\",\n                \"title\": \"124. దైవసొత్తయిన జనమా లెమ్ము\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/124.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"125\",\n        \"local_title\": \"దైవం ప్రేమ స్వరూపం\",\n        \"local_hint\": \"Daivam prema\",\n        \"local_text\": \"దైవం ప్రేమ స్వరూపం – ప్రేమకు భాష్యం – శ్రీయేసుడే – అవనిలో(2)\\nఆ .. ప్రేమే త్యాగ భరితం – సిలువలో దివ్య చరితం(2)\\n\\n1. ఈ ధరలో ప్రేమ శూన్యం – ఆదరణలేని గమ్యం(2)\\nమధురంపు యేసు ప్రేమ – మదినింపు మధుర శాంతి\\nమధురంపు యేసు ప్రేమా – మదినింపు మధుర శాంతి\\n\\n2. ప్రేమంటే కామం కాదు - ప్రేమెపుడు ద్వేషం గాదు (2)\\nక్షమియించే క్రీస్తు ప్రేమ - భ్రమలన్ని బారద్రోలున్ (2)\\n\\n3. కరుణించి క్రీస్తు నీకై – మరణించే సిలువ బలియై\\nపరలోక దివ్య ప్రేమన్ – ధరనిచ్చె నిన్ను బ్రోవన్\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"19\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"125\",\n                \"title\": \"125. దైవం ప్రేమ స్వరూపం\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/125.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"126\",\n        \"local_title\": \"ధర్మశాస్త్రము దేవుని హస్తము\",\n        \"local_hint\": \"Dharmasastramu\",\n        \"local_text\": \"ధర్మశాస్త్రము దేవుని హస్తము తోడునిలబడును\\nఅధిపతుల అనుగ్రహమే పొందును మనవి చేసినవి\\nఇష్టపూర్వక మనుషుల మనసులు కలసి సాగుటకై\\nస్వేచ్చగా అర్పించినవన్నియు పనిలో నిలచుటకై\\n\\n1. ధర్మశాస్త్రమున్‌ పరిశోధించుము\\n కరుణాహస్తము తోడుగనుందును\\nశుద్ధిచేయునుగా సిద్ధపరచునుగా\\nనిన్ను ఆత్మలో వెలిగించు ప్రభువు\\n\\n2. ధర్మశాస్త్రము చొప్పున నడువుము\\nకావలసినవి నీకివ్వబడును\\nజ్ఞానమిచ్చునుగా బలము కూర్చునుగా\\nఅనుగ్రహించే దేవునికి సోత్రము\\n\\n3. ధర్మశాస్త్రపు కట్టడల్‌ నేర్పుము\\nతెలియనివారికి తెలుపు విధులను\\nకార్యం చేయునుగా కనికరించునుగా\\nకృపతో రక్షణ స్థిరపరచు దేవుడు\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"20\",\n        \"index_letter\": \"ద\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"126\",\n                \"title\": \"126. ధర్మశాస్త్రము దేవుని హస్తము\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/126.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"127\",\n        \"local_title\": \"నడిచెదన్ దేవా నేను\",\n        \"local_hint\": \"Nadicedan deva\",\n        \"local_text\": \"నడిచెదన్ దేవా నేను నడిచెదన్ దేవా \\nనీ మార్గం నేనుండు చోటన్ సత్యం బోధించు బాటన్ \\nనడిచెదన్ దేవా నేను నడిచెదన్ దేవా \\n\\n1. నీవే మార్గము దేవా నీవే సత్యము \\nనీదు నామం పరిశుద్ధం నీదు జీవం పరిపూర్ణం\\n\\n2. నాదు కుమ్మరి నీవే మంచి కాపరి \\nనీతో నిరతం సాగాలి, నీకు చేరువ కావాలి\\n\\n3.నాదు జీవితం దేవా నీకే అంకితం \\nనేను నీలో ఎదగాలి నీదు ప్రేమను చాటాలి\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"21\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"127\",\n                \"title\": \"127. నడిచెదన్ దేవా నేను\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/127.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"128\",\n        \"local_title\": \"నడిపించు నా నావా\",\n        \"local_hint\": \"Nadipinchu naa naava\",\n        \"local_text\": \"నడిపించు నా నావా నడి సంద్రమున దేవా\\nనవ జీవన మార్గమున నా జన్మ తరియింప\\n\\n1. నా జీవిత తీరమున నా అపజయ భారమున\\nనలిగిన నా హృదయమును నడిపించుము లోతునకు\\nనా యాత్మ విరబూయ నా దీక్ష ఫలియింప\\nనా నావలో కాలిడుము నా సేవ చేకొనుము\\n\\n2. రాత్రంతయు శ్రమపడినా రాలేదు ప్రభు జయము\\nరహదారులు వెదకిననూ రాదాయెను ప్రతిఫలము\\nరక్షించు నీ సిలువ రమణీయ లోతులలో\\nరతణాలను వెదకుటలో రాజిల్లు నా పడవ\\n\\n3. ఆత్మార్పణ చేయకయే ఆశించితి నీ చెలిమి\\nఅహమును ప్రేమించుచునే అరసితి ప్రభు నీ కలిమి\\nఆశ నిరాశాయే ఆవేదనెదురాయే\\nఆధ్యాత్మిక లేమిగని అల్లాడే నావలలు\\n\\n4. ప్రభు మార్గము విడచితిని ప్రార్థించుట మానితిని\\nప్రభు వాక్యము వదలితిని పరమార్థము మరచితిని\\nప్రపంచ నటనలలో ప్రావీణ్యమును బొంది\\nఫలహీనుడనై యిపుడు పాటింతు నీ మాట\\n\\n5. ప్రభు యేసుని శిష్యుడనై ప్రభు ప్రేమలో పాదుకొని\\nప్రకటింతును లోకములో పరిశుద్ధుని ప్రేమ కథ\\nపరమాత్మ ప్రోక్షణతో పరిపూర్ణ సమర్పణతో\\nప్రాణంబును ప్రభు కొరకు పానార్పణము జేతు\",\n        \"local_category\": [\n            \"nothing\"\n        ],\n        \"local_categorycount\": \"5\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"128\",\n                \"title\": \"నడిపించు నా నావా\",\n                \"artist\": \"...రెవ.డా.ఎ.బి.మాసిలామణి\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"129\",\n        \"local_title\": \"నజరేతువాడా - నిన్ను చూడాలి\",\n        \"local_hint\": \"Najaretuvada\",\n        \"local_text\": \"నజరేతువాడా - నిన్ను చూడాలి\\nనా యేసునాధా - నిన్ను చేరాలి\\nనీదు రక్తధారలె నను కడగాలి\\nనీదు సాక్షిగ - నేను బ్రతకాలి\\nహల్లెలూయా పాటలు - ఆనంద గీతికలు\\nనా జీవిత కాలమంతా గాన మాలపించాలి\\n\\n1. నీ‌ స్వస్థత కావాలి - నీదు మాటలే వినాలి\\nనా జీవిత కాలమందు - నీ గానము చేయాలి\\nనీ రెక్కల చాటున - నేను దాగి యుండాలి\\nనా ప్రాణ నాధుడా - నీ స్తోత్ర గీతి పాడాలి (2)\\n\\n2. నీదు అడుగు జాడలయందు - నేను సాగిపోవాలి\\nనీజల్దరు నీడలోన - నేను విశ్రమించాలి\\nభూదిగంత వాసులంతా - నీవే రారాజు వనుచు\\nనీ దివ్య సన్నిధి చేరి - నవ్యగీతి పాడాలి\\nనీ దివ్య సన్నిధి జేరి - నవ్యగీతి పాడాలి\\n\\n3. నీ నామము ఎరుగని వారి - కడకు నేను పోవాలి\\nనీ దివ్య ప్రేమ సువార్త - లోకమందు చాటాలి\\nనీ సిలువ శాంతిలో - నీ కరుణ కాంతిలో\\nనా జీవిత కాలమంతా - నేను సాగిపోవాలి\\nనా జీవితకాలమంతా - నేను సాగిపోవాలి\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"22\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"129\",\n                \"title\": \"129. నజరేతువాడా - నిన్ను చూడాలి\",\n                \"artist\": \"...పీటర్ సింగ్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/129.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"130\",\n        \"local_title\": \"నన్ను ప్రేమించుచున్నావా\",\n        \"local_hint\": \"Nannu premincucunnava\",\n        \"local_text\": \"నన్ను ప్రేమించుచున్నావా? నన్ను ప్రేమించుచున్నావా?\\nనన్ను ప్రేమించుచున్నావా? నా ప్రియ శిష్యుడా\\nనా గొర్రెలను కాయుము నా గొర్రెలను కాయుము\\nనా గొర్రెలను కాయుము నా ప్రియ శిష్యుడా\\n\\n1. లోకమే నన్ను త్రోసి వేసిన - శోధనలు నన్ను ఆవరించినా\\nనిన్ను ప్రేమింతు -నాప్రభు -నా ప్రియ రక్షకా  #నా గొర్రెలను#\\n\\n2. నీ సిలువయే నాకు మార్గము- నీ మరణమే - నాకు జీవము\\nనిన్ను ప్రేమింతు -నాప్రభూ-నా ప్రియరక్షకా  #నా గొర్రెలను#\\n\\n3. నీ శ్రమలలో పాలివాడనై - నీ మహిమలో - జోడివాడనై\\nనిన్ను ప్రేమింతు నేను మరతునా - నీదు శక్తిని విస్మరింతునా  #నా గొర్రెలను#\\n\\n4. నీదు ప్రేమను నేను మరతునా - నీదు శక్తిని విస్మరింతునా\\nఅందుకొనుము నా సమస్తము - నాదు హృదయము  #నా గొర్రెలను#\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"29\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"130\",\n                \"title\": \"నన్ను ప్రేమించుచున్నావా\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"131\",\n        \"local_title\": \"నశియించు ఆత్మలను\",\n        \"local_hint\": \"Nasiyincu atmalanu\",\n        \"local_text\": \"నశియించు ఆత్మలను - రక్షింప యేసుప్రభూ\\nఆశతో వెదకుచును - నీ కొరకేతెంచె\\nవేడుమ శరణు - ఓ యువకా      కోరుమ శరణు - ఓ యువతి\\n\\n1. సిలువలో కారెనుగా - సెలయేరుగ రుధిరంబు\\nచాచిన చేతులతో - దాపున చేరెనుగా\\nనీ సహవాసముకై - నిలచెను వాకిటను\\nహృదయపు తలుపు - తీయుమా\\n\\n2. ఈ యువతరమంతా - దేవుని సేవకులై\\nరక్షణ పొందగను - యేసుడు కోరెనుగా\\nసోమరివై సమయం - వ్యర్ధము చేయుదువా?\\nక్రీస్తుకు నీ హృది - నీయుమా\\n\\n3. యేసుని సాక్షిగను - నిన్నే కోరెనుగా\\nఓ యువకా - ప్రభుని - వేదన గాంచితివా\\nరయమున సాగుమయా - రక్షణ కోరుమయా\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"30\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"131\",\n                \"title\": \"నశియించు ఆత్మలను\",\n                \"artist\": \"...పీటర్ సింగ్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"132\",\n        \"local_title\": \"నశించు ఆత్మలెన్నో-నా చెంతనేయుండగ\",\n        \"local_hint\": \"Nasinchu atmalenno\",\n        \"local_text\": \"నశించు ఆత్మలెన్నో - నా చెంతనేయుండగ\\nనా ప్రభువా నాకిమ్మయా - నీ హృదయ భారంబును\\n\\n1. పాపంబుతో పెనగిన - భారంబుతో ఓడిన\\nశాపంబులో మునిగిన - ఆత్మలన్‌ జేరగా\\nనా ప్రభువా! నీ కొరకే - ప్రేమించి వారిని నడిపింతును\\n\\n2.నీ‌ ఆత్మ నను నింపగ - నీ కృపలో బలమొందగ\\nనీ వశమై నేనుండగ - నాయందే నీవుండగ\\nనా ప్రభువా! నీ కొరకే - ప్రార్ధించి వారిని‌ నడిపింతును\\n\\n3. కోతెంతో విస్తారము - పనివారు బహుకొంచెము\\nనీ పంటన్‌ కోసెడివారిన్‌ - పంపుము మా యజమానుడా\\nభారంబుతో పనిచేయన్‌ - నింపుము దేవా నీ దాసులన్\",\n        \"local_category\": [\n            \"missions\"\n        ],\n        \"local_categorycount\": \"7\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"132\",\n                \"title\": \"132. నశించు ఆత్మలెన్నో-నా చెంతనేయుండగ\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/132.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"133\",\n        \"local_title\": \"నశియించు ఆత్మలు నీ చెంత నుండ\",\n        \"local_hint\": \"Nasiyincu atmalu\",\n        \"local_text\": \"నశియించు ఆత్మలు నీ చెంత నుండ - గమనించవా సోదరా\\nప్రభు యేసు ప్రేమతో విలచుచుండ గమనించవా సోదరా\\n\\n1. ప్రాణంబు నిచ్చె నీ పాపములకై - ప్రార్ధింప బరువాయెనా\\nరక్తంబు కార్చె నీ దోషములకై పనిచేయ బరువాయెనా\\n\\n2. నీ తోటి యువకుల్‌ నీ తోటి యువతుల్‌ - నశియించ ఆనందమా\\nసత్యంపు మార్గం ప్రకటించలేవా - జీవంపు మార్గం జూపించ రావా\\n\\n3. సర్వంబు నిచ్చె నీ కోసమేగ - ప్రభుకీయ భయమేల\\nభారంబులేని బ్రతుకేలనయ్యా- శ్రీయేసు ప్రేమను ప్రకటింప రావా\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"31\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"133\",\n                \"title\": \"నశియించు ఆత్మలు నీ చెంత నుండ\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"134\",\n        \"local_title\": \"నశియించు ఆత్మలెన్నియో\",\n        \"local_hint\": \"Nasiyinchu atmalenniyo\",\n        \"local_text\": \"నశియించు ఆత్మలెన్నియో - చేజారి పోవుచుండగా\\nపరితాపమొంది యేసు - ప్రియమార నిన్ను పిలువ\\nపరికించుమయ్యా సోదరా - ఓ\\n\\n1. నీ పాప భారమంత - ప్రభుయేసు మోసెగా\\nనీ పాప గాయములను - ఆ యేసు మాన్పెగా\\nఅసమానమైన - ప్రేమ గనుమా, ఈ\\nసువార్తను - లోకాన చాటవా? లోకాన చాటవా?\\n\\n2. నీ యవ్వనంబును- యేసయ్య కోరెను\\nనీ ప్రేమకన్న ముందు - తన ప్రేమ జూపెను\\nఓ యవ్వనుండా - యేసు పిలుపు - నీవు\\nవింటివా? - రారమ్ము సోదరా (2)\\n\\n3. ఈ లోకభోగము - నీకేల సోదరా\\nనీ పరుగు పందెమందు - గురి యేసుడేగదా\\nప్రభుయేసు నందు - శక్తినాంది\\nసాగుటే గదా - ప్రియ యేసు కోరెను (2)\",\n        \"local_category\": [\n            \"missions\"\n        ],\n        \"local_categorycount\": \"8\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"134\",\n                \"title\": \"నశియించు ఆత్మలెన్నియో\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"135\",\n        \"local_title\": \"నాకానందము కారణమిదే!\",\n        \"local_hint\": \"Nakanandamu\",\n        \"local_text\": \"నాకానందము కారణమిదే! -పాపభారమంతపోయెను\\nసర్వకాలము పాడుచుందును - యేసు భారమెల్ల తీసెను\\nపాపభారమున కృంగియుంటిని - పాపభారం తీసి సమాధానమిచ్చెను\\nసర్వకాలము పాడుచుందును! - యేసుభారమెల్ల తీసెను\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"14\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"135\",\n                \"title\": \"నాకానందము కారణమిదే!\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"136\",\n        \"local_title\": \"నాకేమి కొదువ యింక\",\n        \"local_hint\": \"Nakemi\",\n        \"local_text\": \"నాకేమి కొదువ యింక - యేసయ్యా\\nనీ అండ నాతో నుండ - యేసయ్యా\\nనా కొండ కోటవు నీవే - యేసయ్యా\\nకాపరివై కాచెదవు - ఊపిరివై నిండుగ నింపెదవు\\n\\n1. వెండి బంగారములు - వేయి కొండలు నీవే\\nదండిగా ధాన్యమిచ్చే - ధర సంపదయు నీదే\\nమహిమైశ్వర్యములో - మనుగడ చూపించి\\nఅక్కరలు తీర్చెదవు - నిక్కముగ నడిపెదవు\\n\\n2. పక్షులను పోషించే - అక్షయుడ నీవుండ\\nపుష్పాల తేజమిచ్చే - దక్షుడవు నీవుండ\\nతక్షణము మొర వినెడి - రక్షకుడ నీవుండ\\nక్షామ కాలమందైన క్షేమ - మిచ్చి నడిపెదవు\\n\\n3. గాడాంధకారములో - గాలి తుఫానులలో\\nనీనీడ చాటున - నిజముగా దాచెదవు\\nచిరకాలము నేను నీతో నుండగా\\nఅరమర లేకయే నే కరములు చాపితివి\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"23\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"136\",\n                \"title\": \"136. నాకేమి కొదువ యింక\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/136.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"137\",\n        \"local_title\": \"నాకై చీల్చుబడిన\",\n        \"local_hint\": \"Nakai chilchubadina\",\n        \"local_text\": \"నాకై చీల్చుబడిన - ఓ అనంత నగమా\\nనీలో దాగెదన్‌ - నీ రుధిర ధారలలో\\nపాపం కడుగుమా - బలమును త్రుంచుమా\\n\\n1. నీ ఆజ్ఞమీరి నేను - దోషుండ నైతి దేవా\\nచెడిపోయె నాదు పనులు - కన్నీరు యింకిపోయే నాదేవా-నా దేవా\\nనీవేగ నాదు మార్గం - నీ సిలువే నాదు శరణం\\nపాపం కడుగుమా - బలమును త్రుంచుమా\\n\\n2 ఏమియ్యలేని వాడన్‌ - నీ సిలువ నాశ్రయింతున్‌\\nనే దీన దిగంబరుడన్‌ - నీ నీతి నిమ్ము దేవా నాదేవా-నా దేవా\\nకలవరము నిందె నాలో - కలుషంబు బాపు దేవా\\nకనికరము జూపుమా - కృప చేత బ్రోవుమా\\n\\n3. కడబూర మ్రోగగానే - నిను జూడ వేగలేవన్‌\\nపరలోక మహిమ జేరన్‌ - కరుణించి పిలుపు దేవా నాదేవా-నా దేవా\\nమహిమాసనంబు పైన - నిను నేను జూదగానే\\nనీలో దాగెదన్‌ - నీ నీడ చేరెదన్\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"24\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"137\",\n                \"title\": \"137. నాకై చీల్చుబడిన\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/137.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"138\",\n        \"local_title\": \"నా జీవం నా సర్వం\",\n        \"local_hint\": \"Na jivam\",\n        \"local_text\": \"నా జీవం నా సర్వం నీవే దేవా\\nనా కొరకే బలియైన గొర్రెపిల్ల\\nనా కొరకే రానున్న ఓ మెస్సయ్యా\\nతప్పిపోయిన నన్ను వెదకి రక్షించి\\nమంచి కాపరివై నాకై ప్రాణమిచ్చితివి\\nఏమివ్వగలను నీ ఎనలేని ప్రేమకై\\nవిరిగినలిగిన హృదయమే నే అర్పింతు\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"31\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"138\",\n                \"title\": \"నా జీవం నా సర్వం\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"139\",\n        \"local_title\": \"నా జీవిత వ్యధలందు\",\n        \"local_hint\": \"Naa Jeevitha Vyadhalandu\",\n        \"local_text\": \"నా జీవిత వ్యధలందు యేసే జవాబు\\nయేసే జవాబు – ప్రభు యేసే జవాబు\\n\\n1. తీరని మమతలతో ఆరని మంటలలో\\nఆశ నిరాశలతో తూలెను నా బ్రతుకే\\nననుగని వచ్చెను – తన కృప నిచ్చెను\\nకరుణతో ప్రేమించి – కలుషము బాపెను\\n\\n2. చీకటి వీధులలో నీటుగా నడచితిని\\nలోకపు ఉచ్ఛులలో శోకము జూచితిని\\nనను గని వచ్చెను – తన కృప నిచ్చెను\\nకరుణతో ప్రేమించి – కలుషము బాపెను\\n\\n3.ద్రోహుల నమ్ముకొని - స్నేహము చేసితిని\\nఇడుముల పాల్జేసి - ఎడబాసిరి నన్ను\\n\\n4. హంగుల వేషముతో రంగుల వలయములో\\nనింగికి నేనెగిరి నేలను రాలితిని\\nనను గని వచ్చెను – తన కృప నిచ్చెను\\nకరుణతో ప్రేమించి – కలుషము బాపెను\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"20\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"139\",\n                \"title\": \"139. నా జీవిత వ్యధలందు\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/139.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"140\",\n        \"local_title\": \"నా ప్రాణమా నీ వేల క్రుంగితివి\",\n        \"local_hint\": \"Na pranama\",\n        \"local_text\": \"నా ప్రాణమా నీ వేల క్రుంగితివి\\nనాలో నీకింత తొందరయేల\\nదేవుని యందే నిరీక్షించుము ఆయనే నీ రక్షణ కర్త\\nస్తుతించి పాడుము కాపాడు నాయనే\\nనా ప్రాణమా - నీ వేల క్రుంగితివి\\nనాలో నీకింత - తొందరయేల (2)\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"25\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"140\",\n                \"title\": \"నా ప్రాణమా నీ వేల క్రుంగితివి\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"141\",\n        \"local_title\": \"నా ప్రియమైన సోదరుడా\",\n        \"local_hint\": \"Na priyamaina\",\n        \"local_text\": \"నా ప్రియమైన సోదరుడా - ప్రభువు నందు కుమారుడా\\nమన ప్రభు ఏసు కృపచేత - ఆత్మలో బలము పొందు\\n\\n1. నావలన విన్నవియు - ప్రభువు నీకు నేర్పినవి\\nనమ్మకమైన మనుష్యులకు - ప్రభువు సేవలో అప్పగించు\\n\\n2. క్రీస్తు మంచి సైనికుని వలె - క్రీస్తు శ్రమలను అనుభవించి\\nక్రీస్తు రాజు ఆనందంలో - పాలుపొందుము యవ్వనుడా\\n\\n3. దేవుని సేవా పోరాటంలో - జెట్టివాని వలె పోరాడి\\nదేవుడు జూపిన గురి చేరి - దేవుని బహుమతి పొందుమయా\\n\\n4. పాటు పడిన కర్షకుని వలె - ప్రయాసపడి పనిచేసి నీవు\\nప్రథమ ఫలమగు ఆత్మలనే - ప్రభువు సేవలో పొందుమయా\\n\\n5. దేవుని ఎదుట యోగ్యునిగా - సత్యవాక్యము సరిగ పట్టి\\nజడియక జంకక ధైర్యముతో - దైవ సేవలో కొనసాగుము\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"32\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"141\",\n                \"title\": \"నా ప్రియమైన సోదరుడా\",\n                \"artist\": \"...యం.క్రిష్ణయ్య\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"142\",\n        \"local_title\": \"నా ప్రియయేసూ నా ప్రభుయేసూ!\",\n        \"local_hint\": \"Na priyayesu\",\n        \"local_text\": \"నా ప్రియయేసూ, నా ప్రభుయేసూ!\\nనీలో అన్ని విషయాల్లో ఎదిగి, నీవలె నండుటకు\\nనాలో కార్యసిద్ధి కలగుజేయుమా\\nనీ కృపలో బలపరచు, నీ దయలో నను పెంచు(2)\\n\\n1. పాపం హృదయంలో రోగం ఎదుగనీయదు\\nపాపతంలపులు మనస్సాక్షిన్‌ పంకిలపరచును\\nపాపహరా నను శుద్ధించు వేగ ఎదిగెదను\\nనీ కృపలో బలపరచు, నీ దయలో నను పెంచు(2)\\n\\n2. వాక్యమే నాకు ఆహారం నీవే జీవాహారం\\nవాక్యమైయున్ననా ప్రభువా నిన్నే భుజించెదను\\nఆత్మ జలములు త్రాగుచును నీలో ఎదిగెదను\\nనీ కృపలో బలపరచు, నీ దయలో నను పెంచు(2)\\n\\n3. నేర్చుకొనే దీనమనస్సు నాకిల నిమ్మయా\\nమార్చివేయుము నా దారిన్‌ నీ దారిగా\\nతార్చివేయు సాతానుని దూరపరచుమయ్యా\\nనీ కృపలో బలపరచు, నీ దయలో నను పెంచు(2)\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"26\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"142\",\n                \"title\": \"నా ప్రియయేసూ నా ప్రభుయేసూ!\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"143\",\n        \"local_title\": \"నా ప్రియ యేసు రాజా\",\n        \"local_hint\": \"na preya yeesu\",\n        \"local_text\": \"నా ప్రియ యేసు రాజా - ఆదుకో నన్నెవుడు\\nశోధనలో వేదనలో - నిను వీడి పోనియ్యకు\\n\\n1. కలుషితమగు ఈ లోకం - కదిలెను నా కన్నులలో\\nమరణ శరీరపు మరులే - మెదిలెను నా హృదయములో\\nకల్వరిలో ఆదరించు - ఆదరించు - ఆదరించు\\n\\n2. మరచితి నీ వాగ్దానం - సడలెను నా విశ్వాసం\\nశ్రమల ప్రవాహపు సుడులే - వడిగా నను పెనుగొనగా\\nకల్వరిలో ఆదరించు - ఆదరించు - ఆదరించు\\n\\n3. నేరము లెన్నో నాపై - మోపెను ఆ అపవాది\\nతీరని పోరాటములో - దూరముగా పరుగిడితి\\nకల్వరిలో ఆదరించు - ఆదరించు - ఆదరించు\\n\\n4. చాలిన నిన్ను విడిచి - కోరితి దీవెనలెన్నో\\nభావనలేమో అరసి - వదలితి వాక్యాధారం\\nకల్వరిలో ఆదరించు - ఆదరించు - ఆదరించు\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"27\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"143\",\n                \"title\": \"143. నా ప్రియ యేసు రాజా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/143.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"144\",\n        \"local_title\": \"నా పేరే తెలియని ప్రజలు\",\n        \"local_hint\": \"Naa Pere Theliyani Prajalu\",\n        \"local_text\": \"నా పేరే తెలియని ప్రజలు - ఎందరో ఉన్నారు\\nనా ప్రేమను వారికి ప్రకటింప -  కొందరే ఉన్నారు\\nఎవరైనా - మీలో ఎవరైనా(2) - వెళతారా - నా ప్రేమను చెబుతారా \\n\\n1. నేను నమ్మిన వారిలో - కొందరు మోసం చేసారు\\nవెళతామని చెప్పి - వెనుకకు తిరిగారు \\nఎవరైనా - మీలో ఒక్కరైనా(2) - వెళతారా - నా ప్రేమను చెబుతారా \\n\\n2. వెళ్ళగలిగితే మీరు - తప్పక వెళ్ళండి\\nవేల్లలేకపోతే - వెళ్ళేవారిని పంపండి\\nఎవరైనా - మీలో ఒక్కరైనా(2) - వెళతారా - నా ప్రేమను చెబుతారా\\n\\n3. రక్షణ పొందని ప్రజలు - లక్షల కొలది ఉన్నారు\\nమారుమూల గ్రామాల్లో - ఊరి లోపలి వీధుల్లో\\nఎవరైనా - మీలో ఎవరైనా(2) - వెళతారా - నా ప్రేమను చెబుతారా..\\n\\n4. నా పేరే తెలియని ప్రజలు - ఎందరో ఉన్నారు\\nనా ప్రేమను వారికి ప్రకటింప -  కొందరే ఉన్నారు\\nఎవరైనా - మీలో ఒక్కరైనా(2) - వెళతారా - నా ప్రేమను చెబుతారా\",\n        \"local_category\": [\n            \"missions\"\n      