 \"id\": \"154\",\n                \"title\": \"నిరతం నీకే స్తుతి\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"155\",\n        \"local_title\": \"నిరీక్షణతో పనిచేయుదము\",\n        \"local_hint\": \"Niriksanato\",\n        \"local_text\": \"1. నిరీక్షణతో పనిచేయుదము - రక్షణ వార్తను చాటెదము\\nఅక్షయుడేసుకు ఎల్లప్పుడు - పాడెదము హల్లెలూయ\\n\\n2. విశ్వాసముతో కొనసాగెదము - అంతము వరకు ఓపికతో\\nవిజయము నిచ్చెడి యేసుని వైపు - సంతసమున చూచుచు ఎపుడు\\n\\n3. మహిమ కిరీటము పొందుటకై - సహనముతో పోరాడెదము\\nమహిలో పరిశుద్దాత్ముని మనకు - సహవాసముకై పంపెనుగా\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"34\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"155\",\n                \"title\": \"నిరీక్షణతో పనిచేయుదము\",\n                \"artist\": \"...ఆనందరాజ్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"156\",\n        \"local_title\": \"నిలకడగా కొనసాగెదమా\",\n        \"local_hint\": \"nilakadaga\",\n        \"local_text\": \"నిలకడగా కొనసాగెదమా\\nపరిశుద్ధ లేఖనములయందు\\nఅలయక అనుభవ జ్ఞానముతో\\nపలువిధముల ఫలియించెదమా\\n\\n1. ఆత్మ ప్రేరితము - దైవాత్మ శక్తి పూరితము\\nనిత్యము వెలుగును ప్రసరించున్‌ - ఇల\\nసత్యపు బాటలో నడిపించున్\\n\\n2. ఆదియందలి వాక్యం - శరీరధారిగ వేంచేసెన్‌\\nఆత్మఖడ్గము విభజించున్‌ - యిక\\nఅపవాదిని - ఎదిరించెదమా\\n\\n3. ఉపదేశించెదము - ఖండించి తప్పును సవరించి\\nఅపవిత్రతను విడనాడే - నిజ\\nనైతిక విలువలు నేర్పెదమా\\n\\n4. వినుటకు వేగిరము - అంగీకరించెడి సాత్వికము\\nఅనుదిన వాక్యపు ఆచరణే - మన\\nధన్యత భాగ్యం - ఈ ధరలో\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"35\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"156\",\n                \"title\": \"156. నిలకడగా కొనసాగెదమా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/156.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"157\",\n        \"local_title\": \"నీ‌ కృపయే నన్ను కరుణించెను\",\n        \"local_hint\": \"ni krupaye\",\n        \"local_text\": \"నీ కృపయే నన్ను కరుణించెను\\nనీ మాటలే నన్ను బ్రతికించెను\\nయేసయ్యా... నా మెస్సీయా\\n\\n1. కష్టములో నాదు కన్నీరు తుడిచావు\\nధైర్యమిచ్చావు నీవే కదా (2)\\nకలత శ్రమయైననూ శత్రు పన్నాగము (2)\\nతొలగ చేశావు నీవే కదా (2)\\n\\n2. నాకు సహాయం నాదుర్గం నాగానం\\nరక్షణాధారం నీవే కదా\\nసాహస కార్యము కన్నుల కాశ్చర్యము\\nచేసిన హస్తము నీదేకదా\\n\\n3. నీవే దేవుడవు కృపాదయాళుడవు\\nకృతజ్ఞతాస్తుతులు చెల్లింతును\\nనిన్ను ఘనపరతునూ నీ క్రియలు వివరింతును\\nకృతజ్ఞతార్పణలు అర్పింతును\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"30\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"157\",\n                \"title\": \"నీ‌ కృపయే నన్ను కరుణించెను\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"158\",\n        \"local_title\": \"నీకే స్తోత్రములు దేవా\",\n        \"local_hint\": \"nike Stotramulu\",\n        \"local_text\": \"నీకే స్తోత్రములు దేవా నీకే స్తోత్రములు\\nసౌఖ్యములో దు:ఖములో.... సౌఖ్యములో దు:ఖములో\\nనీకే స్తోత్రములు దేవా నీకే స్తోత్రములు\\n\\n1. కన్నీటితో కడిగి నీ పాదముల్‌\\nనేకుమ్మరించాను నా హృదయమున్‌\\nదోషిని నను కరుణించినావు (2)\\nనీదు ప్రేమతో నను నింపినావు (1)\\n\\n2. హిస్పోపుతో కడిగి నాపాపము\\nపవిత్ర పరచావు ఈ దేహము\\nహిమము కంటెను మెరిపించినావు (2)\\nనీదు రక్షణ కురిపించినావు (1)\\n\\n3. కన్నుల్లో కదిలెను నీరూపమే\\nమనసున మెదిలెను నీ వాక్యమే\\nఎంత మధురం నీ నామ స్మరణం (2)\\nఎంత మధురం నీ నామ స్మరణం (1)\\n\\n4. నలిగిన హృదయం నీ కోసమే\\nవిరిగిన మనస్సు నీ కిష్టమే\\nమరువలేనూ నీ దివ్య ప్రేమన్‌ (2)\\nమరువలేనూ నీ దివ్య ప్రేమన్‌\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"36\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"158\",\n                \"title\": \"158. నీకే స్తోత్రములు దేవా\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/158.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"159\",\n        \"local_title\": \"నీ చిత్తమే నీ చిత్తమే\",\n        \"local_hint\": \"ni chittame \",\n        \"local_text\": \"నీ చిత్తమే నీ చిత్తమే నీ చిత్తమే సిద్ధించు ప్రభూ\\nఈ జీవితం నీ కోసమే నీ ఆత్మతో నింపు ప్రభూ\\n\\n1. క్రయ ధనము గాను నీ ప్రాణమిచ్చి నన్ను విడిపించితివే\\nనన్ను ప్రేమించి నా భారము మోసి నన్ను విమోచించితివే\\n\\n2. నీ దాసుడను ఆలకింతును నీ స్వరము వినిపించుము\\nనాతో మాట్లాడి నన్ను బలపరచి నీ త్రోవను నడిపించుము\\n\\n3. పరిచారము చేయన్‌ పరిచర్యను చేయన్‌\\nపని నప్పగించితివే పాపము నెదిరించి\\nఫలితము సాధించి నీ ఇష్టము నెరవేర్చెదన్‌\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"36\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"159\",\n                \"title\": \"159. నీ చిత్తమే నీ చిత్తమే\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \