       \"local_categorycount\": \"23\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"181\",\n                \"title\": \"నే యేసునే కోరద చేరెద\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"182\",\n        \"local_title\": \"నేర్చుకొందును నే నేర్చుకొందును\",\n        \"local_hint\": \"Nerchukondunu\",\n        \"local_text\": \"నేర్చుకొందును నే నేర్చుకొందును\\nయేసునొద్ద కూర్చొని నేర్చుకొందును\\nనడుచుకొందును నే నేర్చుకొన్న విధముగా\\nనడచుకొందును యేసు ఇలలో నడిచినట్లుగా\\n\\n1. నన్ను ఉపేక్షించుకొని - నా సిలువను ఎత్తుకొని\\nనన్ను కొన్న యేసునే - వెంబడితును\\nసాగిపోదును - నే సాగిపోదును\\nయేసు శిష్యుడనుగా - సాగిపోదును\\nసాగిపోదును - నే సాగిపోదును\\nయేసు శిష్యురాలిగా - సాగిపోదును\\n\\n2. ఏకాంత ప్రార్ధనలో- యేసుశక్తి పొందుకొని\\nవాక్యాన్ని ధ్యానిస్తూ - వెంబడింతును  #సాగి#\\n\\n3. శోధనలో వేదనలో - యేసువెపు చూచుచూ\\nసాక్షినై సువార్తను - అందరికి చాటెదన్  #సాగి#‌\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"24\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"182\",\n                \"title\": \"నేర్చుకొందును నే నేర్చుకొందును\",\n                \"artist\": \"...డి.రాము\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"183\",\n        \"local_title\": \"నే సాగెద యేసుని మార్గములో \",\n        \"local_hint\": \"Ne sageda\",\n        \"local_text\": \"నే సాగెద యేసుని మార్గములో - నే పాడెద హోసన్న హల్లెలూయ\\nచింతేల నాకీ లోకములో - ఎంతైన చేయును ఆ ప్రభువే\\nభారంబును వీడిన డెందముతో - తీరంబును చేరేద యేసునితో\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"31\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"183\",\n                \"title\": \"నే సాగెద యేసుని మార్గములో \",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"184\",\n        \"local_title\": \"పదండి పోదాం-పదండి పోదాం\",\n        \"local_hint\": \"Padandi podam\",\n        \"local_text\": \"పదండి పోదాం - పదండి పోదాం - క్రీస్తుని శిష్యులముగా \\nగీతముల్ పాడి - గీతముల్ పాడి - జయజయ నాదంబుతో \\n\\n1.నాగటిపై చేయి వేసి నేను - వెనుక తిరిగి చూడ నెన్నడు \\nక్రీస్తు సేవా పొలములో - దున్నుకుంటు సాగి వెళ్ళెదన్ \\n\\n2. నాదు జీవిత యాత్రలో - లోకంబనె కెరటంబులపై \\nక్రీస్తు మోము చూచుకొంటునే - నడచుకుంటు సాగివెళ్ళెదన్\\n\\n3. మారని మమతలన్నిటిన్ - వీడని బంధంబులను \\nశీలలతో సిలువలకు కొట్టి - క్రీస్తు తోడ సాగివెళ్ళెదన్\\n\\n4. విస్మరించి పరిస్థితులను - లోకంబున్ ఆశింపకను \\nధైర్య సాహసంబులతోను - జయభేరితో సాగి వెళ్ళేదన్\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"25\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"184\",\n                \"title\": \"పదండి పోదాం-పదండి పోదాం\",\n                \"artist\": \"...పి.ఆనందరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"185\",\n        \"local_title\": \"పరమ జీవము నాకు నివ్వ\",\n        \"local_hint\": \"Parama jivamu\",\n        \"local_text\": \"పరమ జీవము నాకు నివ్వ - తిరిగి లేచెను నాతో నుండ\\nనిరంతరము నడిపించును - మరల వచ్చి యేసు కొని పోవును \\nయేసు చాలును - యేసు చాలును\\nయే సమయమైన యే స్థితికైన - నా జీవితములో యేసు చాలును\\n\\n2. సాతాను శోధనలధికమైన - సొమ్మసిల్లక సాగి వెళ్ళదను\\nలోకము శరీరము లాగినను - లోబడక నేను వెళ్ళదను  #యేసు#\\n\\n3. పచ్చిక బయలులో పరుండజేయున్ - శాంతి జలము చెంత నడిపించును\\nఅనిశము ప్రాణము తృప్తిపరచున్ - మరణ లోయలో నన్ను కాపాడును  #యేసు#\\n\\n4. నరులెల్లరు నన్ను విడిచినను - శరీరము కుళ్ళి కృశించినను\\nహరించినన్ నా ఐశ్వర్యము - విరోధివలె నన్ను విడచినను  #యేసు#\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"41\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"185\",\n                \"title\": \"పరమ జీవము నాకు నివ్వ\",\n                \"artist\": \"...ప్రకాష్ యేసుడియన్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"186\",\n        \"local_title\": \"పరమ తండ్రి కరములెత్తి\",\n        \"local_hint\": \"parama Tandri\",\n        \"local_text\": \"పరమ తండ్రి కరములెత్తి - స్తుతుల నర్పింతుము\\nశిరములెత్తి స్వామి నీకై - చూచు చుంటిమి\\nఉజ్జీవ నాత్మ నొసగు నిలువ - సజీవ సాక్షిగ\\n\\n1. పాప శాపములందు మేము - పడి చెడి యుండగ\\nదేవమాదు దరికి జేరి - లేవ నెత్తితివి\\nఎంత జాలి ఎంత ప్రేమ - స్తుతుల నర్పింతుము\\n\\n2. దిన దినమున నిన్ను శోధించి - దు:ఖ పెట్టితిమి\\nకేవలం శరీరులమని - కనికరించితివి\\nక్షమంచి మమ్ము కడిగితివి - స్తుతుల నర్పింతుము\\n\\n3. సూర్యచంద్ర తారలందు - వింత సూచనలు\\nజరగ జనులు ధైర్యము చెడి - కూలి చూచెదరు\\nఅయితే నీకై చూచు మేము - బలము నొందెదము\\n\\n4. శత్రు టురులు త్రుంచి వేసి - జీవమిచ్చితివి\\nఆహా! ఏమర్పింతుము నీ ఉపకారములకై\\nచేతబట్టి రక్షణ - పాత్ర స్తుతుల నర్పింతుము\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"44\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"186\",\n                \"title\": \"పరమ తండ్రి కరములెత్తి\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"187\",\n        \"local_title\": \"పరమ తండ్రీ - నిన్ను కీర్తింతును\",\n        \"local_hint\": \"parama Tandri\",\n        \"local_text\": \"పరమ తండ్రీ - నిన్ను కీర్తింతును\\nపరమ తండ్రీ - నిన్ను కీర్తింతును\\nనా ప్రేమ, నా స్తుతి - నా ఆరాధన నీకే\\nపరమ తండ్రీ - నిన్ను కీర్తింతును\\n\\nపరమపుత్ర ఆశ్చర్యకరుడా\\nపరమపుత్ర ఆశ్చర్యకరుడా\\nకడుగు నాలోని పాపం\\nనింపి నీ ఆత్మ నాలో నుంచుము\\nనన్ను కరుణించి ప్రభో\\n\\nపరమాత్మ శాంతిదాతా రమ్ము\\nపరమాత్మ శాంతిదాతా రమ్ము\\nనడిపించు దారిచూపు ఈ లోకంబులోన\\nపరమాత్మ శాంతిదాతా రమ్ము\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"45\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"187\",\n                \"title\": \"పరమ తండ్రీ - నిన్ను కీర్తింతును\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"188\",\n        \"local_title\": \"పరమందలి దేవా\",\n        \"local_hint\": \"Paramandali\",\n        \"local_text\": \"పరమందలి దేవా, పరిశుద్ధ ప్రభువా, యేసయ్యా, స్తోత్రమయా\\nనేరమెంచక మము చేర్చుకొంటివి, పరిశుద్ధముగా జీవించమంటివి\\n\\n1. పరిశుద్ధతలో నీవు మహనీయుడవు, సరిరారు నీకెవరూ ఓ యేసయ్యా\\nఅరికాలు మొదలు నదినెత్తి వరకు (2) పాపముండగా మమ్ము శుద్ధీకరించితివి (2)\\n\\n2. సరిచేసితివి నీవు మా జీవితముల, విరబూసె మాలోన పరమానందం\\nగురిలేని మాకు పరిశుద్ధత నిచ్చి (2) పరిపూర్ణతను మాకు గురిగా నిచ్చితివి (2)\\n\\n3. చిరకాలములో మేము నీతో నుండ సరిపోయెడు పరిశుద్ధత మాకీయుమయా\\nస్థిరమైన మనస్సు, నిను పోలిన బ్రతుకు నరశరీరధారీ, మాయేసూ మాకిమ్ము\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"26\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"188\",\n                \"title\": \"188. పరమందలి దేవా\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/188.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"189\",\n        \"local_title\": \"పరలోక ద్వారము తెరచి\",\n        \"local_hint\": \"Paraloka dwaramu\",\n        \"local_text\": \"పరలోక ద్వారము తెరచి - ఆత్మాభిషేకము నిమ్ము\\nపరలోక తండ్రి కనికరించుము\\nప్రభుయేసుక్రీస్తే ఆందరికీ ప్రభువని - వ్రకటింప భారంబు నిమ్ము\\n\\n1. శ్రమలందున కన్నీటి లోయలలో - నా బ్రతుకే సాగినా\\nఅంధకార బంధురమే నన్నావరించి - వేదనలే నను కూల్చినా\\nమెండైన నీ కృపతో నన్నాదరించి - ఈ యాత్రలో నన్ను నడిపించుము\\nనీ సువార్తమానము ప్రకటించుచు వెళ్ళగ -నీ ఆత్మతో నన్ను నింపుము\\nప్రభు యేసుక్రీస్తే అందరికి ప్రభువని - ప్రకటింప భారంబు నిమ్ము\\n\\n2. నాదు మోకాళ్ళే సడలియుండగా - బలపరచుము ప్రార్ధింపను\\nలోకాశలతో హృదయం నిండి యుండగా - నీకరములతో తాకుము\\nనాదు విశ్వాసం సన్నగిల్లెను - నీ వాక్కుతో నన్ను నింపుము\\nనాదు పాదములే లేడి పాదములై - నీ కొరకై పరుగిడనిమ్ము\\nప్రభు యేసుక్రీస్తే అందరికి ప్రభువని - ప్రకటింప భారంబు నిమ్ము\\n\\n3. సీయోనులో సమాధానము - నీ ప్రభువు యేలుచున్నాడని\\nప్రకటించుచు సాగిపోవు పాదముల్‌ - నీ సన్నిధిలో మనోహరములు\\nరాజవంశములో యాజకుడనుగా - నీ గుణాతిశయములను ప్రచురింపను\\nపరిశుద్ధునిగా నన్ను తీర్చియుంటివి -నీ స్వాస్థ్యముగా నన్ను చేసికొంటివి\\nప్రభు యేసుక్రీస్తే అందరికి ప్రభువని - ప్రకటింపగా నన్ను పిలిచితివి.\",\n        \"local_category\": [\n            \"missions\"\n        ],\n        \"local_categorycount\": \"10\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"189\",\n                \"title\": \"189. పరలోక ద్వారము తెరచి\",\n                \"artist\": \"...జి.పి.శ్రీకాంత్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/189.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"190\",\n        \"local_title\": \"పరలోకము నొదలి\",\n        \"local_hint\": \"Paralokamu\",\n        \"local_text\": \"పరలోకము నొదలి, నరలోకము కేతెంచి\\nధరాతలమున నడిచిన దేవా! పరమాత్ముడా, ఓ యేసయ్యా!\\n\\n1. సంద్రమును చీల్చితివి, యొర్దానును ఆర్పితివి\\nఎంత బలమయ! స్తుతియింతును, పూజింతును\\nఎరికోను కూల్చితివి, సైన్యములను కూల్చితివి\\nఎంత బలమయ్యా కీర్తింతును, ప్రేమింతును\\n\\n2. మరణమును ఓడించి, నినదించిన నిన్ను జూచి మౌనినౌదునా!\\nస్తుతియింతును, హర్షింతును\\nసాతానును దునుమాడి, మానవులను రక్షించిన\\nదైవమానవా. ఘనపరచెదను, సేవింతును\\n\\n3. కరుణామయ ఓదేవా, నీ వంటి వాడెవడు విశ్వమందున\\nభువియందున, దివియందున?\\nవేల్పులలో నీవంటి మహిమాన్వితుదెవడయ్యా\\nపరిశుద్దుడా, పరమాత్ముడా, కరుణామయా?\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"46\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"190\",\n                \"title\": \"పరలోకము నొదలి\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"191\",\n        \"local_title\": \"పరిణతి లేని నీ హృదయం\",\n        \"local_hint\": \"Parinati\",\n        \"local_text\": \"పరిణతి లేని నీ హృదయం ఫలములు లేని జీవితం\\nపరికించుము- అర్పించుము సజీవ యాగముగ\\n\\n1. జీవము లేని క్రియలను విడచి\\nసంపూర్ణమగుటకు ప్రభు‌లో నిలచి\\nసాగిపో సాక్షిగా సమరమే జీవితం\\nదయా ప్రేమ - క్షమా సహనం(2) ఆత్మ పరిణతియే\\n\\n2. పరిపక్వమైన పాపం మరణం పరిశుద్ధుడైన యేసే శరణం\\nపరిమళం - పరవశం యేసుతో - జీవితం\\nనటన మాని - మనసు మారి(2) రూపాంతరం నొందుము\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"32\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"191\",\n                \"title\": \"పరిణతి లేని నీ హృదయం\",\n                \"artist\": \"...పి.యేసురత్నం\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"192\",\n        \"local_title\": \"పరిశుద్ధ జనమా-పరలోక జనమా\",\n        \"local_hint\": \"Parisuddha janama\",\n        \"local_text\": \"పరిశుద్ధ జనమా - పరలోక జనమా\\nవరుడు యేసునికి - వధువైన జనమా\\nధరయందు పరమందు క్రీస్తేసే - సర్వ పరిపూర్వ దైవాత్మ నరుడే\\n\\n1. యేసే సర్వమును - యేసే అధికారి\\nయేసే సృష్టికి - ఆది సంభూతుడు\\nయేసే ఇలలో - యేసే దైవం\\nయేసే జ్ఞానం - యేసే దైవం\\n\\n2. యేసుని పోలికలో - సాగించు నీ పయనం\\nదాసునిగ - అర్పించుము సర్వము\\nయేసే మనకు - జీవిత గమ్యం\\nభాసురంబగు - క్రైస్తవ జనమా\\n\\n3. శ్రమల ద్వారా - సంపూర్ణత నాశించుము\\nసమర్పణతో - పరిచర్య చేయుము\\nప్రేమతోడ - సహనము తోడ\\nసమతా మమతలు - నిలుపుము ఇలలో\\n\\n4. ఎవరు ఏమన్నా - ఎదురేమి నీకున్న\\nవెనుతిరిగి - చూడకు క్రైస్తవమా\\nప్రభుని చిత్తము - నెరవేర్చుటలో\\nప్రభువు తోడుగ - ఉన్నాడు ఎపుడు\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"33\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"192\",\n                \"title\": \"పరిశుద్ధ జనమా-పరలోక జనమా\",\n                \"artist\": \"...జి.నిరీక్షణ్ రావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"193\",\n        \"local_title\": \"పరిశుద్ధ దేవా - పరలోక నివాస\",\n        \"local_hint\": \"Parisuddha deva\",\n        \"local_text\": \"పరిశుద్ధ దేవా - పరలోక నివాస\\nపాడెద స్తుతి నీకే - పరమ దూతలతో\\nహల్లెలూయా - హల్లెలూయా - హల్లెలూయా\\n\\n1. సెరూపులు నిన్ను సేవించె - కెరూబులు నిన్ను కొలిచె\\nసకల పరిశుద్ధులు - నిన్నె సదా స్తుతియింతురు (2)   #హల్లెలూయా#\\n\\n2. నాలుగు జీవులు నిన్నావరించె - ఇరువది నలుగురు సాగిలపడిరి\\nనీ మహిమ ప్రకాశించగా - పాడిరి స్తుతులతో సర్వాధికారనుచు  #హల్లెలూయా#\\n\\n3. పాపమును కనలేని దేవా - పవిత్ర కన్నులుకలిగిన ప్రభువా\\nపరిశుద్ధులు మము చేయును - పరమును వీడి ధరకేగితివా  #హల్లెలూయా#\\n\\n4. నీవు పరిశుద్ధ ప్రభువైయుండి - మము శుద్దులుగా నివసింపగోరి\\nమా శుద్ధ హృదయాలతో - నిన్నారాధించమని కోరితివి  #హల్లెలూయా#\\n\\n5. పరిశుద్దుడిగా నిర్దోషిగా - ధర నిలిచిన పరిపూర్ణ ప్రభువా\\nపరిశుద్దునిగా పాపిని - ధర నిలిపే దేవా మా రక్షకా  #హల్లెలూయా#\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"47\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"193\",\n                \"title\": \"193. పరిశుద్ధ దేవా - పరలోక నివాస\",\n                \"artist\": \"...యం.క్రిష్ణయ్య\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/193.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"194\",\n        \"local_title\": \"పరిశుద్దముగ యిల జీవించెదా\",\n        \"local_hint\": \"Parisuddamuga\",\n        \"local_text\": \"పరిశుద్దముగ యిల జీవించెదా \\nపవిత్ర పరచుకొందు నాదేవా\\nపరలోక తేజ యేసు రాజా \\nహోసన్న స్తోత్రం హల్లెలూయా\\nపరిశుద్ధాత్ముడా కడుగుమా \\nఆత్మలో బలమిచ్చి బ్రోవుమయ్యా\\n\\n1. అజ్ఞాన దశలోని ఆశలన్నియు\\nవిజ్ఞానదశలో విడువనైతిని\\nపరిశుద్ధ పిలుపును మరచితిని\\nప్రవర్తనంతటిలో నిన్ను పోలి నడిచెదా\\n\\n2. లోకాశలన్ని కూడ లాగుచుండగా\\nలోనున్న కోరికలు పైకిలేవగా\\nలోకాధికారి నాపై రేగుచుండగా\\nలోపంబులేని రక్తశుద్ధి నాకిమ్మయ్యా\\n\\n3. నీ ఆత్మతో నేను ఏకమైతిని\\nనీలోనే తీగెలా కలిసిపోతిని\\nనీతోనే సిలువలో మరణమైతిని\\nనీవంటి పరిశుద్ధతను నేకోరెద\\n\\n4. నా దేహమంత నీ ఆలయముగ\\nనా హృదయమంత నీ ప్రేమనిండగ\\nనామనసే నీదు సింహాసనముగ\\nపరిశ