ు - విలువైన రుధిరము చిందించే \\nపలుపాపముల నెల్ల తొలగించెను - ఇలవెలసిన కాంతిని గనుమా\\n\\n4. మరణాంధకారములను తొలగించెను - పరలోక ద్వారము తెరిచె \\nచిరజీవాక్షయతల్ వెలుగొందెను - ధర పర గురు కాంతిని గనుమా\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"50\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"204\",\n                \"title\": \"204. ప్రభు క్రీస్తే నిజ దైవము\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/204.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"205\",\n        \"local_title\": \"ప్రభు పనిలో నిలచి యుండి\",\n        \"local_hint\": \"Prabhu panilo\",\n        \"local_text\": \"ప్రభు పనిలో నిలచి యుండి - స్థిరముగ కొనసాగెదమా\\nప్రభు మనసును కలిగి యుండి - ఆసక్తితో వెళ్లెదమా\\nహల్లెలూయా జయస్తోత్రం - జయశాలి జయమిచ్చును\\nహల్లెలూయా జయస్తోత్రం - ప్రయాసకు ఫలమిచ్చును\\n\\n1. తన తోటలో పనిచేయన్‌ - తన పిలుపును మనకిచ్చిను\\nవినయముతో లోబడెదం - విడువక పని చేయుదుము  #హల్లె#\\n\\n2. తన పనికై మీనాలన్‌ - విరివిగను వాడెదమా\\nకొంచెములో నమ్మకము - కొంతైనా చూపెదము  #హల్లె#\\n\\n3. సిగ్గుపడ నక్కరలేని - యోగ్యులముగ కనబడుదాం\\nజతపనివారము మనము - ప్రభువుతో సమకూర్చెదము  #హల్లె#\\n\\n4. స్వార్ధముకై ప్రభుపనిని - పాడుచేయక భయపడుదాం\\nమన కక్ష విపక్షములన్‌ - దహించును దైవాగ్ని  #హల్లె#\\n\\n5. ప్రభు రాకడ సామీప్యం - ప్రభుపనికై త్వరపడుదాం\\nమన భేదములను మరచి - ఐక్యతతో సాగెదము  #హల్లె#\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"43\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"205\",\n                \"title\": \"205. ప్రభు పనిలో నిలచి యుండి\",\n                \"artist\": \"...జె.దేవరా