",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"207\",\n                \"title\": \"207. ప్రభువా దేవా - పరమ తనయా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/207.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"208\",\n        \"local_title\": \"ప్రభువా నీదివ్యప్రేమ సకలంబిచ్చెను\",\n        \"local_hint\": \"prabhuva nidivyaprema\",\n        \"local_text\": \"ప్రభువా నీదివ్యప్రేమ సకలంబిచ్చెను\\nవిభుడా నీదు ప్రేమ సకలం మన్నించెన్‌\\nఆనందమే - అతిశయమే - అనిశము నీయందే\\nహల్లెలూయా స్తోత్రం - ఎల్లవేళ స్తోత్రం - ఆరాధించెద యేసయ్యా\\n\\n1. ప్రాణం అర్పించావు - జీవం అందించావు\\nశాపం భరించావు - పాపం క్షమించావు\\nఆశీర్వదించినావు - ఐశ్వర్యమిచ్చినావు\\nవాగ్ధన సంపదలతో - వాక్యంబు నిచ్చినావు  #ఆనందమే#\\n\\n2. ఆదిలో ఎరిగినావు - క్రీస్తులో ఎంచినావు\\nప్రేమతో పిలిచినావు - నీతిగా తీర్చినావు\\nతేజోనివాసులతో - స్వాస్థ్యంబు నిచ్చినావు\\nమహిమావారసత్వం - మహిలో కలిగించావే  #ఆనందమే#\\n\\n3. నీవేచాలు ప్రభువా - నాకేమి కొదువలేదు\\nనీప్రేమ చాలు ప్రియుడా - నీవేగా నా సమస్తం\\nనాఘోర పాపమంతా - నీ ప్రేమ కడిగెనయ్యా\\nనీప్రేమ నుండి ఎవడు - ఎడబాపలేడు నిజము  #ఆనందమే#\\n\\n4.వాక్యంబిచ్చినావు - నీవెలుగు నింపినావు\\nవాగ్గాన మిచ్చినావు - ఆదరణ జూపినావు\\nనాపాపమరణ నియమం - తొలగించివేసినావు\\nనీఆత్మజీవ నియమం - నియమించి బ్రోచినావు  #ఆనందమే#\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"52\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"208\",\n                \"title\": \"208. ప్రభువా నీదివ్యప్రేమ సకలంబిచ్చెను\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/208.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"209\",\n        \"local_title\": \"ప్రభువా నీ శిష్యుడను\",\n        \"local_hint\": \"prabhuva ne sisyudanu\",\n        \"local_text\": \"ప్రభువా నీ శిష్యుడను - నీతోనే యుండెదను\\nనిను వెంబడించెదను - నిన్నే సేవించెదను\\n\\n1. సమస్తమును విడిచిపెట్టి - నను వెంబడించమంటివి\\nమనుష్యులను పట్టు జాలరిగా - చేయుదు నంటివి\\n\\n2. ద్రాక్షావల్లిలో నిలచినప్పుడే - తీగ బహుగా ఫలించును\\nనిలచి యుండ, అత్యధికముగ - ఫలింప నేర్పుము\\n\\n3. సుళువై యున్న నీకాడిని - తేలికైన నీ భారమును\\nనా సిలువ నెత్తుకొని నిత్యం - నిను వెంబడించెదను\\n\\n4. దీన మనస్సుతో ప్రతి దినము - నీ యొద్ద నేర్చుకొందును\\nనీ రాజ్యమును నీ నీతిని - మొదట వెదకు చుందున్\\n\\n5. నాగటి మీద చేయి వేసి - వెనుక తిరిగి చూడను\\nవిశ్వాసముతో నిరీక్షణతో - గురివైపే వెళ్ళెదను\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"29\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"209\",\n                \"title\": \"ప్రభువా నీ శిష్యుడను\",\n                \"artist\": \"...జి.ఎఫ్.వి.ప్రసాద్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"210\",\n        \"local_title\": \"ప్రభువా పంపుము - ప్రభువా నింపుము\",\n        \"local_hint\": \"prabhuva pampumu\",\n        \"local_text\": \"ప్రభువా పంపుము - ప్రభువా నింపుము\\nమారిపోయె లోకంలో - మారిపోని నీ వార్త\\nకలసి చాటెదం - మా దేవా\\nకలసి వెళ్ళెదం - మారిపోని నీ ప్రేమన్‌ - మహిలో చాటెదం\\n\\n1. చెలరేగె పాపం - మరణాంధకారం\\nఅపవాది మోసం - ఆశించె లోకం (2)\\nకన్నులెత్తి చూచి - కన్నీళ్ళతో విత్తి\\nకలసి కోసెదము - కలసి పాడెదము\\n\\n2. చల్లారిపోయె - తొలినాటి ప్రేమ\\nనులివెచ్చనాయె - అలనాటి సేవ (2)  #కన్ను#\\n\\n3. ఆత్మలకై భారం - అణగారిపోయె\\nలోకాశలన్నీ - పెనవేసి లాగె (2)  #కన్ను#\",\n        \"local_category\": [\n            \"missions\"\n        ],\n        \"local_categorycount\": \"11\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"210\",\n                \"title\": \"210. ప్రభువా పంపుము - ప్రభువా నింపుము\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/210.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"211\",\n        \"local_title\": \"ప్రభువా ప్రభువా ప్రభువా\",\n        \"local_hint\": \"prabhuva prabhuva prabhuva\",\n        \"local_text\": \"ప్రభువా ప్రభువా ప్రభువా\\nపరిశుద్ద తలంపులను - పవిత్రమైన మనసును\\nనిష్కలంకమైన ప్రేమను - నిర్దోష పలుకుల నాలుకను\\nనాకనుగ్రహించుమా - నాకనుగ్రహించుమా\\n\\n1. శరీరాశయు నేత్రాశయు\\nజీవపు డంబమును - దుష్ట హృదయాలోచనలన్‌\\nనాలో నుండి తొలగించుమా\\nనాలో నీవే నివసించుమా\\n\\n2. తలాంతులతోను బుద్ధి జ్ఞానములతోను\\nఉప్పాంగకుండునట్లు అతిశయించకుండునట్లు\\nనాలో నీవు జీవించుమా\\nనాలో నీవే నివసించుమా\\n\\n3. నీ చిత్తము నెరవేర్చుకో తండ్రీ\\nఅయత్తపరచుము నను దేవా\\nనీ ఆజ్ఞల నడచుటకు\\nనను బలపరచుమో దేవా\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"35\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"211\",\n                \"title\": \"ప్రభువా ప్రభువా ప్రభువా\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"212\",\n        \"local_title\": \"ప్రభువా సహయము నిమ్ము\",\n        \"local_hint\": \"prabhuva Sahayamu\",\n        \"local_text\": \"ప్రభువా సహయము నిమ్ము, విభుడా నీ సన్నిధి నిమ్ము\\nమాతో నడువుమా, మమ్ము నడుపుమా ఎల్లవేళల \\n\\n1. లోకమంతా చీకటిమయము, మాదు బ్రతుకిల భారభరితం\\nసకలము శోకమయము, వికలమాయె మాదు హృదయం\\nసకలము శోకమయము, ఆదుకొనుము మమ్ము దేవా\\n\\n2. మాదు బ్రతుకులో బలహీనులము, చేదువేరు మొలచునో ఏమో\\nఅనిశము కాచి, బ్రోచి జాగరూకత నిమ్ము దేవా\\n\\n3. మాదు బోధలో దోషములేక, వేషధారణ అసలే లేక\\nసత్యమున్‌ స్వేచ్చగాను తెలియపరచి ధైర్యమిమ్ము\",\n        \"local_category\": [\n            \"prayer\"\n        ],\n        \"local_categorycount\": \"6\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"212\",\n                \"title\": \"212. ప్రభువా సహయము నిమ్ము\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/212.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"213\",\n        \"local_title\": \"ప్రార్థన వినెడి పావనుడా\",\n        \"local_hint\": \"Praarthana Vinedi Paavanudaa\",\n        \"local_text\": \"ప్రార్థన వినెడి పావనుడా - ప్రార్ధన మాకు నేర్పుమయా \\n\\n1.శ్రేష్టమైన భావము గూర్చి - శిష్య బృందముకు నేర్పితివి \\nపరముడ నిన్ను ప్రణుతించెదము - పరలోక ప్రార్థన నేర్పుమయా\\n\\n2. పరమ దేవుడవని తెలిసి కరములెత్తి జంటగ మోడ్చి \\nశిరమును వంచి సరిగను వేడిన సుంకరి - ప్రార్ధన నేర్పుమయా\\n\\n3. దినములోన జేసిన సేవ - దైవచిత్తముకు సరిపోవ \\nదీనుడవయి ఒంటిగ కొండను చేసిన - ప్రార్ధన నేర్పుమయా\\n\\n4. శత్రు మూక నిను చుట్టుకొని - సిలువ పైన నిను జంపగను \\nశాంతముతో నీ శత్రువుల బ్రోవగ - సలిపిన ప్రార్ధన నేర్పుమయా\",\n        \"local_category\": [\n            \"prayer\"\n        ],\n        \"local_categorycount\": \"7\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"213\",\n                \"title\": \"ప్రార్థన వినెడి పావనుడా\",\n                \"artist\": \"...కె.విల్సన్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"214\",\n        \"local_title\": \"ప్రియ యేసు నాథ \",\n        \"local_hint\": \"Priya Yesu Naatha Pani Cheya Nerpu\",\n        \"local_text\": \"ప్రియ యేసు నాథ పని చేయ నేర్పు\\nనీదు పొలములో కూలివానిగా\\nకావాలి నేను నీదు తోటకు కావలివానిగా\\nఅంకితం ఈ జీవితం నా యేసు నీ కోసమే\\nఅంకితం ఈ జీవితం విద్యార్ధి లోకానికే\\n\\n1. ఏక భావము - సేవ భారము\\nయేసు మనసుతో-సాగిపోదును\\nవిసుగక విడువక - కష్టించి పనిచేసెదన్\\n\\n2.  త్యాగ భరితము - యేసు చరితము \\nత్యాగసహితమే - ప్రాణాత్మదేహముల్\\nఅందుకే ఈ జీవితం -నా యేసు నాకిచ్చెను\\n\\n3. స్వచ్ఛమైన ప్రేమను - మచ్చలేని సేవను\\n మెచ్చు నేసు మహిమతో - వచ్చు వేళ\\nమరువకు నా ప్రాణమా - నీ - ప్రయాస వ్యర్థం కాదు\\n\\n4. సొంత పనులు - సంతసించక ఆశతో ఆత్మలన్ అవని వెదకుచూ\\nఅలయక - కృంగక కష్టించి పనిచేసెదన్\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"45\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"214\",\n                \"title\": \"214. ప్రియ యేసు నాథ \",\n                \"artist\": \"...పి.యేసురత్నం\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/214.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"215\",\n        \"local_title\": \"ప్రియ యేసుని సైన్యపు వీరులము\",\n        \"local_hint\": \"priya yesuni\",\n        \"local_text\": \"ప్రియ యేసుని సైన్యపు వీరులము - ప్రభుయేసుతో నడచెదము\\nతన రుధిరవు అడుగుల జాడలలో - విజయంబుతో సాగెదము\\nతన దివ్య యవ్వన రక్తమును - చిందించెను మా కొరకు\\nమా యవ్వన జీవితమేసునికై అర్పింతుము - ముదముగను\\n\\n1. పాపపు చెలగాటములు - సుంకర సహవాసములు\\nసాతానునితో గల స్నేహములు - వలదని ప్రభు చేరితిమి\\nప్రభు యేసుడే వసియించగను - మా దేహమే గేహముగా\\nప్రభు యేసుకై జీవించెదము - లోకము త్యజియించెదము\\n\\n2. నశియించిన ఆత్మలకై - మా యెదలో భారముతో\\nపయనించెదము - శ్రమియించెదము - ప్రభుయేసు సహాయముతో\\nబలపర్చు యేసుని బట్టియెగా - భీకరమగు కార్యముల\\nప్రభుయేసుకై సాధించెదము - ఆత్మల నార్జించెదము\\n\\n3. మా విజయ నినాదములు - సంగీత సునాదములు\\nయువజనములలో వినిపించెదము - ప్రతి గృహ ప్రాంగణములలో\\nప్రవణుడు ప్రభు క్రీస్తుని చేతులలో - బలమైన యోధులుగా\\nసాతాను కోటలు కూల్చెదము - ప్రభుధ్వజము నాటెదము\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"46\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"215\",\n                \"title\": \"ప్రియ యేసుని సైన్యపు వీరులము\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"216\",\n        \"local_title\": \"ప్రేమతో సత్యముతో\",\n        \"local_hint\": \"prematho\",\n        \"local_text\": \"ప్రేమతో సత్యముతో క్రీస్తేసున్‌బోలి ఎదుగుమా\\nపరిశుద్ధతలో పరిపూర్ణతలో ప్రియదైవ తనయుని కృపలో\\nప్రభునెరుగుటలో - అనుభవములో - దినదినము వర్ధిల్లుము\\nవివేచనకలిగి - వెలిగింపుపొంది - ప్రియదైవతనయుని కృపలో\\n\\n1. పరిపూర్ణతలోనుండి - కృప వెంబడి కృప నొందుము\\nక్రీస్తేసులో సంపూర్ణులం - కొనసాగి సిద్ధించెదము\\nప్రభు యేసుని దివ్య పోలికలో \\n\\n2. వాగ్ధానములు పొందుకో - విలువైన ఫలమొందుము\\nవరదుని వరములతో - పరలోక సంతోషంతో\\nప్రభుయేసుని దివ్యపోలికలో\\n\\n3. సహవాస ఐక్యతలో - సహకారి సహనంబుతో\\nసంగీత స్వరములతో - సత్యుని ఆరాధించు\\nప్రభుయేసుని దివ్య పోలికలో\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"36\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"216\",\n                \"title\": \"ప్రేమతో సత్యముతో\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"217\",\n        \"local_title\": \"ప్రేమ స్వరూపి యేసుని\",\n        \"local_hint\": \"prema swarupi\",\n        \"local_text\": \"ప్రేమ స్వరూపి యేసుని చేరెదవా కోరెదవా!\\n\\n1. మార్గంబు దప్పి తిరిగెడు - మానవుల నెల్ల బ్రోచెడి\\nమార్గంబు తానై స్వర్గంబు జేర్చె - సర్వాధికారియైన ప్రభున్\\n\\n2. సత్యము వెదకువారికి - సత్యము తానై నిల్చును\\nకృపా సత్య సంపూర్ణుడై వెలసె - సత్యాత్మన్‌ నింపు స్వామియగు\\n\\n3. మరణ భయంబు నొందెడి - మనుజులకు జీవం ఆయనే\\nనమ్మిన వారిన్‌ కరుణించి లేపి - మహిమ రూపంబు మరల నిచ్చి\\n\\n4. జీవించుచున్న దేవుడు - జీవింప జేయు ఆత్మయే\\nదీనుల బ్రోచి భారంబు దీర్చె - భావంబులన్ని నూతన పరచె\\n\\n5. నిన్ను ప్రేమించు దేవుడు - నిన్ను వెదకుచు వచ్చెను\\nకరుణతో బిలిచి సిలువలో నిలిచి - బలియెన దేవ తనయుడైన\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"27\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"217\",\n                \"title\": \"ప్రేమ స్వరూపి యేసుని\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"218\",\n        \"local_title\": \"ప్రేమించి పూజించెదం\",\n        \"local_hint\": \"preminchi\",\n        \"local_text\": \"ప్రేమించి పూజించెదం కీర్తించి ఘనపరచెదం\\nస్తుతియింతుం నీ నామం ప్రకటింతుమ్‌ నీ సత్యం\\nకృపనొంది బలమొంది పని చేసెదం\\n\\n1. మా శైలంబు శృంగంబు నీవేకదా\\nమాకేడెంబు దుర్గంబు నీవేకదా\\nమా జీవితం నీకంకితం\\nనీ చెంతనే మా ఆశ్రయం\\nనీ తోనే నీ బాటనే నడిచెదం\\n\\n2. నీ వాక్యంబు దీపంబు నడిచేందుకు\\nనీ సత్యంబు మార్గంబు తెలిపేందుకు\\nపఠియించెదం ప్రచురించెదం\\nధ్యానించెదం వ్యాఖ్యానించెదం\\nనీ వాక్య మాధుర్యమును గ్రోలెదం\\n\\n3. నీ విచ్చిన పనిని చేపట్టెదం\\nనీ కిచ్చిన మాట నెరవేర్చెదం\\nబోధించెదం బలపరచెదం\\nబలమొండెదం స్థిరపరచెదం\\nనీ దివ్య పరిచర్య సాగించెదం\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"47\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"218\",\n                \"title\": \"ప్రేమించి పూజించెదం\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"219\",\n        \"local_title\": \"భావితరానికి భాటగా లేవాలి\",\n        \"local_hint\": \"bhavitaraniki\",\n        \"local_text\": \"భావితరానికి భాటగా లేవాలి నీ సాక్ష్యం\\nనవతరానికే నాందిగా రావాలి నా సాక్ష్యం\\nదేవుని గొప్పకార్యములన్ని యువతరమంత గ్రహించాలి\\nదేవుని హస్తబల ప్రభావముల్‌ సమాజమును కదిలించాలి\\n\\n1. ఎర్ర సాంద్రమును చీల్చెను - మరణ నదిని దాటించెను\\nపునరుత్ధాన బలమిచ్చి చూడు - ఎంతో గొప్ప దేవుడు నేడు\\n\\n2. తరముల సంతానము - వివరంబు నిను కోరగా\\nతనరారు నీ సాక్ష్యమేగా - వివరించి బలపరచుగాదా\\n\\n3. జ్ఞాపకాలు స్టాపించుము - ఆనవాళ్లు అందించుము\\nమౌలికాలు స్థిరపరచుము - మాదిరి బలపరచుము\\n\\n4. ఉప్పువలె జీవించుము - తప్పులన్ని సవరించుకో\\nవెలుగువలె వ్యాపించుము - విశ్వనేతన్‌ చూపించుము\\n\\n5. సాక్ష్యజీవం కాపాడుకో - యేసు ప్రేమకై వేడుకో\\nఅక్షయుడు శ్రీ యేసుడే - రక్షణని ప్రకటించుము\",\n        \"local_category\": [\n            \"testimony\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"బ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"219\",\n                \"title\": \"219. భావితరానికి భాటగా లేవాలి\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/219.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"220\",\n        \"local_title\": \"మంచి దేవుడ నీవే\",\n        \"local_hint\": \"manchi devuda nive\",\n        \"local_text\": \"మంచి దేవుడ నీవే మార్పునొందని దేవా\\nస్తుతులు చెల్లింతురాజా నిన్ను కీర్తింతు తండ్రీ\\n\\n1.సృష్టికర్తవు నీవు నను సృజించావు\\nత్యాగమూర్తివి నాకై పరము విడిచావు\\nనీకు సాటి లేరెవ్వరు\\n\\n2. భూమి గతింప వచ్చు నీవు మారవుగా\\nఆకాశం తొలగవచ్చు నీవు నిలిచెదవు\\nఏక రీతిగ నీవుందువు\\n\\n3. నాదు సంవత్సరవుల్‌ నీదు ఆధీనము\\nఆయుష్కాలము ఎంతో నీదు స్వాధీనము\\nకరుణాశీలికి ఏమిత్తును?\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"53\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"220\",\n                \"title\": \"220. మంచి దేవుడ నీవే\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/220.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"221\",\n        \"local_title\": \"మన దేశం కానాను దేశం\",\n        \"local_hint\": \"Mana Desham Bhaaratha Desham\",\n        \"local_text\": \"మన దేశం కానాను దేశం \\nమన రాజ్యం దేవుని రాజ్యం \\nస్తుతి ఆరాధన నా ఊపిరి \\nప్రేమనురాగము నా జీవితం\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"54\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"221\",\n                \"title\": \"మన దేశం కానాను దేశం\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"222\",\n        \"local_title\": \"మనమందరము కలిసి\",\n        \"local_hint\": \"Manamandaramu\",\n        \"local_text\": \"మనమందరము కలిసి - ప్రభు సన్నిధిలో నిలిచి\\nపాడెదము హల్లెలూయని - స్తుతియించెదము కృప చాలునని(2)\\n\\n1. ఇంత గొప్ప పరిచర్యను - స్థాపించినది యేసే\\nఇన్నాళ్ళ సహవాసమును - కాపాడినది యేసే\\nనిన్ను నన్ను పిలిచి - యోగ్యులుగా యెంచి (2)\\nసువార్తను ప్రకటించే భాగ్యమిచ్చినందుకే\\n\\n2. ఎన్నో గొప్ప మేలులను - చేసినది యేసే\\nనూతన ఆత్మలను - చేర్చినది యేసే\\nభయభక్తులు కలిగి - కపటమును వీడి\\nహృదయముతో స్తుతించే ధన్యతిచ్చినందున\\n\\n3. ఎంతో గొప్ప ప్రేమను - చూపినది యేసే\\nప్రాణమిచ్చి మన ఆత్మలను - కొన్నది యేసే\\nతలపోసుకొంటూ - తగ్గింపుగలిగి\\nఆత్మతో మనలను - నడిపిస్తున్నందుకై \\n\\n4. రానున్న తరములకు - మాదిరి యేసే\\nఇంత గొప్ప సాక్షి సమూహం - ఏర్పరచెను యేసే\\nపూర్ణ మనస్సు కలిగి - పూర్ణ బలము తోను\\nకృపతో పరిచర్యను సాగిస్తున్నందుకై\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"48\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"222\",\n                \"title\": \"మనమందరము కలిసి\",\n                \"artist\": \"...యన్.నాగరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"223\",\n        \"local_title\": \"మందలో చేరని గొర్రెలెన్నో\",\n        \"local_hint\": \"Mandalo\",\n        \"local_text\": \"మందలో చేరని గొర్రెలెన్నో- కోట్ల కొలదిగా కలవు యిల\\nఆత్మల కొరకై వేదనతో వెదకెదము రమ్ము ఓ యువకా \\nమందలో చేరని గొర్రెలెన్నో\\nరమ్మనే యేసు ప్రార్ధించుము - నడిపించును\\n\\n1. అడవులలో పలు స్థలములలో - నా ప్రజలెందుకు చావవలెన్\\nవారి నిమిత్తమై శ్రమ పడితి - మరి వారిని వెదకెడు వారెవరు\\n\\n2. ప్రకటించని స్థలములు గలవు - చాటించువారు కలరిక్కడ\\nపిలువబడిన వారందరును - మన ప్రభువాజ్ఞకు లోబడి రండి\\n\\n3. నాకై పలికెడి నాలుకలు - నావలె నడిచెడి పాదములు\\nనన్ను ప్రేమించెడి హృదయములు - కావలె నాకివి నీవిచ్చెదవా\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"49\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"223\",\n                \"title\": \"మందలో చేరని గొర్రెలెన్నో\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"224\",\n        \"local_title\": \"మహాదేవా - మహోన్నతుడా\",\n        \"local_hint\": \"Mahadeva\",\n        \"local_text\": \"మహాదేవా - మహోన్నతుడా - అనంత ఆది అమరవాణి\\nపరీవృత తేజో పరిశుద్ధుడా - దివ్యాత్మా దైవ మానవుడా మహాదేవా - మహోన్నతుడా\\n\\n1. నీ రక్తం పాప ఫలహరణం - నీ మరణం పాపికే శరణం\\nనీ అర్పణ నిత్య సంపూర్ణం - నీ జీవం నవ్య దివి తేజం\\n\\n2. నీ సేవకు మమ్ము పిలిచితివి - నీ సొత్తుగ మమ్ము జేసితివి\\nనీ పోలిక మాకు నొసగితివి - నీ ఆత్మలో మమ్ము పొదిగితివి\\n\\n3.నీ వాక్యం మమ్ము విభబించె - నీ సత్యం మమ్ము సంధించె\\nనీ ఆత్మయే మమ్ము వెలిగించె -నీ కృపలే మాదు బలమాయె\\n\\n4. పరిశుద్ధత మాకు నీ చిత్తం - పరిపూర్ణత మాకు నీ సత్యం\\nపరలోక పట్టణ పౌరులము - ప్రభావ మహిమకు వారసులం\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"55\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"224\",\n                \"title\": \"224. మహాదేవా - మహోన్నతుడా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/224.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"225\",\n        \"local_title\": \"మరణించి సమాధి గెలిచి\",\n        \"local_hint\": \"Maraninchi\",\n        \"local_text\": \"మరణించి సమాధి గెలిచి - ధరలేచే ప్రభుండేగదా\\nఈ పునరుత్ధానం - ఈడిత శుభగానం\\nయేసే శరణం - హల్లెలూయ యనుడీ\\n\\n1.మనోంధత్వ మంబుబాపె సదా\\nమనోజ్ఞ సువార్త వెలసెగదా\\nమహిమాత్మ లోక స్వాగతమే\\nమనుజాళికెల్ల మహితంబై\\nమహిలో మహింమంతుల భాగ్యమై \\n\\n2. దురంతన మూడ్చె మృతిగెలిచి\\nచిరంతన జీవజల మొసగె\\nమరణంపు గర్భమును జీల్చి \\nతరుణోదయంబు ప్రచురించే \\nకరుణామయుడై జయశాలియై\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"56\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"225\",\n                \"title\": \"మరణించి సమాధి గెలిచి\",\n                \"artist\": \"...కె.వి.వసురాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"226\",\n        \"local_title\": \"మరలా కట్టుదము రండి\",\n        \"local_hint\": \"marala Kattudamu\",\n        \"local_text\": \"మరలా కట్టుదము రండి - యువతీ యువకులారా (2)\\nపడద్రోయబడిన ప్రాకారములను\\nకాల్చబడిన ఈ గుమ్మములను (2)\\n\\n1. ఆత్మల రక్షణకై భారమును కలిగి (2)\\nకన్నీటి ప్రార్ధనతో (2) దైవవాక్య ఖడ్గముతో\\n\\n2. దైవ శక్తిని తెలుసుకొని శత్రు తంత్రములను ఎరిగి (2)\\nత్యాగముతో పవిత్రతతో (2)కలసి పోదము రారండి\\n\\n3. కష్టము వచ్చినా నిందలు వచ్చినా (2)\\nవిసుగకనే వెనుదీయకనే (2) పనిని పూర్తి చేయుదము\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"50\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"226\",\n                \"title\": \"మరలా కట్టుదము రండి\",\n                \"artist\": \"...డి.రాము\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"227\",\n        \"local_title\": \"మహిమకాంతిలో - మధుర శాంతిలో\",\n        \"local_hint\": \"Mahimakantilo\",\n        \"local_text\": \"మహిమకాంతిలో - మధుర శాంతిలో\\nజీవింపరమ్ము - ఉదయించె వెలుగు - తేజరిల్లుము - మహిమ కాంతిలో\\n\\n1. జీవంపు వెలుగు యేసెగా - జీవింపజేయు క్రీస్తెగా\\nపాపాంధకారం బాసెను - సిలువ కాంతిలో - సిలువ శాంతిలో \\nలెమ్ము తేజరిల్లుము\\n\\n2. నిజమైన వెలుగు యేసెగా - వెలిగించు వెలుగు క్రీస్తెగా\\nఅజ్ఞాన తిమిరం బాసెగా - యేసుని మాటలో - యేసుని బాటలో \\nలెమ్ము తేజరిల్లుము\\n\\n3. హృదయాంధకారం తొలగించెగా - సదయుండే యెదలో వెలుగాయెగా\\nగాఢాంధకార లోయలో - వెలిగించును దీపము - తొలగించును పాపము \\nలెమ్ము తేజరిల్లుము\\n\\n4. వెలుగైన దేవుడు అరుదెంచెగా - అరుదైన ఆ వెలుగు మనదాయెగా\\nభాసుర తేజ బాటలో - మోక్షపు బాటలో - యేసుని సాక్షిగా \\nలెమ్ము తేజరిల్లుము\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"57\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"227\",\n                \"title\": \"227. మహిమకాంతిలో - మధుర శాంతిలో\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/227.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"228\",\n        \"local_title\": \"మహిమాన్విత యేసూ - మహాఘనుడా\",\n        \"local_hint\": \"Mahimanvita\",\n        \"local_text\": \"మహిమాన్విత యేసూ - మహాఘనుడా\\nమనుజావతారా - మనోహరుడా\\nమరణించితివి - మృత్యుంజయుడా\\nమారనాత - నీకే స్తోత్రం ప్రభువా\\n\\n1.నా ఆత్మలో బలము - నా పాటలో మధురం\\nనా మాటలో జీవం - నీవేనయ్యా\\nనీ ప్రేమ నిచ్చి - నను - కరుణించితివి\\nనీ రక్త క్రయ ధనముతో - రక్షించితివి\\nపరిశుద్ధ పరచి - నీ ప్రేమ నింపి\\nనీ సోత్తుగ నను జేసి - దీవించితివే\\n\\n2. నిందను తొలగించి - బంధాలు తెంపి\\nడెందములో నీ అందం - పొందుగ నింపి\\nకృపా మహదైశ్వర్యం - అందించితివి\\nనిందారహితునిగా - నను - కరుణించితివి\\nనిర్ధోషమార్గం - నూతనమగు హృదయం\\nనిను నేను సేవింప - ఏర్పరచితివే\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"58\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"228\",\n                \"title\": \"228. మహిమాన్విత యేసూ - మహాఘనుడా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/228.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"229\",\n        \"local_title\": \"మా యేసు - మా ఆశ\",\n        \"local_hint\": \"ma yesu\",\n        \"local_text\": \"మా యేసు - మా ఆశ మా రాజా - మా తేజ \\nమా దేవా - మహాదేవ జీవాధార - మా కరుణాధార\\nఘనతా మహిమ నీకే స్తుతి ఆరాధన నీకే\\nఇహపరములలో నీకే తరతరములలో నీకే\\n\\n1. రక్షించావు - విడిపించావు అక్షయ కృపనిచ్చి - నడిపించావు\\nపోషించావు - క్షేమమిచ్చావు రక్షకుడా - నీ రాజ్యమిచ్చావు\\n\\n2. అద్వితీయా - ఆదిదేవా ఆత్మీయ సహవాసం - అందించావు\\nఅద్భుతమే - ఆనందమే అసమానుడా - అభిషేకమిచ్చావు\\n\\n3. నీ జనులమే - నీ స్వాస్థ్యమే నీ తనువుగా - యిల నిర్మించావు\\nయాజకులమే - రాజ్యమేలెదం రారాజుతోడనే - రమ్యముగా\\n\\n4. ప్రకటించెదం - ప్రభుప్రేమనే పరలోక ఆనందం - పంచెదము\\nప్రభువే మార్గం - ప్రభువే సత్యం ప్రభువే జీవం - అని చాటెదము\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"59\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"229\",\n                \"title\": \"229. మా యేసు - మా ఆశ\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/229.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"230\",\n        \"local_title\": \"మారుచున్న సమాజములోన\",\n        \"local_hint\": \"maruchunna samajamulona\",\n        \"local_text\": \"మారుచున్న సమాజములోన - మారని యువకులు లేవాలి\\nమారని యేను మార్గములోన - మరలక నడవాలి\\n\\n1. చదువులలో - పదవులలో - పెదవులలో - హృదయములో\\nమాటలలోన - పాటలలోన\\nపరిశుద్ధతయే కావాలి - పరివర్తనయే రావాలి\\n\\n2. చూపులలో - రూపులలో - కోరికలో - తీరికలో\\nఅందములోన - బంధములోన\\nపరిశుద్ధతయే కావాలి - పరివర్తనయే రావాలి\\n\\n3. సేవలలో - త్రోవలలో - వేడుకలో - కూడికలో\\nకవళికలోన - గమనికలోన\\n పరిశుద్ధతయే కావాలి - పరివర్తనయే రావాలి\\n\\n4. జ్ఞానములో - ధ్యానములో - గానములో - దానములో\\nబోనములోన - పానములోన\\nపరిశుద్ధతయే కావాలి - పరివర్తనయే రావాలి\\n\\n5. మోదములో - ఖేదములో - శోధనలో - రోదనలో\\nసాధనలోన - వాదనలోన\\nపరిశుద్ధతయే కావాలి - పరివర్తనయే రావాలి\",\n        \"local_category\": [\n            \"testimony\"\n        ],\n        \"local_categorycount\": \"2\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"230\",\n                \"title\": \"మారుచున్న సమాజములోన\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"231\",\n        \"local_title\": \"మా వెతలు తీరె-సమసిపోయే\",\n        \"local_hint\": \"Ma vetalu\",\n        \"local_text\": \"మా వెతలు తీరె - సమసిపోయే మాదు దాస్యం\\nమా ఎదుట నిలిచె - సుధలు కురిసే కొత్తలోకం\\nఅపజయమే లేదులే - బ్రతుకంతా కలిమిలే\\nగత వ్యధలన్నీ మరుగైపోయెలే\\n\\n1. గతించెలే మాదు శాపం - శాపం\\nజీవితమే కొత్త రూపం - రూపం\\nవేదన రోదన విన్నపాలే - దేవుని ముంగిట మొరలాయే (2)\\nయెహోవా బల ప్రభావాలే - కడలి చీల్చి నడిపించెలే\\n\\n2. అరణ్యమే మాకు మార్గం - మార్గం\\nబండలు తీర్చును మాదు దాహం - దాహం\\nపాలు తేనెలు ప్రవహించేదే మేమడుగిడే ఆ దేశం (2)\\nవిడువడు మనలనెన్నటికీ\\nప్రభువే దైవం మనకందరికీ\\n\\n3. స్తుతింతుము ప్రభుని నామం - నామం\\nఏల్‌ ఓలామ్‌ మాదు జీవం - జీవం\\nఎన్నడు ఇకపై తొలగిపోము - దేవుని మేము విడిచిపోము\\nఆయనే మా సర్వస్వం - ఆయనకే బ్రతుకంకితం\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"37\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"231\",\n                \"title\": \"మా వెతలు తీరె-సమసిపోయే\",\n                \"artist\": \"...తాళ్ళూరి ప్రసాద