hint\": \"need\",\n        \"local_text\": \"మొదటిగా దేవుని రాజ్యమును - వెదకుము ఆయన నీతిని\\nఈ ధర పరములు నీవగును - హల్లెలూ... హల్లెలూయ \\nహ...ల్లె...లూ...య   హ...ల్లె...లూ...య\\nహ...ల్లె...లూ...య   హల్లెలూ... హల్లెలూయ\\nఅడుగుము నీకది ఇవ్వబడున్‌ - వెదికిన దొరుకును మేలు\\nతట్టుము నీకది తెరువబడున్‌ - హల్లెలూ - హల్లెలూయా హ...ల్లె...లూ...య\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"60\",\n        \"index_letter\": \"మ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"235\",\n                \"title\": \"235. మొదటిగా దేవుని రాజ్యమును\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/235.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"236\",\n        \"local_title\": \"యజమానుడు వాడుకొనుటకు\",\n        \"local_hint\": \"Yajamanudu\",\n        \"local_text\": \"యజమానుడు వాడుకొనుటకు - అర్హమైన పాత్రగా ఉండుటకు\\nజీవితాంతం పోరాడు - అలసిపోకు ఏనాడు\\n\\n1. గొప్పయింటిలో - వెండి పాత్రలు బంగారు పాత్రలు (2)\\nమట్టిపాత్రలు కర్రపాత్రలు - ఘనతకు కొన్ని ఘనహీనతకు\\nకొన్ని వీటిలో చేరనినాడు పవిత్రముగా జీవించిననాడు పరిశుద్ధ\\nడవై యజమానుడు వాడుకొనుటకు అర్హమైన పాత్రవగుదువు\\n\\n2. యవనేచ్చలను వీడుము యేసు ప్రభుని వేడుము\\nనీతిని విశ్వాసమును - ప్రేమను సమాధానమును\\nవెంటాడుము - శోధించుము, సాధించుము\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"51\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"236\",\n                \"title\": \"యజమానుడు వాడుకొనుటకు\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"237\",\n        \"local_title\": \"యవ్వనకాలమందు\",\n        \"local_hint\": \"Yavvanakalamandu\",\n        \"local_text\": \"యవ్వనకాలమందు - నీ కాడి మోయుదుము\\nయవ్వన రక్తము మాపై - చిందించిన ప్రభువా\\nసువార్త చాటుచు - నీ ప్రేమ చూపుము స్తుతులు చెల్లింతుము\\n\\n1. పాపము చేత - కృంగిన మాకై - పరము వీడితివి\\nశాపము బాపగ - సిలువలో కృంగి - విడుదల నిచ్చితివి\\nనీ ప్రేమ దలచి - నీకై నిలచి - ఆరాధింతుము నిన్నే\\n\\n2. శోధనలందున - తప్పి పోకుండగ - కాపాడి బలమిమ్ము\\nబాధలయందున - నీ కృప తోడుగ - వర్థిల్ల జేయుమయ్యా\\nఈధరయందున - నిన్ను కీరించి - అర్పించెదము జీవితం\\n\\n3. నీ సంఘమందు - నిన్ను సేవింపగ -నీ ఆత్మతో నింపుము\\nనీ సత్యవాక్యము - ధ్యానింప మాకు -నీ జ్ఞానమిమ్ము దేవా\\nప్రార్ధన మాకు - నేర్పించుమయ్యా - జీవించెదము నీకై \",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"33\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"237\",\n                \"title\": \"యవ్వనకాలమందు\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"238\",\n        \"local_title\": \"యెహోవ నీవే బలము\",\n        \"local_hint\": \"Yehovaa nive\",\n        \"local_text\": \"యెహోవ నీవే బలము ప్రేమింతున్‌\\nయెహోవ నీవే శైలం రక్షించుమ్‌\\nనాకేడెము నా శృంగం నాదుర్గం\\nకీర్తనీయుడగు దైవం పరమ తండ్రి\\nహల్లెలూయ హల్లెలూయ హల్లెలూయ హల్లెలూయ\\n\\n1. మరణ పాశము చుట్టిననూ మరువక విడిపించితివి\\nనరక పాశము లరికట్టిననూ మొరను విని దరిజేర్చితివి (2)\\nశత్రువు చేతినుండి విడిపించు దేవా\\nభక్తుల ప్రార్ధన వినుచుండు దేవా (2)  #హల్లెలూయ#\\n\\n2. నీతి నిర్దోషత్వమును ప్రతి ఫలమునకు కారణము\\nనేను ఆయన కిష్టుడను కనుక నను తప్పించెను\\nఆపత్కాలమందునా ఆదుకొనువాడా\\nదయగల వారి ఎదల దయామయుడవుగా  #హల్లెలూయ#\\n\\n3. శ్రమలో నుండిన వారికి రక్షకుడవు నీవే\\nశరణుజొచ్చిన వారికి కోట కేడెము నీవే\\nవెలుగుగా చీకటిని మార్చగల దేవా\\nఎత్తైన స్థలముల మీద నను నిలుపువాడా  #హల్లెలూయ#\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"61\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"238\",\n                \"title\": \"238. యెహోవ నీవే బలము\",\n                \"artist\": \"...జి.మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/238.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"239\",\n        \"local_title\": \"యెహోవా దయాళుడు\",\n        \"local_hint\": \"Yehovaa Dayaaludu\",\n        \"local_text\": \"యెహోవా దయాళుడు ఆయనకే కృతజ్ఞతా స్తుతి చెల్లించుడి(2)\\nకృతజ్ఞతలర్పించుడి - స్తుతులను చెల్లించుడి (2)\\n\\n1. నాకము వర్షించినా - లోకము నశించినా (2)\\nకాపరియై మమ్ము - కాచిన ప్రభునకు (2)  #కృతజ్ఞతా#\\n\\n2. ఆపదలే రానీ - అపనిందలే కానీ (2)\\nమాకు అండగా - నిలచిన విభునకూ (9)  #కృతజ్ఞతా#\\n\\n3. కరువులు కలిగిననూ - కలతలు వచ్చిననూ (2)\\nకరుణతో కొరతలను - తీర్చిన ప్రభునకు (2)  #కృతజ్ఞతా#\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"62\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"239\",\n                \"title\": \"యెహోవా దయాళుడు\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"240\",\n        \"local_title\": \"యెహోవా నాకు వెలుగాయె\",\n        \"local_hint\": \"Yehovaa naaku\",\n        \"local_text\": \"యెహోవా నాకు వెలుగాయె యెహోవా నాకు రక్షణయె\\nనా ప్రాణదుర్గమయె నేను ఎవరికి ఎన్నడు భయపడను (2)\\n\\n1. నా తల్లియు - నా తండ్రియు - ఒకవేళ విడచినను\\nఆపత్కాలమున - చేయి విడువకను\\nయెహోవా నన్ను చేరదీయును\\n\\n2. నా కొండయు - నా కోటయు - నా ఆశ్రయము తానే\\nనేనెల్లప్పుడు - ప్రభు సన్నిధిలో\\nస్తుతిగానము చేసెదను\\n\\n3. నాకు మార్గమును - ఉపదేశమును - ఆలోచన అనుగ్రహించి\\nనీ ఆజ్ఞలలో జీవించుటకు కృపతో నింపి కాపాడుము\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"38\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"240\",\n                \"title\": \"యెహోవా నాకు వెలుగాయె\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"241\",\n        \"local_title\": \"యెహోవా నీ నామము\",\n        \"local_hint\": \"Yehovaa Nee Naamamu Entho Balamainadi\",\n        \"local_text\": \"యెహోవా నీ నామము ఎంతో బలమైనది\\nఆ…ఆ…ఆ… ఎంతో బలమైనది\\n\\n1.మోషే ప్రార్ధింపగా మన్నాను కురిపించితివి\\nయెహోషువా ప్రార్ధించగా సూర్యచంద్రుల నాపితివి\\n\\n2. సింహాముల బోనైననూ సంతోషముగా వెళ్ళిరి\\nప్రార్ధించిన వెంటనే రక్షించె నీ హస్తము\\n\\n3.పౌలు సీలను బంధించి చెరసాలలో వేసినా\\nపాటలతో ప్రార్ధించగా చెరసాల బ్రద్దలాయే\",\n        \"local_category\": [\n            \"prayer\"\n        ],\n        \"local_categorycount\": \"8\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"241\",\n                \"title\": \"యెహోవా నీ నామము\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"242\",\n        \"local_title\": \"యెహోవాయే దయాళుడు\",\n        \"local_hint\": \"Yehovaaye dayaludu\",\n        \"local_text\": \"యెహోవాయే దయాళుడు ఆయనను స్తుతించెదము\\n\\n1. ఇరుకునందుండి నేను మొఱ్ఱపెట్ట\\nవిశాల స్థలమందు నా మొఱ్ఱ నాలించెన్‌\\nయెహోవాయే నా రక్షణదుర్గం\\nఆయనయే నా ఆనందగానం\\nఆయనను పూజించెదము\\n\\n2. మనుష్యుల నమ్ముటకంటె యెహోవాను\\nఆశ్రయించుట నాకెంతో మేలు\\nయెహోవాయే నా పక్షము నుండ\\nనరులు నాకేమి చేయగలేరు\\nఆయనకే కృతజ్ఞతల్‌\\n\\n3. ఇల్లుకట్టువారు నిషేధించిన రాయి\\nమూలకు తలరాయి ఆయెను\\nఇది దేవుని వలన కలిగిన కార్యం\\nఅది మన కన్నులకు ఆశ్చర్యం ఎంతో\\nఆయనను కీర్తించెదము\\n\\n4. ఇది యెహోవా ఏర్పరచిన దినము\\nదీనియందు మనము ఉత్పహించి\\nమా పట్ల చేసిన ఇన్ని మేలులకై\\nనిరతము నిలచే మీ ఉన్నత కృపకై\\nఇవియే మా వందన స్తుతులు\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"63\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"242\",\n                \"title\": \"యెహోవాయే దయాళుడు\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"243\",\n        \"local_title\": \"యేసయ్యా, కృతజ్ఞాతాస్తుతి\",\n        \"local_hint\": \"yessaya\",\n        \"local_text\": \"యేసయ్యా, కృతజ్ఞాతాస్తుతి నీకే గతకాలమంతా నడివించినావు\\nప్రభువా, స్తుతి స్తోత్రములు నీకే పరిచర్యలో ఫలముల నిచ్చితివి\\n\\n1. నీ కృప ఎంతో విస్తరించె మాకు\\nఆకృతి నిచ్చె మా జీవితాలకు\\nఓ క్రీస్తు ప్రభువా నీ ప్రేమ అద్భుతం\\nమా కృతజ్ఞతలు నీకే దేవాది దేవా\\n\\n2. ఆరంభము నందే చేరదీసి మమ్ము\\nభారమిచ్చి నీవే పంపినావు పనికై\\nకారుణ్య ప్రభువా, మము వాడుకొంటివి,\\nదూరతీరాలకు సాక్షులుగా పంపితివి\\n\\n3. ఇంత కాలమంతా నీవే సేవ చేసి\\nవింతగా మమునీ జతపనివారన్నావు\\nఎంతైనా నీవు నమ్మదగిన దేవుడవు\\nచింతలేదు మాకు మా తోడు నీవే\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"64\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"243\",\n                \"title\": \"యేసయ్యా, కృతజ్ఞాతాస్తుతి\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"244\",\n        \"local_title\": \"యేసయ్యా - ప్రేమామయా\",\n        \"local_hint\": \"yessaya premamaya\",\n        \"local_text\": \"యేసయ్యా - ప్రేమామయా - ఏరీతి స్తుతియింతు - నీకేమి చెల్లింతు\\nపరమ తండ్రి పావనాత్మ వందన స్తుతులందుకో\\n\\n1. ఆ నిశీధరాత్రిలో - గెత్సెమనే తోటలో\\nమరణ వేదన బాధలందు - అలసిపోతివా నా ప్రభు\\n\\n2. కఠిన యూదులు బట్టిరి - అకట హింసలు బెట్టిరి\\nనెపములెన్నో నేరమెంతో - మోపి నీపై ఉమిసిరా\\n\\n3. కరకు కొరడా దెబ్బలు - పడెను వడి నీ మేనుపై\\nచీల్చి దేహం చిందె రక్తం - మౌనివైతివా నా ప్రభూ\\n\\n4. నీదు సిలువ మరణమందు - నీవు కార్చిన రక్తమందు\\nనాదు పాపము పరిహరించి - నన్ను ధన్యుని జేసినావు\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"65\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"244\",\n                \"title\": \"244. యేసయ్యా - ప్రేమామయా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/244.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"245\",\n        \"local_title\": \"యేసుక్రీస్తు నిన్ను పిలిచెనుగా\",\n        \"local_hint\": \"Yesukrintu\",\n        \"local_text\": \"యేసుక్రీస్తు నిన్ను పిలిచెనుగా\\nరావేల ఓ యువకా, రావేల ఓ యువతి\\n\\n1.నీ యవ్వన కాలమందే - ప్రభు కాడిని మోయుటచే\\nమేలొందెద నీవిపుడు - జాగేలను యువజనమా\\nనీ హృదయము ప్రభుకిమ్ము - ప్రభుజీవము నీదగును\\n\\n2. గురిలేని నీ బ్రతుకు - ఎరయాయె విరోధికి\\nత్వరపడకుంటే నీకు - మరి తప్పదు నరకాగ్ని\\n\\n3. నీ దేహము దేవునిది - శుద్దాత్మకు నిలయమిది\\nప్రభు కర్పణ చేయనిదే - పడగొట్టును అపవాది\\n\\n4. తన వనములో పనిచేయ - పనివారలు కావలెను\\nవినలేవా ప్రభు స్వరము - కనలేవా ప్రభు పొలము\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"34\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"245\",\n                \"title\": \"యేసుక్రీస్తు నిన్ను పిలిచెనుగా\",\n                \"artist\": \"...రెవ.డి.జె.అగస్టీన్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"246\",\n        \"local_title\": \"యేసుక్రీస్తుని మంచి శిష్యులముగా \",\n        \"local_hint\": \"Yesukrintuni\",\n        \"local_text\": \"1. యేసుక్రీస్తుని మంచి శిష్యులముగా - విశ్వాసముతో సాగెదము\\nమనమందరము ఆయన సేవను - ఏకమై సదా జేసెదము\\nమన యేసు ప్రభువు - శీఘ్రముగా వచ్చును\\nఅతి వేగముగా సేవ చేతుము -\\nయేసుక్రిస్తుని మంచి శిష్యులముగా - విశ్వాసముతో సాగెదము\\n\\n2. అందరి యెడల ప్రేమ జూపెదం - యేసు చెంతకు పిలిచెదము\\nఅతి శీఘ్రంబుగ ఉత్సాహంబుతో - రాజమార్గమును చూపెదము  #మన#\\n\\n3. సాతాను దుర్గమును పడగొట్టి - యిక యేసుకొరకే జీవింతుము\\nఈ లోకమంతటిన్‌ - ప్రభు యేసు నామమున్‌\\nఎల్లవేళలందు చాటెదము  #మన#\\n\\n4. ప్రాణాత్మ దేహములు ప్రభు సేవకే\\nఇక జీవించుట తన కొరకే\\nఅని నిశ్చయించుచు - అందు నిలిచియుండి\\nప్రభు దినమందు హర్షింతుము  #మన#\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"35\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"246\",\n                \"title\": \"యేసుక్రీస్తుని మంచి శిష్యులముగా \",\n                \"artist\": \"...యం.క్రిష్ణయ్య\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"247\",\n        \"local_title\": \"యేసుడు రక్షకుడై \",\n        \"local_hint\": \"Yesudu\",\n        \"local_text\": \"యేసుడు రక్షకుడై - పుట్టెను ఈ భువిలో\\nనిన్నే రక్షించుటకై - నీలో జీవించుటకై\\n\\n1. లోకము పాపముతో నిండెను - నశించెను\\nదేవుడు దాని జూచెను - ప్రణాళిక రచించెను\\nపాపమును కొట్టివేయుటకై - మానవుని రక్షించుటకై\\n\\n2. వాక్యమే సశరీరుడై - వచ్చెను వసించెను\\nకృపా సత్య సంపూర్ణుడుగా - త్రియేక దేవుడు మహిమతో\\nపాపమును కొట్టి వేయుటకై - మానవుని రక్షించుటకై\\n\\n3.నశించిన దానిని - ప్రేమతో వెదకుచును\\nమనుష్య కుమారుడుగా వచ్చెను - మ్రానుపై ప్రాణము పెట్టెను\\nపాపమును కొట్టివేయుటకై - మానవుని రక్షించుటకై\",\n        \"local_category\": [\n            \"christmas\"\n        ],\n        \"local_categorycount\": \"5\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"247\",\n                \"title\": \"యేసుడు రక్షకుడై \",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"248\",\n        \"local_title\": \"యేసుతో రీతిగాను పోదమా\",\n        \"local_hint\": \"yesuto\",\n        \"local_text\": \"యేసుతో రీతిగాను పోదమా? అడ్డుగా వచ్చు వైరి గెల్వను\\nయుద్ద నాదంబుతో బోదమా..... \\n\\n1. రారాజు సైన్యమందు చేరను - ఆ రాజు దివ్య సేవచేయను - యేసు రాజు ముందుగా\\nధ్వజము - బట్టి నడువగా - యేసుతో రీవిగాను వెడలను\\n\\n2. విశ్వాస కవచమున్‌ ధరించుచు - రారాజునాజ్ఞ మదిని నిల్పుచు - అనుదినంబు శక్తిని\\nబొందుచున్న వారమై - యేసుతో ఠీవిగాను వెడలను\\n\\n3. శోధనలు మనల చుట్టివచ్చినా - సాతాను అంబులెన్ని తగిలినా - భయములేదు మనకిక\\nప్రభువు చెంత నుందుము - యేసుతో ఠీవిగాను వెడలను\\n\\n4. ఓ యువతీ యువకులారా చేరుడి - శ్రీ యేసురాజు వార్త చాటుడి - లోకమంత ఏకమై\\nయేసునాధు గొల్వను - సాధనంబెవరు నీవునేనెగా\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"36\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"248\",\n                \"title\": \"యేసుతో రీతిగాను పోదమా\",\n                \"artist\": \"...ఎ.పి.కిన్సి0గర్ - పి.డి.శుభామణి\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"249\",\n        \"local_title\": \"యేసుతో సాగిపో,నేర్చుకో పరుగును\",\n        \"local_hint\": \"yesuto sagipo\",\n        \"local_text\": \"యేసుతో సాగిపో, నేర్చుకో పరుగును\\nబాసలే నిలుపుకో, చేరుకో నీ గురిన్‌\\n\\n1. సిలువ వార్త ప్రకటింప సిగ్గుపడుచునుందువా?\\nవిలువైన ప్రాణమును యేసు ధారపోసెగా\\nసిలువ మార్గమంత పూలబాటేమీ కాదు\\nసిలువధారి యేసు ప్రేమ అలుసేమి కాదు, పలుచనేమి కాదు\\n\\n2. నిలకడగా పరుగెత్తిన బహుమతి నీ కున్నది\\nపౌలులాగా పరుగెత్తు నీతి మకుటమున్నది\\nపాలివాడవౌతావా క్రీస్తు శ్రమల యందును\\nజోలి ఏమి నీకుండదు పాపముతో నీకిల శోధనలో జయమిల\\n\\n3. దేని కొరకు పౌలిలలో ఏర్పరచుకొనబడెనో\\nదాని పట్టుకొనవలెనని పరుగెత్తె ఓరిమితో\\nవేనవేల కొలది నన్య జనులన్‌ సంపాదించె\\nఈ నిమిషమే నీ గురిని తెలుసుకో నేస్తమా, మసలుకో నేస్తమా\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"52\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"249\",\n                \"title\": \"యేసుతో సాగిపో,నేర్చుకో పరుగును\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"250\",\n        \"local_title\": \"యేసుతో సాగిపో-యేసులో నిలిచిపో\",\n        \"local_hint\": \"Yesuto sagipo\",\n        \"local_text\": \"యేసుతో సాగిపో - యేసులో నిలిచిపో \\nయేసుని సిలువ విలువ తెలియజేయుమా \\nయేసురాజు ముందు నడువగా - నీతి రాజ్యం స్థాపించుమా \\n\\n1.కొండలైన లోయలను - ఎండమావి మాయలైనను \\nనిండు మనసుతో వెంబడించుమా సిలువ బలము నీకు తోడుగా\\n\\n2. శ్రమయు బాధ - హింసయైనను - కరవు వస్త్రహీనతైనను \\nఉపద్రవములు ఖడ్గమరణముల్ - సిలువ ప్రేమన్ తొలగజేయునా\\n\\n3.దేని గూర్చి చింతపడకుము - చెంతజేరి విన్నవించుము \\nకృతజ్ఞతతో ప్రార్థించుము 