 కొసగినాడు - తన మహిమ నా కొసగువాడు (2)\\nస్తుతిపాడి కొనియాడి - హెచ్చించి సేవించెదన్‌ (2)\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"66\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"256\",\n                \"title\": \"256. యేసులో ఆనందింతును\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/256.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"257\",\n        \"local_title\": \"యేసులో సంపూర్ణతను\",\n        \"local_hint\": \"yesulo Sampurnatanu\",\n        \"local_text\": \"యేసులో సంపూర్ణతను సాధిద్దాం - క్రీస్తులో పరిపూర్ణతకు పరుగిడుదాం (2)\\nయేసులో సంపూర్ణతకు సహకారం, క్రీస్తులో పరిపూర్ణతకు పరమార్ధం (2)\\n\\n1. వాక్యము ప్రార్ధన సంపూర్ణతకు తొలిమెట్టు, అవి తొలగించును ఇక్కట్లు (2)\\nసహకారం సహవాసం సాయపడును సంపూర్ణతకు (2)\\nయేసువంటి సంపూర్ణతకు, క్రీస్తు కోరు సంపూర్ణతకు\\n\\n2. భక్తుల మాదిరిని లేఖనమందు ధ్యానిద్దాం, మాదిరిగాను జీవిద్దాం (2)\\nబాలలుగా సాగకను బలము గలిగి ఇక వెళ్ళుదము (2)\\nక్రీస్తు కృపలో బలమొందుదము - సంపూర్ణతకు సాగుదము\\n\\n3. శ్రమలను హింసను సువార్త సేవలో పొందినను, క్రీస్తు ప్రేమను చూపుదము (2)\\nదీనత్వం సాత్వికం పరిశుద్ధతను చూపుదము (2)\\nక్రీస్తు మాదిరిని చూపుదము సంపూర్ణతను పొందుదము\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"39\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"257\",\n                \"title\": \"యేసులో సంపూర్ణతను\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"258\",\n        \"local_title\": \"యేసుప్రభూ,నిను స్తుతియించెద\",\n        \"local_hint\": \"yesuprabhu\",\n        \"local_text\": \"యేసుప్రభూ,నిను స్తుతియించెద భాసిల్లెను నీ ప్రేమ నాపై\\n\\n1. పరమును వీడి నరరూపివై సరిగా నాడే అరుదెంతివి\\nకొరగాని నన్ను పరమున చేర్చగ ధరలో నీవే కరుణించితివి\\n\\n2. అద్భుత దేవా ఆత్మ స్వరూపా సద్భక్తితో నిను పూజించెదను\\nఉన్నత స్థలముల నివసించువాడా, దీనుడ నాతో నివసించుచున్నావా\\n\\n3. దీనుడా నీవు సాత్విక ప్రభువై, వీనుల విందుగ బోధించితివి\\nకానము నీలో తప్పుడు బోధలునే నీ చెంత నేర్చుకొందు నిలలో\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"40\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"258\",\n                \"title\": \"యేసుప్రభూ,నిను స్తుతియించెద\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"259\",\n        \"local_title\": \"యేసు ప్రభువ నీలో\",\n        \"local_hint\": \"yesu prabhuva\",\n        \"local_text\": \"యేసు ప్రభువ నీలో నేను నిలిచియుండెదన్‌\\nదోసిలొగ్గి నిన్నె ఇలలో తలచుచుండెదన్‌\\nనిజమైన ద్రాక్షవల్లి నీవే ఓ యేసు దేవా\\nనీలోని తీగనై నీతోనే నన్ను ఫలియింప నీయుమా దేవా\\n\\nఓ దైవమా నా జీవమా నా జీవమా నా జీవమా\\nనీ నుండి వేరై నేను ఏమియు చేయగలేను\\nనాపైన నీవే దయచూపి నన్ను\\nజీవింప నీయుమా దేవా\\nఓ దైవమా నా జీవమా నా జీవమా నా జీవమా\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"41\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"259\",\n                \"title\": \"259. యేసు ప్రభువ నీలో\",\n                \"artist\": \"...రాజారత్నం\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/259.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"260\",\n        \"local_title\": \"యేసు ప్రభుని శిష్యుడనుగా\",\n        \"local_hint\": \"yesu prabhuni\",\n        \"local_text\": \"యేసు ప్రభుని శిష్యుడనుగా నేసాగెదను\\nనా సిలువెత్తుకొని ఆయనను వెంబడించెదను\\n\\n1. సిలువంటే అవమానం శ్రమలు హింసలు యున్నను (2)\\nవిలువైన ప్రాణమును వీడవలసి వచ్చినా\\nకలిసెదను నా సిలువతో -నా ప్రభువైన యేసును\\n\\n2. వెలుగైన యేసు ప్రభున్‌ - ప్రేమతో దీక్షతో వెంబడింతును (2)\\nనిలకడగా వెంబడింప - నన్ను త్యజించుకొందును\\nకలిమిని బలిమిని నా యేసుకే సమర్పింతును\\n\\n3. ఖలుడైన సాతానుని - రాజ్యము ఇలలో యున్నను\\nబలముతో యేసుని - వార్తను ప్రకటింతును\\nనిలిచెదను నా యేసుకు - బలమైన సాక్షిగా\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"42\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"260\",\n                \"title\": \"యేసు ప్రభుని శిష్యుడనుగా\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"261\",\n        \"local_title\": \"యేసుప్రియుడా - ఆత్మనాధుడా\",\n        \"local_hint\": \"yesupreyuda\",\n        \"local_text\": \"యేసుప్రియుడా - ఆత్మనాధుడా \\nఆశ్రయింతుము - నీదు నీడను\\nనీ కృప చాలును - ప్రేమామయుడా \\nమా స్తుతులందుకో - దైవ తనయుడా\\n\\n1. మా బహుమానం - మా కేడెము నీవే\\nఆశ్రయ దుర్గం - ఆధారమీవే\\nమా కొండయు - కోటయు నీవె\\nమా వెలుగును - విమోచనం నీవే\\n\\n2. రక్షణ కేడెం - అందించు వాడవు\\nదక్షిణ హస్తం - ఆదుకొనును\\nహెచ్చించెను - నీ సాత్వికము\\nమా చోటును - విశాల పరచితివి\\n\\n3. మా దీపమును - వెలిగించువాడవు\\nచీకటి వెలుగుగా - మార్చువాడవు\\nనీ బలమున్‌ - ధరింపజేతువు\\nనీ మార్గముల్‌ - బయలు పరతువు\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"67\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"261\",\n                \"title\": \"యేసుప్రియుడా - ఆత్మనాధుడా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"262\",\n        \"local_title\": \"యేసు రాజూ నీతి రాజా\",\n        \"local_hint\": \"yesu raja\",\n        \"local_text\": \"యేసు రాజూ నీతి రాజా\\nశాంతి దాతా జీవ దాతా\\nమహిమ నీకే ప్రభూ\\nనాదేవా నీవేనా అతిశయ గానమే\\nనాదేవా నీకేనా స్తుతి ఆరాధన\\n\\n1. నీరక్తం నీ నామం\\nనీరక్తంనీ నామం\\n\\nనా పాపం తుడిచెనుగా\\n\\nనీ వాక్యం నీ ఆత్మ\\nనీ వాక్యం నీ ఆత్మ\\n\\nనా దోషం కడిగెగా (2)\\n\\n2. నా మార్గం నా సత్యం\\nనా మార్గం నా సత్యం\\nనా జీవం నీవేగా\\nనా స్వాస్థ్యం నా భాగ్యం\\nనా స్వాస్థ్యం నా భాగ్యం\\nనా సర్వం నీవేగా (2)\\n\\n3. నీ కృప నీ ప్రేమ\\nనీ కృప నీ ప్రేమ\\nరక్షించి వెలిగించెగా\\nనీ మరణం నీ జీవం\\nనీ మరణం నీ జీవం\\nజయమిచ్చి నడిపించెగా (2)\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"68\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"262\",\n                \"title\": \"262. యేసు రాజూ నీతి రాజా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/262.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"263\",\n        \"local_title\": \"యేసురాజు నిన్ను పిలిచెను\",\n        \"local_hint\": \"yesuraju\",\n        \"local_text\": \"యేసురాజు నిన్ను పిలిచెను - ప్రేమతోడ నిన్ను కోరెనూ\\nకాలయాపనేల క్రైస్తవా - క్రీస్తు కొరకు పంటకూర్చవా\\n\\n1. ఓరుగంటి కాకతీయ పొలము చూడరా - నాగార్జున పంట కూడా సిద్ధమాయెరా\\nఆంధ్ర తిరుపతి మరియు ఉస్మానియాలు(2) - క్రిస్తుకొరకు - పంటసీమలు\\n\\n2. నిర్విచార రితినిట్లు - ఏల నిలుతువు? - నిన్ను పిలుచు యేసు స్వరము - నాలకింపవా?\\nయేసునాధుని - తోటి కార్మికుండవై - కలసి నడచుటెంత ఘనతరా\\n\\n3. కన్నులెత్తి పొలము నీవు పారజూడరా - తెల్లబారి కోతకొరకు - సిద్ధమాయెరా\\nవిత్తువాడును కోతకోయువాడునూ - సంతసించు తరుణమాయొరా\\n\\n4. యేసు నెరుగనట్టి తోటి యువకులెందరో - వ్యర్థమైన పంటగా నశించు చుండగా\\nచూచుచుందువా? నీవు సాక్ష్యమీయవా? - భార రహితమేల - క్రైస్తవా\",\n        \"local_category\": [\n            \"missions\"\n        ],\n        \"local_categorycount\": \"13\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"263\",\n                \"title\": \"యేసురాజు నిన్ను పిలిచెను\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"264\",\n        \"local_title\": \"యేసు వైపు చూచుచు\",\n        \"local_hint\": \"yesu vipu\",\n        \"local_text\": \"యేసు వైపు చూచుచు - గురిని మదిని నిల్పుచు (2)\\nవిశ్వాస పందెమందు పరుగిడెదమా పరుగిడెదమా\\n\\n1. లేఖనమందలి భక్తుల - విశ్వాసమును తలచుచూ\\nచిక్కులబెట్టు పాపము - జాగ్రత్తతోడ సాగుదమా (2)\\n\\n2. అలసట పడక విసుకక - యేసుని వార్తను చాటుచు (2)\\nఎదుట వుంచిన ఆనందముకై - ఓపిక తోడ సాగెదమా (2)\\n\\n3. విశ్వాసమునకు కర్తయు - కొనసాగించు వాడును (2)\\nఅయిన మన ప్రభువు తోడువుండగా - ధైర్యముతోడ సాగెదమా (2)\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"40\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"264\",\n                \"title\": \"యేసు వైపు చూచుచు\",\n                \"artist\": \"...వేదానంద్ ప్రతాప్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"265\",\n        \"local_title\": \"యేసు నీ నామమే మధురం\",\n        \"local_hint\": \"yesu ni namane\",\n        \"local_text\": \"యేసు నీ నామమే మధురం \\nపాప వినాశనం\\nశాప విమోచనమే గదా\\nయేసు నీ నామమే మధురం\\nహాల్లెలూయా - నా దేవా\\nస్తుతిగీతం - నేపాడెదన్‌\\nహాల్లెలూయా - మా దేవా\\nస్తుతియింతున్‌ - నీ నామమున్‌\\n\\n1. నామములన్నిట ఆ ఉన్నత నామం\\nజీవమునిచ్చే - సన్నుత నామం\\nప్రేమకు రూపం - శ్రీయేసు నామం\\nనీ నామమే నా - జీవనరాగం\\n\\n2. పతితుల పాలిట - వరప్రద నామం\\nఅతులిత సౌఖ్యం - బొసగెడి నామం\\nపరిశుద్ధులు ఇల - కొనియాడు నామం\\nపరమున దూతలు - పూజించు నామం\\n\\n3. అద్భుత స్వస్థత - నిచ్చెడి నామం\\nవిసృత పాపం - కడిగెడి నామం\\nప్రార్ధన ఫలముల - కారణ నామం\\nఆరాధనకే - ఆధార నామం\\n\\n4. చీకటి శక్తుల - జయించు నామం\\nలోకపు చేటును - తొలగించు నామం\\nజీవపు మార్గం - బోధించు నామం\\nపరముకు చేర్చే - పావన నామం\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"69\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"265\",\n                \"title\": \"265. యేసు నీ నామమే మధురం\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/265.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"266\",\n        \"local_title\": \"యేసూ నీతిరాజ స్తోత్రం\",\n        \"local_hint\": \"yesu nitiraja\",\n        \"local_text\": \"యేసూ నీతిరాజ స్తోత్రం - నీకే నా ఆరాధన\\nయేసూ మహిమ రాజ స్తోత్రం -నీకే నా స్తుతియాగము\\nధవళవర్ణ స్తోత్రం - రత్నవర్ణ స్తోత్రం - నా ఆరాధ్యదైవమా\\nరాజరాజా స్తోత్రం - రమ్యతేజ స్తోత్రం - నాసమీప బాంధవా\\n\\n1. నీవేగా నను కన్నావయ్యా - నీవేగా నాతండ్రివి\\nనీవేగా నను కొన్నావయ్యా - నీవేగా యజమానుడా  #ధవళవర్ణ#\\n\\n2. నీప్రాణం నాకై అర్పించితివి - నీరక్తం ప్రవహించెగా\\nనీజీవం నను నింపెనుగా - నీ శాంతి ప్రభవింపగా  #ధవళవర్ణ#\\n\\n3. నీకోసం నాహృదయ మిచ్చెదా - నీ కోసం జీవించెదా\\nనీకోసం నేనర్పించెదా - నీకోసం సమస్తము  #ధవళవర్ణ#\\n\\n4. నా ప్రియుడా - నా ప్రేమామయుడా - నా ప్రభూ ప్రేమించెదా\\nఆత్మతో ఆరాధించెదా - సత్యంతో సేవించెదా  #ధవళవర్ణ#\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"70\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"266\",\n                \"title\": \"యేసూ నీతిరాజ స్తోత్రం\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"267\",\n        \"local_title\": \"యేసూ రాజా దేవా\",\n        \"local_hint\": \"yesu raja deva\",\n        \"local_text\": \"యేసూ రాజా దేవా - నా ప్రాణ ప్రియుడా ప్రభువా\\nమహిమ ఘనత నీకే - నా జీవదాతా ప్రభువా\\nనీ చిత్తంలో నను కంటివి నీ రక్తంతో నను కొంటివి\\nఆరాధించి స్తుతియించెదను - నీ తేజంతో నే వెలిగెదను\\n\\n1. ఉదయించితివి - వెలిగించితివి - నీ వాక్య దీపం - నాకిచ్చితివి\\nనా త్రోవకు వెలుగైతివి - ఆరాధించి స్తుతియించెదను - నీ తేజంతో నే వెలిగెదను\\n\\n2. చీకటి బాప చేటును మాప - లోకంలో నీ జ్యోతిగ నను జేసితివి\\nగిరి పురములో స్థిరపరచితివి - ఆరాధించి స్తుతియించెదను - నీ తేజంతో నే వెలిగెదను\\n\\n3. చీకటి లోకం నాశన కూపం - నీ వెలుగుతో నిండుటకై ఏర్పరచితివి\\nనీ ఆత్మతో నను నింపితివి - ఆరాధించి స్తుతియించెదను - నీ తేజంతో నే వెలిగెదను\\n\\n4. ఆత్మల నిచ్చి బాధ్యత నిచ్చి - నీ భారం మోపితివి - నిను సేవింప\\nవిద్యార్ధి లోకంలో - ఆరాధించి స్తుతియించెదను - నీ తేజంతో నే వెలిగెదను\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"71\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"267\",\n                \"title\": \"యేసూ రాజా దేవా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"268\",\n        \"local_title\": \"రమ్మనుచున్నాడేసు ప్రభు\",\n        \"local_hint\": \"Rammanucunnadesu\",\n        \"local_text\": \"రమ్మనుచున్నాడేసు ప్రభు - రయమున రారండీ\\nపిలుచుచున్నాడు ప్రియమార - ముదమున రారండి\\n\\n1. ప్రయాస భారము మోసి - పరితాపమొందు వారికి\\nయేసే ప్రశాంతి మూలం - యేసే చిరజీవనం\\n\\n2. నీతి పరిశుద్ధుతకై - దాహము గొన్నవారికి\\nజీవజలముతానై - ఆత్మానందమిచ్చును\\n\\n3. భయంకర పాపము నందు - భ్రమతో నిలిచెదవా\\nపాపము విడిచి యేసు - శాంతినే మది కోరవా\\n\\n4. అనుకూల సమయమునందు - నీ మొర నాలకించును\\nరక్షణ దినమిదియే - తక్షణం ప్రార్ధించుము\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"29\",\n        \"index_letter\": \"ర\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"268\",\n                \"title\": \"రమ్మనుచున్నాడేసు ప్రభు\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"269\",\n        \"local_title\": \"రాజుల రాజా, దేవదేవుడా\",\n        \"local_hint\": \"rajula raja\",\n        \"local_text\": \"రాజుల రాజా, దేవదేవుడా\\nరాజసముతో నెడే ఠీవిగ వెలసితివి\\n\\n1. తార ఉదయించె నీకిల‌ గుర్తుగా\\nనేరుగ చేరిరి జ్ఞానులు నిన్నె పూజించుట కపుడు\\n\\n2. బంగరు బోళమును, సాంబ్రాణి బహుమతులు\\nముంగిట నీకే సమర్పించిరి, సంతసమొందిరి అధికముగా\\n\\n3. ప్రకాశమానుడవు వికసించితి విలలో\\nనీకే మహిమ, ఘనతయును ఆరోపించెదం మా ప్రభువా\",\n        \"local_category\": [\n            \"christmas\"\n        ],\n        \"local_categorycount\": \"6\",\n        \"index_letter\": \"ర\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"269\",\n                \"title\": \"రాజుల రాజా, దేవదేవుడా\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"270\",\n        \"local_title\": \"లెక్కించలేని స్తోత్రముల్\",\n        \"local_hint\": \"Lekkinchaleni Sthothramul\",\n        \"local_text\": \"లెక్కించలేని స్తోత్రముల్ - దేవ ఎల్లప్పుడు నేపాడెదన్ \\nఇంతవరకు నా బ్రతుకులో - నీవు చేసిన మేళ్ళకై\\n\\n1. ఆకాశ మహాకాశముల్ - దాని క్రిందున్న ఆకాశము \\nభూమిలో కనబడునవన్నీ - ప్రభువా నిన్నే కీర్తించున్\\n\\n2. అడవిలో నివసించునవన్నీ - సుడిగాలియు మంచును \\nభూమిపై నున్న వన్నీ - దేవా నిన్నే పొగడును\\n\\n3. నీటిలో నివసించు ప్రాణుల్ - ఈ భువిలోని జీవరాసులు \\nఆకాశమున ఎగురునవన్నీ - ప్రభువా నిన్నే కీర్తించున్\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"72\",\n        \"index_letter\": \"ల\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"270\",\n                \"title\": \"270. లెక్కించలేని స్తోత్రముల్\",\n                \"artist\": \"...రెవ.టి.డి.మాథ్యూస్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/270.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"271\",\n        \"local_title\": \"లోకమునకు ఉప్పు\",\n        \"local_hint\": \"Lokamunaku\",\n        \"local_text\": \"లోకమునకు ఉప్పు - లోకమునకు వెలుగు\\nఈ లోకంలో ఉంచెను మనను - యేసు ఉంచెను\\n\\n1. మనుష్యుల ఎదుట మన వెలుగును ప్రకాశింప జేసి\\nమన తండ్రిని మహిమ పరిచి - సత్క్రియలను చూపుదాం\\n\\n2. సమాధానముతో యుండెదం మనమందరము\\nమంచితనము నీతి సత్యము - కనబడ జేయుదుము\\n\\n3. ఉప్పు సారము అగ్ని వలన కలుగును ప్రతి వానికి\\nమన సంభాషణ ఎల్లప్పుడునూ - రుచిగా నుంచుదాం\\n\\n4. నిష్ఫలమైన చీకటి క్రియలలో పాలు పొందక ఖండించెదం\\nప్రభువుకు ఏది ప్రీతికరమో దానిని చేపట్టెదం\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"43\",\n        \"index_letter\": \"ల\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"271\",\n                \"title\": \"లోకమునకు ఉప్పు\",\n                \"artist\": \"...డి.సుందరదాసు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"272\",\n        \"local_title\": \"లోకాలనేలే రక్షకుడు\",\n        \"local_hint\": \"Lokalanele\",\n        \"local_text\": \"లోకాలనేలే రక్షకుడు జన్మించె ఈనాడే\\nభువిపైన పాపుల బ్రోచుటకై మనుజావతారుండై\\nమనలను కావను దైవసుతుడే యేసుడై\\n\\n WE WISH YOU A MERRY CHRISTMAS \\n HAPPY CHRISTMAS MERRY CHRISTMAS \\n\\n1.గొల్లలు ఆ జ్ఞానుల్‌ విలువైన కాన్మలనొసగి\\nభక్తితో ప్రణమిల్లిరి ప్రభుయేసు పాదములన్‌\\nకాన్మగా నీ హృదయమున్‌ మన ప్రభునకే అర్పించవా\\n\\nWE WISH YOU A MERRY CHRISTMAS \\nHAPPY CHRISTMAS MERRY CHRISTMAS\\n\\n2. లోకమునకు వెలుగై పాపాంధకారము బాపి\\nపాపి హృదయములోన వెలుగు నింపిన ప్రభుని\\nప్రమతోడ హృదయమున్‌ మన\\nప్రభునకే అర్పించవా\\n\\nWE WISH YOU A MERRY CHRISTMAS \\nHAPPY CHRISTMAS MERRY CHRISTMAS\",\n        \"local_category\": [\n            \"christmas\"\n        ],\n        \"local_categorycount\": \"7\",\n        \"index_letter\": \"ల\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"272\",\n                \"title\": \"272. లోకాలనేలే రక్షకుడు\",\n                \"artist\": \"...డా.వై.బాబ్జి\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/272.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"273\",\n        \"local_title\": \"వాక్యంబే దీపము\",\n        \"local_hint\": \"Vakyambe\",\n        \"local_text\": \"వాక్యంబే దీపము - వాక్యంబే దీపము - నీ వాక్యమే నా యౌవన పాదాల దీపము!\\n\\n1.నీ ధర్మశాస్త్రంబు సంతోషము - లేకున్న శ్రమలందు నశియింతును\\nనీ యాజ్ఞలన్నియు నమ్మదగినవిగా - నా జీవిత సర్వస్వము నీ వాక్యమే\\n\\n2. రాత్రి జాములయందు - మేల్కొందును\\nనీ దివ్య వాక్యంబు - ధ్యానింతును\\nనీ దివ్య వాక్యంబు - నన్ను బ్రతికించె\\nనా బాధలో-నా నెమ్మది నీ వాక్యమే\\n\\n3. నాకెంతో ప్రియమైన నీ వాక్యము\\nదినమెల్ల నాతోడు నీ వాక్యమే\\nనాకున్న జ్ఞానంబు నీ వాక్యమేగా\\nధ్యానింతును బోధింతును నీ వాక్యమే\\n\\n4. జుంటి తేనెల ధార\\nనీ వాక్యమే నాకెంతో మధురంబు\\nనీ వాక్యమే - ఎంతో నెమ్మదినిచ్చు\\nనీ వాక్యమేగా - సంతోషమే సమాధానమే - నీ వాక్యమే\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"41\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"273\",\n                \"title\": \"273. వాక్యంబే దీపము\",\n                \"artist\": \"...పీటర్ సింగ్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/273.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"274\",\n        \"local_title\": \"వాక్యము కొరకై\",\n        \"local_hint\": \"vakyamu koraki\",\n        \"local_text\": \"వాక్యము కొరకై నే ఆశకలిగి నీ సన్నిధిలో కనిపెట్టెదన్‌\\nధ్యానించెదన్‌ అనుసరించెదన్‌ నే ప్రకటించి నేర్పించెదన్\\nప్రకటించి జీవించెదన్‌\\nప్రార్ధించి పనిచేసెదన్‌ దేవా నీ కొరకై కొనసాగెదన్‌\\nఫలియించి నేర్పించెదన్‌ ప్రభువా ప్రకటించి జీవించెదన్\\n\\n1. మొదటి ప్రేమను మరువక నేను నీ కొరకై జీవించెదన్‌\\nనశియిస్తున్న విద్యార్దుల కొరకై కష్టించి సేవచేసెదన్‌ #ప్రార్ధించి#\\n\\n2. భేదములను మరచి ఆత్మీయ స్థితినెరిగి నీ పనికై పరుగెత్తెదన్‌\\nభారంబు కలిగి లోపంబు నెరిగి ఆత్మలకై పోరాడెదన్‌  #ప్రార్ధించి#\\n\\n3. సొంతపనులతో సంతసించక శ్రద్ధకలిగి పనిచెసెదన్\\nఒకరినొకరం మెచ్చుకొనుచు నీ పనిలో ముందుకు సాగెదం‌  #ప్రార్ధించి#\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"42\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"274\",\n                \"title\": \"వాక్యము కొరకై\",\n                \"artist\": \"...సిహెచ్. శ్యామ్ పాల్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"275\",\n        \"local_title\": \"వాక్యమే శరీరధారియై వశించెను\",\n        \"local_hint\": \"Vakyame sariradhariyai\",\n        \"local_text\": \"వాక్యమే శరీరధారియై వశించెను\\nజీవమై శరీరులను వెలిగింపను …ఆ ..ఆ..ఆ..\\n\\n1. కృపయు సత్యములు -హల్లెలూయ\\nనీతి నిమ్మళము – హల్లెలూయ     (2)\\nకలసి మెలసి -భువిలో దివిలో       (2)\\nఇలలో సత్యము మొలకై నిలిచెను\\n\\n2.ఆశ్చర్యకరుడు – హల్లెలూయ\\nఆలోచనకర్త – హల్లెలూయ\\nనిత్యుడైన -తండ్రి దేవుడు\\nనీతిసూర్యుడు -భువి నుదయుంచెను\\n\\n3. పరమ దేవుండే-హల్లెలూయ\\nనరులలో నరుడై -హల్లెలూయ\\nకరము చాచి -కనికరించి\\nమరు జన్మములో -మనుజుల మలచే\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"73\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"275\",\n                \"title\": \"వాక్యమే శరీరధారియై వశించెను\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"276\",\n        \"local_title\": \"విద్యార్థి - ఓ విద్యార్థి\",\n        \"local_hint\": \"Vidyarthi o Vidyarthi\",\n        \"local_text\": \"విద్యార్థి - ఓ విద్యార్థి వ్యర్థంగా గడపకు - నీ జీవితం\\nఅర్ధవంతంగా జీవించు నీవు అద్భుతకరుడేసుని అంగీకరించు\\n\\n1. గురి లేక నీవు పరుగెత్తకు సరిగా చూసుకో నీ గమ్యమేదో (2)\\nమార్గంబుగా క్రిస్తు అరుదెంచెను పరలోక గమ్యము నిను చేర్చగా(2)\\n\\n2. విజయానికి మూలం విశ్వాసము విశ్వాసకర్త క్రీస్తేసుడు\\nవిశ్వసించుమా శ్రీయేసుని విశ్వాన్ని నీవు జయించెదవు\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"30\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"276\",\n                \"title\": \"విద్యార్థి - ఓ విద్యార్థి\",\n                \"artist\": \"...కె.విల్సన్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"277\",\n        \"local_title\": \"విద్యార్ధి నాయకుడా\",\n        \"local_hint\": \"Vidyarthi nayakuda\",\n        \"local_text\": \"విద్యార్ధి నాయకుడా విమలాత్మ సేవకుడా\\nసద్ధర్మ వారసుడా - సందేశ పాలకుడా\\n\\n1. లోతైన ఆత్మీయత - ప్రభు యేసుతో ఐక్యత\\nఆత్మీయ పోరాటమే - ప్రభు యేసులో జయమే\\n\\n2. అడుగు పెట్టి నీవడుగుము - కళాశాలల్‌ కదిలించుము\\nజడియకు బలమొందుము - పరిశుద్ధ ప్రభు సన్నిధిలో \\n\\n3. జయశాలివై నిలువుము - నిబ్బరముగా నుండుము\\nప్రభువే నీతోడుగా - ప్రభువే నీ జయముగా\\n\\n4. వాక్యంబు ధ్యానించుము - బోధించి నెరవేర్చుము\\nవర్ధిల్లెదవు నిత్యము - చక్కగా చరియింతువు\",\n        \"local_category\": [\n            \"ltcamp\"\n        ],\n        \"local_categorycount\": \"54\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"277\",\n                \"title\": \"277. విద్యార్ధి నాయకుడా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/277.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"278\",\n        \"local_title\": \"విరిసిన సుమమై పరిమళ\",\n        \"local_hint\": \"virisina\",\n        \"local_text\": \"విరిసిన సుమమై పరిమళ మొదవె - విరిగిన హృదియే విలసించే\\nమరణబలున్‌ గూల్చి మమున్‌\\nపరమున కెత్తెను హల్లెలూయా\\n\\n1. పాపాల కౌగిలిలో - పతనాలేమొ సుడులై\\nపాతాళమునకీడ్వ - ప్రభువే బ్రోచెను\\n\\n2. ఈ మర్త్యదేహములే - యేసుని మూర్తిమయమై\\nఇలలో మహిత దివిలో - ఎదలో గొలువగా\\n\\n3. ఓహో ! మరణజలధీ - ఓహోహో ! సమాధి\\nఏదీ జయము మీకు ! యేసే విజయుడు\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"74\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"278\",\n                \"title\": \"278. విరిసిన సుమమై పరిమళ\",\n                \"artist\": \"...కె.వి.వసురాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/278.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"279\",\n        \"local_title\": \"వెంబడింతును సదా\",\n        \"local_hint\": \"Vembadintunu\",\n        \"local_text\": \"వెంబడింతును సదా యేసుని \\nవందితుండు యేసుబోలి జీవింతును\\nయేసునాధుడే నాదు జీవము\\nసేవజేతు నేసు మనసుతోడ నెల్లడన్‌\\nసిలువే విలువైన జీవమార్గము\\nమోయుదన్‌ చేరుదున్‌ మోక్షరాజ్యము\\n\\n1. విడిచి వచ్చెను దివ్య మహిమను - దాసుని పోలియుందెను\\nసిలువ మరణము పొందునంతగా - వినయముతో నిండెను\\nయేసు మాదిరి అనుసరింతును - యేసు ప్రేమనే అనుకరింతును\\n\\n2. ప్రియ యేసు ప్రేమించెను - మహిమ సువాసనాయెను\\nఅర్పణముగా బలియాగమై - అప్పుగించుకొనె నా ప్రభు\\nయేసు బోలిన పౌలు రీతినే - స్వప్రయోజనం విస్మరింతును\\n\\n3. తండ్రి చిత్తము నెరవేర్చెను - తండ్రిని ఘనపరచెను\\nనిత్య రాజ్యము మనకిచ్చిను - నిత్యము ప్రేమించును ఆత్మబాటలో\\nఆలకించెదన్‌ వెలుగు బాటలో - వెంబడించెదన్\",\n        \"local_category\": [\n            \"dtcamp\"\n        ],\n        \"local_categorycount\": \"44\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"279\",\n                \"title\": \"వెంబడింతును సదా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"280\",\n        \"local_title\": \"వేకువనే ప్రియుడా\",\n        \"local_hint\": \"Vekuvane\",\n        \"local_text\": \"వేకువనే ప్రియుడా హృదయ వీణపై\\nపాడెదనె ఉదయగీతికై\\nనా ప్రభుడ నీవని నన్ను కాయువాడని\\nనీకై నే స్తుతులు పాడెద\\n\\n1. పాపినైన నాకై నీ సిలువయాగ రుధిరం\\nజీవమై నన్ను జీవింపచేసె (2)\\nగమ్యం లేని నా జీవితానికి\\nవెలుగై మార్గం చూపి\\nనడిపించిన జీవనదాత\\n\\n2. ప్రేమసుధలు కురిసె నీ మధుర నామ స్మరణం\\nగానమై నన్ను రంజింపజేసె\\nఆపదలందు కేడెమై నిలచి\\nభీతిని బాపిన దేవా\\nఎల్లవేళలా నా చాలిన దేవా\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"75\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"280\",\n                \"title\": \"వేకువనే ప్రియుడా\",\n                \"artist\": \"...పి.జె.కాల్విన్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"281\",\n        \"local_title\": \"శాంతి శాంతి శాంతిరా\",\n        \"local_hint\": \"santi\",\n        \"local_text\": \"శాంతి శాంతి శాంతిరా - శాంతెక్కడ దొరుకునురా\\nకాలేజీలో లేదురా - క్యాంపస్‌లో లేదురా\\nఇంట్లోను లేదురా - వంట్లోను లేదురా\\nశాంతెక్కడ దొరుకును రా....... మనశ్శాంతి రా\\n\\n1. సినిమాలు చూస్తున్నా పనిపాటలు చేస్తున\\nనెట్‌ వర్కు చూస్తున్నా నట్‌గానే మిగిలావేరా\\n\\n2. ర్యాంకులెన్ని సాధించినా బ్యాంక్‌ నిండ ఎంతున్నా\\nబంకులెన్ని తిరిగినగాని ఫంకు బతుకు మారలేదురా\\n\\n3. కండబలం ఎంతున్నా బొండాంలా మారినగాని\\nతిండి ఎంత తిన్నాగాని దండగమారి బ్రతుకేగదరా\\n\\n4. యవ్వనంపు ఉద్రేకంలో లవ్‌మ్యారేజ్‌ అయినా గాని\\nకొవ్వంతా కరిగిపోయే నవ్వులాట బ్రతుకేగదరా\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"31\",\n        \"index_letter\": \"శ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"281\",\n                \"title\": \"281. శాంతి శాంతి శాంతిరా\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/281.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"282\",\n        \"local_title\": \"శాశ్వతమైన ప్రేమతో\",\n        \"local_hint\": \"sasvatamaina\",\n        \"local_text\": \"శాశ్వతమైన ప్రేమతో ప్రేమించుచున్నావు\\nవిడువక నా యెడ కృప చూపుచున్నావు (2)\\n\\n1. యుద్దజ్వాలలు ప్రజ్వరిల్లినను - సాతాను చెలరేగి లేచినను\\nవిడువక నా యెడ కృప చూపుచున్నావు(2)\\nప్రేమా ప్రేమా ప్రేమా ప్రేమా ప్రేమా ప్రేమా\\n\\n2. లోకమంతయు మార్పు చెందినను - మిత్రువులే శత్రువులై లేచినను\\nవిడువక నాయెడల - కృప చూపుచున్నావు - ప్రేమా...\\n\\n3. కష్టనష్ట శ్రమ శోధనలు - భయపెట్టి బాధింప చూచినను\\nవిడువక నా యెడల కృప - చూపుచున్నావు - ప్రేమా...\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"43\",\n        \"index_letter\": \"శ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"282\",\n                \"title\": \"శాశ్వతమైన ప్రేమతో\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"283\",\n        \"local_title\": \"శ్రీయేసుతో ఒక చిన్నమాట\",\n        \"local_hint\": \"sriyesuto\",\n        \"local_text\": \"శ్రీయేసుతో ఒక చిన్నమాట చిక్కులు దీర్చును ఉన్నమాట\\nనీ ఆశలన్నియు నెరవేరున్‌ అక్కర దీర్చును యేసుబాట\\n\\n1. నిరాశపడకు నిస్పృహవలదు పరాకు మాని ప్రార్ధించుము\\nపరమ ప్రభూ కరుణించును నిరంతర కృపచే బలమొందుము\\n\\n2. విడువక వేడి విసుగును మాని అదిగిన వారికి దొరుకునుగా\\nకడుదయతో కనికరించున్‌ తదడబడ వద్దిక స్థిరపడుము\\n\\n3. రొట్టెనడిగితే రాతినివ్వడు తట్టిన వారికి తెరచునుగా\\nపట్టుగ నీవు ప్రార్ధించగా దట్టముగా కృప ఆవరించుగా\",\n        \"local_category\": [\n            \"prayer\"\n        ],\n        \"local_categorycount\": \"9\",\n        \"index_letter\": \"శ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"283\",\n                \"title\": \"శ్రీయేసుతో ఒక చిన్నమాట\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"284\",\n        \"local_title\": \"షారోను పువ్వు\",\n        \"local_hint\": \"saronu\",\n        \"local_text\": \"షారోను పువ్వు సౌరభ మీవు - సౌమ్యువతియనె నా ప్రభువు\\nప్రాణప్రియా కాంతిమయా - ప్రణమామి ప్రభో హల్లెలూయా\\n\\n1. పాపపంకిలమైన మదిలో - శాపభారపుటుచ్చువలలో\\nఆపదలో కుమిలిన నాలో - ఆదివ్యధ వ్యాధి వృధా\\nబాధలు మాపెను బోధసుధా\\n\\n2. ప్రేవ ధ్వజమును కేలదనరి - పేటు బీటలలోన యెగిరె\\nప్రేమ మయా పావురమా యని - నా ప్రియుని స్వర మిదిగో\\nనా రక్షణ శిఖరాలివిగో\\n\\n3. రక్తమోడ్చెను పాపమోడ్చె  - రక్తసిక్తపు తనువు పూడ్చె\\nముక్తి సుధానిధి ప్రవహించె - శోధనలో వేదనలో\\nనాధుని సేవామృత మొలికె\\n\\n4. దాపు జేర్చెను పాపినైన - ప్రాపు గూర్చను ద్రోహినైన\\nపాప మరణ నియమము బాపె - ఆత్మ ప్రభు గురియించె\\nఆత్మ నియమమున రక్షించె\",\n        \"local_category\": [\n            \"praise\"\n        ],\n        \"local_categorycount\": \"76\",\n        \"index_letter\": \"ష\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"284\",\n                \"title\": \"షారోను పువ్వు\",\n                \"artist\": \"...కె.వి.వసురాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"285\",\n        \"local_title\": \"సంఘమా - క్రైస్తవ\",\n        \"local_hint\": \"Sanghama\",\n        \"local_text\": \"సంఘమా - క్రైస్తవ సంఘమా క్రీస్తేసుని ప్రియ జనాంగమా\\nసార్వత్రిక సంఘ రూపమా సజీవయాత్మ మందిరమా\\nజయభేరి మ్రోగించు - జయ శాలి యేసేయని\\nమారుచున్న సమాజంలో - యేసెన్నడు మారడని\\n\\n1. నిన్న నేడు మారని యేసు - ఎన్నడైనను మారని దేవుడు\\nకొన్నాడు నిన్ను తన రక్తంతో - ఉన్నాడు నీతో సదాకాలం\\n\\n2. కుళ్ళిపోయిన సమాజంలో - నీ సారమును విడనాడకు\\nనిజమైన ఉప్పు నీవే యని - క్రైస్తవ విలువలు మరువకుమా\\n\\n3. మతము కాదది మార్గమని - మతాలన్నీ ఒకటే కాదని\\nమరణము గెలిచి లేచిన యేసే - నరులకు రక్షణ మార్గమని\",\n        \"local_category\": [\n            \"nothing\"\n        ],\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"స\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"285\",\n                \"title\": \"సంఘమా - క్రైస్తవ\",\n                \"artist\": \"...జి.నిరీక్షణ్ రావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"286\",\n        \"local_title\": \"సత్యవాక్యమును సరిగా\",\n        \"local_hint\": \"Satyavakyamunu\",\n        \"local_text\": \"సత్యవాక్యమును సరిగా బోధించగా (2)\\nనిత్యదేవుడా నీ కృప నిమ్మయ్యా\\n\\n1. యాకోబుకు వాక్యమున్‌ తెలియ జేసితివి (2)\\nనాకై చీల్చబడిన దైవమా\\nనీ కృప చేత నీ వాక్యమున్‌ నాకును తెలుపుము\\n\\n2. వాక్యమై యున్నట్టి నాదు యేసయ్యా\\nఐక్యపరచుకొంటివి నరునిగా (2)\\n సఖ్యత తోడ నీ ప్రేమను నేను తెలియజేతును\\n\\n3. సిగ్గుపడని పనివానిగా నన్ను చేయుము (2)\\nయోగ్యమైన వానిగా నీ యెదుట\\nఅగుపడుటకు పనిచేయుటకున్‌ నన్ను సిద్ధపరచుము\",\n        \"local_category\": [\n            \"spiritual\"\n        ],\n        \"local_categorycount\": \"44\",\n        \"index_letter\": \"స\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"286\",\n                \"title\": \"సత్యవాక్యమును సరిగా\",\n                \"artist\": \"...\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"287\",\n        \"local_title\": \"సంతోషమే నీకు కావాలా\",\n        \"local_hint\": \"Santosame niku\",\n        \"local_text\": \"సంతోషమే నీకు కావాలా ఎంతైనా నమయం వృధా చేస్తావా?\\nసంతోషమే నీకు కావాలా ఎంతైనా డబ్బు వృధా చేస్తావా?\\n\\n1. సంతసమంటే సినిమా షికార్లు కాదు\\nసంతసమంటే పాన్‌పరాగ్‌ కిల్లీ కాదు\\nసంతసమంటే.... గర్ల్ ఫ్రెండ్స్ అసలే కాదు (2) గర్ల్ ఫ్రెండ్స్ అసలే కాదు\\n\\n2. సంతసమంటే ఆట పాట కాదు\\nసంతసమంటే సిగెరెట్‌ సిల్లీ జోక్స్‌ కాదు\\nసంతసమంటే... పాప్‌ మ్యూజిక్‌ కాదు\\n\\n3. సంతసమంటే జీవితార్థం గ్రహించుట\\nసంతసమంటే సృష్టికర్తను ఎరుగుట\\nసంతసమంటే... యేసుని కలిగియుండుట\\nసంతోషమే నీకు కావాలా రక్షకుడేసుని చేరు ఓ సోదరా\\nసంతోషమే నీకు కావాలా రక్షకుడేసుని చేరు ఓ సోదరీ\\nరక్షకుడేసుని చేరు ఓ సోదరా రక్షకుడేసుని చేరు ఓ సోదరీ\",\n        \"local_category\": [\n            \"evangelism\",\n            \"ecamp\"\n        ],\n        \"local_categorycount\": \"32\",\n        \"index_letter\": \"స\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"287\",\n                \"title\": \"287. సంతోషమే నీకు కావాలా\",\n                \"artist\": \"...కె.జె.యస్.బాబురావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/telugu/songs/287.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"288\",\n        \"local_title\": \"సంతోషమే సంతోషమే\",\n        \"local_hint\": \"Santosame Santosame\",\n        \"local_text\": \"సంతోషమే సంతోషమే నాకు కావాలి\\nఆనందమే ఆనందమే నేను పొందాలి\\nహృదిలోన సంతోషం కలగాలని\\nమదిలోన ఆనందం నిలవాలనే\\nఆశ నెరవేరునా? నా కలలు ఫలియించునా?\\n\\n1. మిత్రులందరి నడిగాను సంతోషం నాకు కావాలని\\nచిత్రములలో వెదికాను ఆనందం నేను పొందాలని\\nఎచట వెదకిన లేదాయే కనుల నిద్దుర కరువాయే\\n\\n2. బంధువులనే చేరాను సంతోషం నాకు రావాలని\\nఅన్నదమ్ముల కోరాను ఆనందం నాకు చూపాలని\\nఎవరినడిగినా చూపరే ఎంత కోరినా చెప్పరే\\n\\n3. ఇంటర్నెట్‌కూ వెళ్తాను ఎంతో ఎంజాయ్‌ చేయాలని\\nఛాటింగూ ట్రై చేశాను ఎంతో ఛీటింగ్‌ అయ