"local_text\": \"Crown him with many Crowns\\nThe Lamb upon His throne;\\nHark, how the heavenly anthem drowns\\nAll music but its own!\\nAwake,my soul, and sing\\nOf Him who died for Thee,\\nAnd hail Him as thy matchless King\\nThrough all eternity.\\n\\n2. Crown Him the Lord of life,\\nWho triumphed O’er the grave\\nAnd rose victorious in the strife\\nFor those He came to save:\\nHis glories now we sing,\\nWho died and rose on high,\\nWho died eternal life to bring\\nAnd lives that death may die.\\n\\n3. Crown Him the Lord of love;\\nBehold His hands and side,\\nThose wounds yet visible above\\nIn beauty glorified;\\nNo angel in the sky\\nCan fully bear that sight,\\nBut downward bends His buming eye\\nAt mysteries so bright.\\n\\n4. Crown Him the Lord of peace,\\nWhose power a sceptre sways\\nFrom pole to pole that wars may cease,\\nAnd all be prayer and praise:\\nHis reign shall know no end,\\nAnd round His pierced feet\\nFair flowers of paradise extend\\nTheir fragrance ever sweet.\\n\\n5. Crown Him the Lord of years,\\nThe Potentate of time,\\nCreator of the rolling spheres,\\nIneffably sublime;\\nAll hail, Redeemer, hail\\nFor Thou hast died for me;\\nThy praise shall never, never fail\\nThroughout eternity.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"C\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"39\",\n                \"title\": \"39. Crown him with many Crowns\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/english/songs/39.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"40\",\n        \"local_title\": \"Don\'t you know, O Christian\",\n        \"local_hint\": \"Don\'t you know, O Christian\",\n        \"local_text\": \"1. Don\'t you know, O Christian,\\nYou\'ve been born anew,\\nBy the blood of the Lord\\nShed on the rugged cross ?\\nDo you know that the Lord\\nHas set you free from sin\\nThat you go pressing on\\nThe crown and kingdom win?\\nSo let\'s keep pressing on.\\nPressing on till we reach.\\nheaven\'s goal Marching on,\\nIn Hts Narme ...\\nFor the Lord holds us on\\nTill we enter His rest\\n\\n2. Though the pressures around\\nCast darkness our way\\nThough we falter and fail\\nand griefs may prevail\\nChrist the Lord bids us on,\\nWashing our sins away\\nSo past we leave behind\\nand onward we move on\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"D\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"40\",\n                \"title\": \"40. Don\'t you know, O Christian\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/english/songs/40.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"41\",\n        \"local_title\": \"Down the mountain\",\n        \"local_hint\": \"Down the mountain\",\n        \"local_text\": \"Down the mountain\\nthe river flows,\\nAnd it brings refreshing\\nwherever it goes;\\nThrough the valleys\\nand over the fields,\\nThe river is rushing\\nand the river is here.\\nThe river of God\\nsets our feet a-dancing,\\nThe river of God\\nfills our hearts with cheer;\\nThe river of God\\nfills our mouths with laughter\\nAnd we rejoice\\nfor the river is here.\\nThe river of God is teeming with life,\\nAnd all who touch it can be re-vived;\\nAnd those who linger on this river\'s shore,\\nWill come back thirsting\\nfor more of the Lord.\\n\\nUp to the mountain we love to go,\\nTo find the presence of the Lord;\\nAlong the banks of the river we run,\\nWe dance with laughter\\ngiving praise to the Son.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"D\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"41\",\n                \"title\": \"41. Down the mountain\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/english/songs/41.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"42\",\n        \"local_title\": \"Everybody likes to take a holiday\",\n        \"local_hint\": \"Everybody likes to take a holiday\",\n        \"local_text\": \"Everybody likes to take a holiday\\nEverybody likes to take a rest\\nSpending time together with the family\\nSharing lots of love and happiness\\nCome on ring those bells\\nlight the Christmas tree\\nJesus is the King born for you and me\\nCome on ring those bells\\neverybody say\\nJesus we remember this Your birthday\\nCelebrations come because of\\nsomething good\\nCelebrations we love to recall\\nMary had a baby boy in Bethlehem\\nGreatest celebration of them all\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"E\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"43\",\n        \"local_title\": \"Every Breath that I take\",\n        \"local_hint\": \"Every Breath that I take\",\n        \"local_text\": \"1. Every Breath that I take\\nsays I love You,\\nAnd every, beat of my heart\\nSays I\'m Yours\\nEvery step that I take says I need You\\nAnd I will bless Your holy Name\\nYou are my Redeem