ains that had bound me\\nI found a love, I found a love\\nI found a love I can be sure of (4)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"I\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"100\",\n        \"local_title\": \"I have decided to follow Jesus\",\n        \"local_hint\": \"I have decided to follow Jesus\",\n        \"local_text\": \"1. I have decided to follow Jesus\\nI have decided to follow Jesus\\nI have decided to follow Jesus\\nNo turning back, no turning back.\\n\\n2. Though all may leave me Still I will follow (3)\\nNo turning back,no turning back,\\n\\n3. The Cross before me The world behind me (3)\\nNo turning back,No turning back.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"I\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"101\",\n        \"local_title\": \"I have found a friend in Jesus!\",\n        \"local_hint\": \"I have found a friend in Jesus!\",\n        \"local_text\": \"1. I have found a friend in Jesus!\\nHe\'s everything to me!\\nHe\'s the fairest of ten thousand to my soul\\nThe Lily of the Valley\\nIn Him alone I see\\nAll I need to cleanse\\nand make me fully whole,\\nIn sorrow He\'s my comfort;\\nIn trouble He\'s my stay,\\nHe tells me ev\'ry care\\non Him to roll\\n\\nCHORUS:\\nHe\'s the Lily of the Valley\\nThe bright and Morning Star\\nHe\'s the Fairest of Ten Thousand to my soul.\\n\\n2. He all my griefs has taken\\nand all my sorrows borne\\nIn temptation He\'s my strong and mighty Tower\\nI\'ve all for Him forsaken,\\nI\'ve all my idols torn\\nFrom my heart and now He\\nkeeps me by His power\\nThough all the world forsake me,\\nand Satan tempts me sore,\\nThrough Jesus I shall safely\\nreach the goal\\nHe\'s the Lily of the Valley\\n\\n3. He\'ll never, never leave me,\\nnor yet forsake me here,\\nWhile I live by faith, and do\\nHis blessed will,\\nA wall of fire about me,\\nI\'ve nothing now to fear !\\nWith His manna, he, my hungry\\nsoul shall fill,\\nThen sweeping up to glory,\\nto see His blessed face\\nWhere rivers of delight shall ever roll.\\nHe\'s the Lily of the Valley\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"I\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"102\",\n        \"local_title\": \"I Just want to be where You are\",\n        \"local_hint\": \"I Just want to be where You are\",\n        \"local_text\": \"I Just want to be where You are\\nDwelling daily in Your presence\\nI don’t want to worship from afar\\nDraw me near to where You are\\nI just want to be where You are\\nIn Your dwelling place forever\\nTake me to the place where You are\\nI just want to be with You\\nI want to be where You are\\nDwelling in Your presence\\nFeasting at Your table\\nSurrounded by Your glory\\nIn Your presence thatS where I\\nalways want to be\\nI just want to be\\nI just want to be with You\\nI just want to be where You are\\nTo enter boldly in Your presence\