va\",\n        \"local_hint\": \"Mambo Sava Sava\",\n        \"local_text\": \"Mambo Sava Sava\\nMambo Sava Sava\\nYeshuva keva injani\\nMambo Sava Sava\\nMambo Sava Sava\\nMambo Sava Sava\\nThings are getting better (2)\\nWhen the Lord is on the throne\\nThings are getting better (3)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"174\",\n        \"local_title\": \"May the fragrance of Jesus\",\n        \"local_hint\": \"May the fragrance of Jesus\",\n        \"local_text\": \"1. May the fragrance of Jesus\\nfill this place (3 times)\\nRising from the sacrifice\\nOf lives laid down in adora tion.\\n\\n2. May the glory of Jesus fill His church (3 echo)\\nRadiant glory of Jesus (ladies)\\nShining from our faces\\nAs we gaze in adoration.\\n\\n3. May the beauty of Jesus,\\nfill my life (3 echo)\\nPerfect beauty of Jesus (ladies)\\nFill my thoughts my words my deeds\\nMy all I give in adoration.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"175\",\n        \"local_title\": \"Meekness and majesty\",\n        \"local_hint\": \"Meekness and majesty\",\n        \"local_text\": \"1. Meekness and majesty\\nManhood and deity\\nIn perfect harmony\\nThe man who is God.\\nLord of eternity\\nDwells in humanity\\nKneels in humility\\nAnd washes our feet\\n\\nCHORUS :\\nO what a mystery,\\nMeekness and majesty,\\nBow down and worship\\nFor this is your God,\\nthis is your God.\\n\\n2. Father\'s pure radiance,\\nPerfect in innocence,\\nYet learns obedience\\nTo death on a cross\\nSuffering to give us life\\nConquering through sacrifice\\nAnd as they crucify\\nPrays: Father forgive.\\n\\n3. Wisdom unsearchable,\\nGod the invisible,\\nLove indestructable\\nIn frailty appears\\nLord of inifinity.\\nStooping so tenderly.\\nLifts our humanity\\nTo the heights of His throne.\\n(End with this is our God (3)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"176\",\n        \"local_title\": \"Men of faith, rise up and sing\",\n        \"local_hint\": \"Men of faith, rise up and sing\",\n        \"local_text\": \"1. Men of faith, rise up and sing\\nOf the great and glorious King.\\nYou are strong when you feel weak;\\nIn Your broke-ness, complete.\\n\\nCHORUS:\\nShout to the north and the south;\\nSing to the east and the west.\\nJe-sus is Savior to all,\\nLord of heaven and earth.\\n\\n2. Rise up women of the truth;\\nStand and sing to broken hearts.\\nWho can know the healing power\\nOf our awesome King of love?\\n\\nCHORUS:\\nShout to the north and the south;\\nSing to the east and the west.\\nJe-sus is Savior to all,\\nLord of heaven and earth.\\nBRIDGE:\\nWe\'ve been through fire,\\nwe\'ve been through rain,\\nWe\'ve been refined by the\\npower of Your name.\\nWe\'ve fallen deeper in love with You;\\nYou\'ve bumed the truth on our lips!\\n\\nCHORUS:\\nShout to the north and the south;\\nSing to the east and the west.\\n\\nJe-sus is Savior to all,\\nLord of heaven and earth.\\n\\n3. Rise up church, with broken wings;\\nFill this place with songs a-gain,\\nOf our God Who reigns on high.\\nBy His grace, a-gain we\'ll fly.\\n\\nCHORUS 2x:\\nShout to the north and the south;\\nSing to the east and the\\nJe-sus is Savior to all,\\nLord of heaven and earth.\\nShout to the north and the south;\\nSing to the east and the west.\\nJe-sus is Savior to all,\\nLord of heaven and earth.\\nLord of heaven and earth,\\nLord of heaven and earth!\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"177\",\n        \"local_title\": \"Mercy is falling\",\n        \"local_hint\": \"Mercy is falling\",\n        \"local_text\": \"Mercy is falling\\nIs falling - is falling\\nMercy, it falls\\nLike the sweet spring rain\\nMercy is falling\\nIs falling all over me Hey-oh\\nI receive Your mercy Hey-oh\\nI receive Your grace Hey-oh\\nI will dance forevermore\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"178\",\n        \"local_title\": \"Mighty is our God\",\n        \"local_hint\": \"Mighty is our God\",\n        \"local_text\": \"Mighty is our God,\\nMighty is our King,\\nMighty is our Lord,\\nRuler of everything.\\nGlory to our God,\\nGlory to our King\\nGlory to our Lord,\\nRuler of everything\\nHis Name Is higher,\\nHigher than any other Name.\\nHis power is greater for\\nHe has created everything\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"179\",\n        \"local_title\": \"Mignty man of God was he\",\n        \"local_hint\": \"Mignty man of God was he\",\n        \"local_text\": \"Mignty man of God was he-\\nElijah Elijah Elijah\\nA man of faith and simplicity\\nElijah Elijah Elijah\\nCame out of nowhere from a desert land\\nGod had a message for this chosen man\\nIf the Lord is God\\nthen serve Him now, said Elijah\\nMighty man of God was he-\\nDaniel Daniel Daniel\\nA man of strict in-te-grity, he was\\nDaniel Daniel Daniel\\nWhile the others couldn\'t make him sway\\nIn the peace of just enough to pray\\nAnd the angel saved his life\\nAnd they worshipped God,\\nbecause of Daniel.\\nO is there a man\\nLiving in the world today\\nNot caught up in riches\\nNot caught up as slave\\nO is there a man\\nLiving in the world today\\nWho wants to give his life\\nTo serve the Lord\\nMighty man of God was he-\\nPaul Paul Paul\\nA man with zeal and simplicity\\nPaul Paul Paul\\nOne truth was all he had\\nand now He saw\\nRighteousness by faith alone\\nand not by the Law\\nAnd the Gentiles heard him too\\nBut they didn\'t doubt the message.\\nThat\'s from Paul\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"180\",\n        \"local_title\": \"More love, more power\",\n        \"local_hint\": \"More love, more power\",\n        \"local_text\": \"More love, more power,\\nMore of You in my life (2)\\n\\n1. And I will worship You\\nWith all of my heart,\\nAnd I will worship You\\nWith all of my ming,\\nAnd I will worship You\\nWith all of my strength,\\nFor You are my Lord,\\n\\n2. And I will seek Your face\\nWith all of my heart/mind/strength\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"181\",\n        \"local_title\": \"My life is in You Lord\",\n        \"local_hint\": \"My life is in You Lord\",\n        \"local_text\": \"My life is in You Lord,\\nMy strength is in You Lord,\\nMy hope is in You Lord,\\nIn You, it’s in You! (repeat)\\nI\'ll praise You with all of my life,\\nI\'ll praise You with all of my strength.\\nWith all of my life,\\nand all of my strength,\\nAll of my hope is in You!\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"182\",\n        \"local_title\": \"My Jesus, my Saviour\",\n        \"local_hint\": \"My Jesus, my Saviour\",\n        \"local_text\": \"My Jesus, my Saviour,\\nLord, there is none like You!\\nAll of my days, I want to praise\\nThe wonders of Your mighty love.\\nMy Comfort, my Shelter,\\nTower of refuge and\\nLet every breath, all that I am,\\nNever cease to worship You!\\nShout to ine Lord,\\nAll the earth let us sing,\\nPower and Majesty,\\nPraise to the King.\\nMountains bow down\\nAnd the seas will roat,\\nAt the sound of Your Name.\\nI sing for joy at the work of Your hands,\\nForever I\'ll love You,\\nForever I7l stand,\\nNothing compares to the promise I have in You.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"183\",\n        \"local_title\": \"My Lord, what love is this\",\n        \"local_hint\": \"My Lord, what love is this\",\n        \"local_text\": \"My Lord, what love is this,\\nThat pays so dearly\\nThat I the guilty one,May go free.Amazing love, O what sacrifice,\\nThe Son of God givin for me,\\nMy debt He pays, and my death He dies,\\nThat I might live, that I might live.\\nAnd so they watched Him die,Despised, rejected;\\nBut oh, the blood he shed,Flowed for me.\\nAnd now this love of Christ,\\nShall flow like rivers;\\nCome wash your guilt away,Live again.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"184\",\n        \"local_title\": \"My Saviour, Redeemer\",\n        \"local_hint\": \"My Saviour, Redeemer\",\n        \"local_text\": \"My Saviour, Redeemer,\\nLifted me from the miry clay,\\nAlmighty, Forever,\\nI will never be the same,\\n\\nPre chorus:\\nCause You came near,\\nFrom the everlasting,\\nTo the world we live,\\nThe Father’s only Son\\n\\nCHORUS:\\nYou lived,and You died\\nYou rose again on high\\nYou\'ve opened the way,\\nFor the world to live again,\\nHallelujah,For all You’ve done\\n\\nBRIDGE:\\nHallelujah,For all You’ve done\\nHallelujah For all You’ve Done(keep repeating)\\nEnding:\\nHallelujah,For all You’ve done\\n(keep repeating)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"M\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"185\",\n        \"local_title\": \"O my soul\",\n        \"local_hint\": \"O my soul\",\n        \"local_text\": \"O my soul\\nDo you not know,\\nHave you not heard\\nIts been ‘ol from the beginning\\nThat the Lord Your God is on your side\\nO my soul, don\'t be afraid\\nHope in ine Lord\\nBy His righteousness and power\\nHe will strengthen, He will guide\\nAnd I will soar on wings like eagles\\nHeld by the hand of God\\nI will run and not grow tired\\nWhen on His name I call\\nFor the Lord is never weary\\nHis ways are beyond my thoughts\\nI will trust in Him, with all my heart.\\nAnd I will rest upon His promise.\\nPatiently I\'ll wait.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"186\",\n        \"local_title\": \"O come, all ye faithful\",\n        \"local_hint\": \"O come, all ye faithful\",\n        \"local_text\": \"1. O come, all ye faithful\\nJoyful and triumphant,\\nO come ye, O come ye to Bethlehem;\\nCome and behold Him,\\nBorn the King of angels:\\n\\nCHORUS:\\nO come, let us adore Him\\nO core, let us adore Him,\\nO Come, let us adore Him,\\nChrist the Lord.\\n\\n2. God of God, Light of Light,\\nLo! he abhors not the Virgin\'s womb;\\nVery God, Begotten not created\\n\\n3. Sing, Choirs of Angels\\nSing in exultation,\\nSing all ye citizens of heaven above,\\nGlory to God In the highest;\\n\\n4. Yea, Lord, we greet Thee,\\nBorn this happy morning\\nJesus, to Thee be glory given;\\nWord of the Father,\\nNow in flesh appearing.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"187\",\n        \"local_title\": \"Oh Lord my God\",\n        \"local_hint\": \"Oh Lord my God\",\n        \"local_text\": \"1. Oh Lord my God !\\nWhen I, in awesome wonder,\\nConsider all the works\\nThy hand hath made,\\nI see the stars,\\nI hear the mighty thunder,\\nThy power throughout\\nThe Universe Displayed.\\n\\nCHORUS:\\nThen sings my soul,\\nMy Saviour God to Thee,\\nHow great Thou art !\\nHow great Thou art !\\nThen sings my soul,\\nMy Saviour God to Thee,\\nHow great Thou art !\\nHow great Thou art !\\n\\n2. When through the woods\\nAnd forest glades I wander\\nAnd hear the birds\\nSing sweetly in the trees\\nWhen I look down\\nFrom lofty mountain grandeur\\nAnd hear the brook\\nAnd feel the gentle breeze\\n\\n3. And when I think,\\nThat God, His Son not sparing\\nSent Him to die,\\nI scarce can take it in;\\nThat on the cross,\\nMy burden gladly bearing,\\nHe bled and died\\nTo take away my sin;\\n\\n4. When Christ shall come\\nWith shout of acclamaton\\nAnd take me home\\nWhat joy shall fill my heart.\\nThen shall I bow\\nIn humble adoration\\nAnd there proclaim\\nMy God, how great Thou art !\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"188\",\n        \"local_title\": \"O Lord, give me\",\n        \"local_hint\": \"O Lord, give me\",\n        \"local_text\": \"O Lord, give me\\nan undivided heart\\nTo follow You.\\nO Lord, give me an undiminished love,\\nTo see what You see,To do what You do.\\nO Lord give me an undivided heart.\\nO Lord, give me\\nan unrelenting mind\\nTo seek Your face\\nO Lord, give me\\nan undefeated faith,\\nTo see victory,\\nIn all that I do,\\nTo worship in spirit and truth\\nTo see less of me,\\nAnd much more of You\\nO Lord, give me\\nan undivided heart (2)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"189\",\n        \"local_title\": \"O Lord, You have been good\",\n        \"local_hint\": \"O Lord, You have been good\",\n        \"local_text\": \"1. O Lord, You have been good,\\nYou have been faithful\\nto all generations.\\nO Lord, Your steadfast love\\nAnd tender mercy\\nhave been our salvation.\\n\\nCHORUS:\\nFor by Your hand\\nWe have been fed,\\nAnd by Your Spirit,\\nWe have been led. (repeat)\\nYou have been good.\\n\\n2. O Lord, Almighty God,\\nFather unchanging,\\nUpright and holy.\\nO Lord, You have been good\\nYou have been faithful,\\nYou have been good.\\n(sing chorus twice and end with..you have been good)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"190\",\n        \"local_title\": \"oh what a wonderful\",\n        \"local_hint\": \"oh what a wonderful\",\n        \"local_text\": \"1. oh what a wonderful,Wonder day\\nDay I will never forget,\\nAfter I\'d wandered in darkenss away\\nJesus my Saviour I met.\\nOh what a tender compassionate\\nHe met the need of my heart shadows dispelling,\\nwith joy I am telling,\\nHe made all the darkness depart.\\n\\nCHORUS:\\nHeaven care down and glory\\nfilled my soul\\nwhen at the cross\\nmy Saviour made me whole\\nMy sins were washed away\\nAnd my night was turned to day\\nHeaven care down and glory\\nfilled my soul.\\nBorn of the Spirit\\nwith life from above,\\nInto God\'s family divine,\\nJustified fully through Calvary\'s love,\\nOh what a standing is mine !\\nAnd the transaction\\nso quickly was made\\nWhen as a sinner I came,\\nTook of the offer\\nof grace He did profer,He saved me,\\nOh praise His dear Name !\\nNow I \'ve a hope\\nthat will surely endure\\nAfter the passing of time.\\nI have a future in Heaven for sure\\nThere in those mansions sublime.And it\'s because\\nOf that wonderful day\\nWhen at the cross I believed\\nRiches eternal and blessings Supernal\\nFrom His precious hand I received.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"191\",\n        \"local_title\": \"Oh, heaven is in my heart\",\n        \"local_hint\": \"Oh, heaven is in my heart\",\n        \"local_text\": \"Oh, heaven is in my heart (4)\\n1. (Leader) The kingdom of our God is here(All) Heaven is in my heart\\nThe presence of His majesty,\\nHeaven is in my heart.\\nAnd in His presence joy abounds\\nHeaven is in my heart.\\nThe light of holiness surrounds,\\nHeaven is in my heart.\\n\\n2. (Leader) His precious life on me He spent\\n(All) Heaven is in my heart\\nTo give me life without an end,\\nHeaven is in my heart,\\nIn Christ is all my confidence,\\nHeaven is in my heart,.\\nThe hope of my inheritance,\\nHeaven is in my heart.\\n\\n3. (Women) We are a temple for His throne,\\n(All) Heaven is in my heart\\nAnd Christ is the foundation stone.\\nHeaven is in my heart.\\nHe will return to take us home,\\nHeaven is in my heart.\\nThe Spirit and the Bride say, Come!\\nHeaven is in my heart.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"192\",\n        \"local_title\": \"Open our eyes, Lord\",\n        \"local_hint\": \"Open our eyes, Lord\",\n        \"local_text\": \"Open our eyes, Lord\\nWe want to see Jesus,\\nTo reach out and touch Him\\nTo say that we love Him\\nOpen our ears Lord\\nAnd teach us to listen\\nOpen Our eyes, Lord\\nWe want to see Jesus.\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"O\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"193\",\n        \"local_title\": \"Open the eyes of my heart Lord\",\n        \"local_hint\": \"Open the eyes of my heart Lord\",\n        \"local_text\": \"Open the eyes of my heart Lord\\nOpen the eyes of my heart\\nI want to see You\\nI want to see You (repeat)\\nTo see You high and lifted up\\nShining in the light of Your glory\\nPour out Your power and love\\nAs we si