(3, 'hindi', '[\n    {\n        \"local_id\": \"1\",\n        \"local_title\": \"Aaj Gunahon ke Sabab se\",\n        \"local_hint\": \"Aaj Gunahon ke Sabab se\",\n        \"local_text\": \"Aaj Gunahon ke Sabab se \\nDil mera Naushad Hai \\nMaaf Kar mere gunah tujhse \\nMeri fariyaad hai    ||Aaj|| \\n\\n1. Dosto ka saath hai aur hai \\nGunah ki zindagi (2) \\nKaise paas Aawoo tere,\\nAb Rooh Meri barbaad hai (2)   ||Maaf|| \\n\\n2. Ho chuka hu heen ithna \\nKhud pe apna bus nahi (2) \\nShaitan ki bataon sehi\\nZindagi barbaad hai (2)  ||Maaf||\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"2\",\n        \"local_title\": \"Aao milkar ham kare\",\n        \"local_hint\": \"Aao milkar ham kare\",\n        \"local_text\": \"Aao milkar ham kare \\nIshwar ka dhanyavaad \\nBeeth kshano me sang raha hai \\nAb bhi hai mere saath (2)\\nJisne hamare khatir \\nkhud ka jaan diya(2)\\nAur hamari zindagi ko \\njeevan daan diya \\n\\n1.Choda usne swarg loak ko\\nAaya tha dharti par \\nKhud ko usne bali kiya hai \\nKrus pe praan ko dekar \\nSaare daag dho diya \\npaapon ka ham par se \\nYeshu ne ham ko saaf kiya \\ndhokar apnay lahoo me \\n\\n2. Beeth gaye hai mosam kitne \\nAur beethe hai raina \\nUske pyaar me badthi hi jathi \\nHai mere jivan ki naiyya Aao milkar ham gaaye \\nEk naya sargam \\nBaaki jivan ham bithaye \\nprabhu me har dam\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"3\",\n        \"local_title\": \"Aaya masih duniya me tu\",\n        \"local_hint\": \"Aaya masih duniya me tu\",\n        \"local_text\": \"Aaya masih duniya me tu \\nPaapi yon ko bachane ko \\nLaye eeman jo bete par,\\nKarega paar is duniya ko \\n\\n1. Duniya gunaho me doob rahi thi,Saadik gumrah ho rahe the (2) \\nChhoda aasmaan bana insaan,\\nMili najath is duniya ko \\n\\n2. Bethlehem ke maidaano me, \\nGadariye raath so rahe the (2) \\nSuna phirishtho ki jubaan, \\nPaida hua hai krishth nidaan (2) \\n\\n3. Alimo ne kitabo me padi \\nPaidaish ki taphseel (2)\\nChal diye woh noto par \\nTare hayath ka peecha kar (2)\\n\\n4. Samudr ke sab laharo par, \\nDuniya ki har zubaan par (2)\\nHai uska naam, hai uska kaam \\nSara jaha laye eeman (2)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"4\",\n        \"local_title\": \"Ai mere dil sadaa\",\n        \"local_hint\": \"Ai mere dil sadaa\",\n        \"local_text\": \"Ai mere dil, sadaa\\nGayejaa, gayejaa, (gayeja)3 \\nPyar Kartha hai wo \\nThu be use pyar de \\nWo he tera meet gayeja \\nPrabhu Yeshu ke geet \\n\\n1. Zindagi me chadav \\nZindagi me utar \\nPer sada hi bajey \\nApna man ka sitar \\nNikle us say madhur pyar ki \\nIs jahan me tujhe jeet mile yake haar \\nWo he tera meet gayeja \\nPrabhu Yeshu ke geet \\n\\n2. Uskee ashish pe \\nPrabhu ko rah