\\nAawo bhayo, aawo bahno\\nHam sab chale Yesu ke paas (2)\\n\\n2. Tera jeevan do din ka hai \\nEk din thune mitti jana hai (2) \\nVyardhi vyardh hai ye \\nJagathi maya (2) \\nAawo bhayo, aawo bahno \\nHam sab chale yeshu ke paas (2)\\n\\n3. Tere liye jag me aaye \\nMukti sandesh laya yesu (2) \\nAaja jaldi toba karle (2) \\nAawo bhayo, aawo bahno \\nHam sab chale Yesu ke paas (2)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"56\",\n        \"local_title\": \"Yeshu tera naam sabse uncha hai\",\n        \"local_hint\": \"Yeshu tera naam sabse uncha hai\",\n        \"local_text\": \"Yeshu tera naam sabse uncha hai \\nJis naam me hai mukti \\nJis naam me hai shakti \\nJis naam me hai shanti \\nDeta wo naam changayi \\nJis naam me hai zindagi\\nYeshu hai wo naam paas (2) \\nJis naam me hai bandagi \\nYeshu ha wo naam \\nYeshu tera naam sabse uncha hai - 4 \\nbimari se gareebi se \\nshraapo se hai churata \\nwo naam hai jo aandhi ko \\nroshni bhi hai deta\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"57\",\n        \"local_title\": \"Yeshu hai sachcha gadariya\",\n        \"local_hint\": \"Yeshu hai sachcha gadariya\",\n        \"local_text\": \"Yeshu hai sachcha gadariya \\nUski ham bhede hai \\nHari charayiyon me\\nHame charata hai \\n\\n1. Vadhi pahadiyon me le chalta hai \\nJahan par sukhdayi \\nJharne behte hai ... (2) \\n\\n2.Margon me meri raksha vo karta hai \\nShaitan ke hathon se \\nhame chudatha hai .. (2)\\n\\n3. Ham ko kisi ka ab to dar nahi hai \\nKyon ki Yeshu Jo mera sathi hai.(2)\\n\\nHallelujah Amen! (4)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"58\",\n        \"local_title\": \"Yeshu tera naam hai kitna sundar\",\n        \"local_hint\": \"Yeshu tera naam hai kitna sundar\",\n        \"local_text\": \"Yeshu tera naam hai kitna sundar \\nYeshu tera naam hai kitna pavan (2)\\n\\n1. Tujhme mili hai hum ko kshama \\nTujhme mila hai naya Jeevan (2) \\n\\n2. Tujhme mili hai hum ko krupa \\nTujhme me hue hai hum paavan (2)\\n\\n3. Tujhme mili hai hum ko shifa \\nTujhme mila hai ananth jeevan (2)\",\n        \"local_category\": \"nothing\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"\",\n        \"song_chord\": \"C\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"\",\n                \"artist\": \"\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"\"\n            }\n        ]\n    }\n]');
