(4, 'new', '[\n    {\n        \"local_id\": \"1\",\n        \"local_title\": \"యేసు ప్రభువు బాటలో\",\n        \"local_hint\": \"yesu prabhuvu batalo\",\n        \"local_text\": \"\\t\\t\\tయేసు ప్రభువు బాటలో యేసు సంఘ సేవలో\\n \\t\\t\\tఏక మనసుతో మనం ఏకమై సాగెదం \\n \\t\\t\\tయేసులో క్రీస్తులో ఐక్యమైతిమీ\\n \\t\\t\\tఆత్మలో ప్రేమలో ఏకమౌదమా?\\n\\n 1. సమాధాన బంధం సహనముతో డెందం\\n \\t\\t\\tశ్రద్ధతో కాపాడుకొందమా\\n \\t\\t\\tప్రేమతో సహనముతో నడుచుకొందమా? \\n \\t\\t\\tఆత్మ సహాయం నిత్యమాశించెదం\\n\\n 2. సహనముతోడ వినయముతోడ\\n \\t\\t\\tప్రేమగా భరించుకొందమా\\n \\t\\t\\tక్రీస్తు ఖైది మనసుతోడ కలసి వెళ్ళుదాం\\n \\t\\t\\tక్రీస్తు దాసులమై బ్రతిమాలుకొందమా\\n\\n 3. సంఘమొక్కటే పిలుపు ఒక్కటే\\n \\t\\t\\tపిలుపులో నిరీక్షణోక్కటే\\n \\t\\t\\tదీర్ఘశాంత వినయముతో నడుచుకొందమా\\n \\t\\t\\tపిలుపుకు తగినట్లుగా నడుచుకొందమా\\n\\n\",\n        \"local_category\": \"gospel\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"య\",\n        \"song_chord\": \"\",\n        \"note\": \"SPICON-2022 Theme Song By J. Devaraju | UESI AP\",\n        \"song\": [\n            {\n                \"id\": \"1\",\n                \"title\": \"1. యేసు ప్రభువు బాటలో\",\n                \"artist\": \"...జె.దేవరాజు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/new/1-yesu-prabhuvu-batalo.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"2\",\n        \"local_title\": \"సమాధాన బంధం\",\n        \"local_hint\": \"samadana bhandam\",\n        \"local_text\": \"\\t\\t\\tసమాధాన బంధం - ఆత్మ ఇచ్చు ఐక్యం\\n \\t\\t\\tశ్రద్ధ గలిగి కొనసాగించాలి... ఆ... ఆ... ఆ\\n \\t\\t\\tఒకరికొకరు సహనం చూపాలి\\n\\n \\t\\t\\tభయభక్తులు దృఢ చిత్తము - విశ్వాసం నిలచి ఉండాలి\\n \\t\\t\\tతన పిలుపుకు తగినట్లుగా - దీర్ఘశాంతం చూపి నడవాలి\\n\\n 1. శరీరం ఒక్కటే - ఆత్మయు ఒక్కడే\\n \\t\\t\\tనిరీక్షణ ఒక్కటే - పిలిచెను ఒక్కడే\\n \\t\\t\\tతండ్రియైన దేవుడు - అందరికి పైనున్నాడు\\n \\t\\t\\tఅందరిలో వ్యాపించి - అందరిలోనూ ఉన్నాడు\\n\\n 2. విశ్వాసం ఒక్కటే - ప్రభువును ఒక్కడే\\n \\t\\t\\tబాప్తీస్మం ఒక్కటే - తండ్రిదేవుడొక్కడే\\n \\t\\t\\tక్రీస్తు యిచ్చు ఆత్మవరము - ఆయన సంకల్పములో\\n \\t\\t\\tతన చిత్తము చొప్పున - కృప మనకు ఇవ్వబడెను\\n\\n 3. ప్రేమ కలిగి యుండుము - సత్యమును చెప్పుము\\n \\t\\t\\tక్రీస్తువలె నుండునట్లు - అన్నిటిలో ఎదుగుము\\n \\t\\t\\tక్షేమాభివృద్ధి కొరకు - సంపూర్ణత సాగించుటకు\\n \\t\\t\\tపరిచర్యను కొనసాగిస్తూ - పరుగిడుము పరుగిడుము\\n\\n 4. నీతి కలిగి యుండుము - యధార్ధతను విడువకుము\\n \\t\\t\\tఅబద్ధములు మానుము - కోపమును తగ్గించుము\\n \\t\\t\\tఅపవాదికి చోటియ్యక - వినువారికి మేలగునట్లు\\n \\t\\t\\tఅనుకూల వచనము పలుకు - ఆత్మను సంతోషపరచు\\n\\n\",\n        \"local_category\": \"gospel\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"స\",\n        \"song_chord\": \"\",\n        \"note\": \"SPICON-2022 Theme Song By G. Manikya Rao | UESI AP\",\n        \"song\": [\n            {\n                \"id\": \"2\",\n                \"title\": \"2. సమాధాన బంధం\",\n                \"artist\": \"...జి. మాణిక్యరావు\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/new/2-samadhana-bandham.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"3\",\n        \"local_title\": \"ప్రేమతో నింపుము యేసయ్య\",\n        \"local_hint\": \"prematho nimpumu yesayya\",\n        \"local_text\": \"\\t\\t\\tప్రేమతో నింపుము యేసయ్య - నీ సహనము నీయుము యేసయ్య (2)\\n \\t\\t\\tనీ పిలుపుకి తగినట్లు సమాధాన బంధముతో - ఆత్మ కలిగించు ఐక్యతలో నిలుపుమయా (2)\\n\\n 1. దీర్గశాంతము లోపించి - సాత్వికమూ లోపించి - \\n \\t\\t\\tవ్యక్తిత్వ ఘర్షణలు - ఇంకెన్నో సమస్యలు (2)\\n \\t\\t\\tమాలోని ఐక్యతను హరిస్తు ఉన్నాయి (2)\\n \\t\\t\\tక్షమ ప్రేమలు మాకిమ్ము....\\n\\n 2. విశ్వాసములో బాప్తిస్మములో నిరీక్షణలో మేమోకటే - \\n \\t\\t\\tనీఒక్కడివే ఆత్మయు ఒకడే తండ్రియు ఒకడే అందరిలో (2)\\n \\t\\t\\tసంఘముగా మమ్ములను ఒక్కటిగా నిలిపి (2)\\n \\t\\t\\tఐక్యతలో నిలుపుమయా....\\n\\n 3. నీ ప్రేమ లోతు ఎత్తు పొడుగు వెడల్పు ఎంతో తెలిసికొన - \\n \\t\\t\\tప్రేమలో నిలిచి ఐక్యతతో నీ ప్రేమను ధ్యానించాలి (2)\\n \\t\\t\\tఐక్యతలో ప్రేమలోనూ పూర్ణులుగా చేసి (2)\\n \\t\\t\\tసంపూర్ణత నీయుమయా....\\n\",\n        \"local_category\": \"gospel\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"SPICON-2022 Theme Song By K J S Babu Rao | UESI AP\",\n        \"song\": [\n            {\n                \"id\": \"3\",\n                \"title\": \"3. ప్రేమతో నింపుము\",\n                \"artist\": \"...K J S Babu Rao\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/new/3-prematho-nimmpumu-yesayya.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"4\",\n        \"local_title\": \"త్రియేక దేవా నీ ప్రభావ మహిమన్ \",\n        \"local_hint\": \"triyeka deva ni prabhava mahiman\",\n        \"local_text\": \"\\t\\t\\tత్రియేక దేవా నీ ప్రభావ మహిమన్\\n \\t\\t\\tవర్ణింపతరమా - నీ ప్రేమను\\n \\t\\t\\tరాజా - ఈ లోకమంతటిని రక్షణతో \\n\\t\\t\\tఅలంకరించితివి \\n\\t\\t\\tఆరాధన-యుగయుగములలో\\n\\t\\t\\tఆరాధన -తరతరములలో \\n\\t\\t\\tఆరాధన - ప్రతి దేశములో - ఆరాధన నీకే ప్రభూ\\n\\n 1. తండ్రి - నీ చిత్తం - కదిలెను నీ హృదయం \\n \\t\\t\\tపంపించితివిగా - కుమారుని మాకై \\n \\t\\t\\tఆకర్షించి - మము చేర్చిన\\n \\t\\t\\tనీ నిత్య కృపకై - కీర్తింతును\\n\\n2. తనయా - నీ త్యాగం - విధేయతా ఫలము \\n \\t\\t\\tమా జీవితాలకు - సమృద్ధి జీవం\\n \\t\\t\\tశుద్ధాత్ముని - సన్నిధి వరములతో \\n \\t\\t\\tబలమిచ్చినందున - స్తుతియింతుము\\n\\n3. కర్తా - నీ రాజ్యం - శాశ్వత అధికారము \\n \\t\\t\\tమార్పులేనిది - వర్ధిల్లుచున్నది \\n \\t\\t\\tపరమందునా - భువియందున\\n \\t\\t\\tనీలాంటి దేవుడు - లేరెవ్వరు\\n\",\n        \"local_category\": \"gospel\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"త\",\n        \"song_chord\": \"\",\n        \"note\": \"UESI TS - TRICON-2023 Theme Song By K.Ravikumar\",\n        \"song\": [\n            {\n                \"id\": \"4\",\n             