!\\n\\n \\t\\t\\t3. నీవే దేవా దేవదేవుడవు మహాత్యము గల మహారాజా! \\n \\t\\t\\tమమ్మును పాలించే ప్రభువూ - నీవు మేపు గొర్రెలము \\n \\t\\t\\tనీ సన్నిధిని మోకరింతుము - కృతజ్ఞతలర్పించి ఆరాధింతుము\\n\\n \\t\\t\\t4. ప్రకటించుటకు నీ సువార్తను ప్రతిష్టించుము మమ్ములను \\n \\t\\t\\tహింసలు, క్రమలు ఎదురైనా - నీ రక్షణ ఇల చాటడము \\n \\t\\t\\tమా జీవితముల నీ సేవకు - ప్రతిష్టించుకొందుము మా యేసయ్యా\\n\\n\",\n        \"local_category\": \"gospel\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"న\",\n        \"song_chord\": \"\",\n        \"note\": \"Nandyal Ruby celebrations theme song Written by KJS Babu Rao Anna\",\n        \"song\": [\n            {\n                \"id\": \"8\",\n                \"title\": \"8. నీకే ప్రభూ! మా స్తుతి ఆరాధన \",\n                \"artist\": \"...K J S Babu Rao\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/new/8.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"9\",\n        \"local_title\": \"ప్రభు క్రీస్తు నినుపోలి నడిచెదను\",\n        \"local_hint\": \"prabhu kristu ninupoli nadichedanu\",\n        \"local_text\": \"\\t\\t\\tప్రభు క్రీస్తు నినుపోలి నడిచెదను \\n \\t\\t\\t నీ త్యాగం - నీ అర్పణ - ధరణనుసరించెదము\\n \\t\\t\\t నీవే మా మాదిరి - నీవేగా మా గురి\\n \\t\\t\\t నీవేగా కాపరి - నీవేగా ఊపిరి \\n\\n \\t\\t\\t 1. కుటుంబము కృపతో నీవలన బహుమానము\\n \\t\\t\\t ఆనందము మేమందరము నిను సేవించడం (2)\\n \\t\\t\\t సాయపడుము మా కుటుంబములో \\n \\t\\t\\t మాదిరిగా మేముండుటకు (2) \\n\\n \\t\\t\\t 2. ఉద్యోగము కఠినులతో కూడా పనిచేయడం \\n \\t\\t\\t సాహసము సత్యమునచ్చట జరిగించడం (2)\\n \\t\\t\\t ఆదుకొనుము మమ్మును కూడా \\n \\t\\t\\t దానియేలులా నడుచుటకు (2) \\n\\n \\t\\t\\t 3. నశించిన జనులకు నిన్ను ప్రకటించెదం\\n \\t\\t\\t పరిచర్యలో సమస్యలున్న సణుగకను (2)\\n \\t\\t\\t అలసిపోక ఆనందముతో \\n \\t\\t\\t నీలా సాగుట నేర్పుమయా (2)\\n\\n\",\n        \"local_category\": \"gospel\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"ప\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"9\",\n                \"title\": \"9. ప్రభు క్రీస్తు నినుపోలి నడిచెదను \",\n                \"artist\": \"...K J S Babu Rao\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/new/9.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"10\",\n        \"local_title\": \"వివాహం – దేవుని గొప్ప ప్రణాళిక\",\n        \"local_hint\": \"prabhu kristu ninupoli nadichedanu\",\n        \"local_text\": \"\\t\\t\\tవివాహం – దేవుని గొప్ప ప్రణాళిక \\n \\t\\t\\t అది దేవుడే – దంపతులకిచ్చిన బాధ్యత \\n \\t\\t\\t బాధ్యత నెరిగిన దంపతులై భయభక్తులతో నడువుడి.\\n\\n\\t\\t\\t 1. ఆది యందే దేవుడు ఆరంభించెను కుటుంబము \\n \\t\\t\\t ఆయన దానిని అభిషేకించి- ఆశీర్వాదాలతో నింపెను \\n \\t\\t\\t అయనతోనే నడచుచు ఆయన సాక్షులై నిలువుడి \\n\\n\\t\\t\\t 2. క్రీస్తు యేసే కేంద్రమై కట్టును మీ కుటుంబము \\n\\t\\t\\t కునుకకా నిద్రపోక - కాపాడును మీ కాపురము\\n \\t\\t\\t క్రీస్తువైపే చూచుచూ - క్రీస్తు ప్రేమలో ఎదుగుడి \\n\\n\\t\\t\\t 3. దేవుని యందలి భయము భక్తి - దీనత్వంలో నడుపును \\n\\t\\t\\t దేవుని వాక్యధ్యానమే - దేవుని మార్గము చూపును \\n \\t\\t\\t దేవుని యందలి ప్రార్ధన- దంపతులకు బలమిచ్చును \\n\\n\\t\\t\\t 4. అకులా ప్రిస్కిల్లల కుటుంబము ఆదిసంఘాలు బలపరచెను \\n\\t\\t\\t వారి ప్రేమ ఆతిధ్యము – పౌలు సేవకు తోడుండెను \\n\\t\\t\\t మీ కుటుంబ జీవితంలో మహోన్నతున్ని సేవించుడి\\n \\t\\t\\t\\n\\n\",\n        \"local_category\": \"gospel\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"10\",\n                \"title\": \"10. వివాహం – దేవుని గొప్ప ప్రణాళిక \",\n                \"artist\": \"...యం.క్రిష్ణయ్య\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/new/10.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"11\",\n        \"local_title\": \"దేవా మా కుటుంబమున్..\",\n        \"local_hint\": \"deva maa kutunbhamun\",\n        \"local_text\": \"\\t\\t\\tదేవా మా కుటుంబమున్..\\n \\t\\t\\t నీ ప్రేమలో బంధించుము, \\n \\t\\t\\t ప్రభువా నీ ప్రణాళికా.. \\n \\t\\t\\t నెరవేర్చు కృపను మాకు యిమ్మయా (2) \\n \\t\\t\\t నీ ఉన్నత పిలుపునెరిగి,\\n \\t\\t\\t నీ ఆత్మలో బందీలై (2)\\n \\t\\t\\t నీ హృదయ భారముతో బ్రతుకనేర్పయ \\n \\t\\t\\t నీ కాడిని ఇలమోస్తూ జీవింపనేర్పయ్య(2)\\n\\n \\t\\t\\t 1.పాపరహిత క్షమాగుణం నీ దానం,\\n \\t\\t\\t కల్వరిలో త్యాగశీలి నీ స్నేహం , \\n \\t\\t\\t చూచువరకు నీ రూపును మాలోన, \\n \\t\\t\\t చెక్కుము నీకొరకు బ్రతుక నిలలోన, \\n \\t\\t\\t క్రీస్తే మా మాదిరిగా,\\n \\t\\t\\t అణుకువే ప్రమాణముగా(2) \\n\\n \\t\\t\\t 2.నీ వాక్యం ప్రవహించే ప్రవాహమై, \\n \\t\\t\\t నీ నియమం నెరవేర్చే యోధులమై, \\n \\t\\t\\t నీ ప్రేమలో ఉప్పొంగే జ్వాలలమై, \\n \\t\\t\\t నీ రాజ్యం నీతికి ఆధారమై, \\n \\t\\t\\t క్రీస్తే మా కేంద్రముగా,\\n \\t\\t\\t లేఖనమే ప్రమాణముగా (2) \\n\\n\\n\",\n        \"local_category\": \"gospel\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"వ\",\n        \"song_chord\": \"\",\n        \"note\": \"Theme Song For Family Conference\",\n        \"song\": [\n            {\n                \"id\": \"11\",\n                \"title\": \"11. దేవా మా కుటుంబమున్.. \",\n                \"artist\": \"...మెర్సీ రవి ప్రసాద్\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/new/11.mp3\"\n            }\n        ]\n    },\n    {\n        \"local_id\": \"12\",\n        \"local_title\": \"అణగారి పోతున్నాయి ఎంపీసీలు\",\n        \"local_hint\": \"anagaari pothunnayi mpc\",\n        \"local_text\": \"\\t\\t\\tఅణగారి పోతున్నాయి ఎంపీసీలు\\n\\t\\t\\t విద్యార్థుల ఆత్మీయత ప్రశ్నార్థకం\\n\\n\\t\\t\\t ఎంపీసీ చేయని ఓరన్న (ఓయక్క)\\n\\t\\t\\t ఎందాక కాలయాపన చేస్తావు \\n\\t\\t\\t ఎంపీసీ కి రాని ఓ తమ్మి (ఓ చెల్లి)\\n\\t\\t\\t ఎన్నిసార్లు సాకులు చెప్తూ ఉంటాను \\n\\n\\t\\t\\t అణగారిపోతోంది ఆత్మీయము\\n\\t\\t\\t విద్యార్థి రక్షణే ప్రశ్నార్థకం \\n\\t\\t\\t నడుస్తోంది యౌవ్వనం పాపంలో \\n\\t\\t\\t నిద్రపోతోంది విశ్వాసం శాంతంతో\\n\\n\\t\\t\\t నడిపించే అన్న లేక - బోధించే పెద్ద లేక \\n\\t\\t\\t క్రీస్తు యేసుని ప్రేమ లేక - ప్రార్థించే ఇల్లు లేక \\n\\n\\t\\t\\t 1.బందకాల మీడియా సుడిలో \\n\\t\\t\\t చిక్కుకున్న విద్యార్థిని చూడు \\n\\t\\t\\t పెద్దన్న (పెద్దక్క) వినవా తన గోడు \\n\\t\\t\\t చిన్నన్న (చిన్నక్క) తనతో మాట్లాడు \\n\\n\\t\\t\\t అణగారిపోతోంది ఆత్మీయము\\n\\t\\t\\t విద్యార్థి రక్షణే ప్రశ్నార్థకం \\n\\t\\t\\t ఎంపీసీ చేయని ఓరన్న \\n\\t\\t\\t ఎందాక కాలయాపన చేస్తావు \\n\\n\\t\\t\\t 2. కూలుతోంది విద్యార్థి లోకం \\n\\t\\t\\t వారి మనసులోనే ఎల్లప్పుడు శోకం \\n\\t\\t\\t కానరాకుంది విశ్వాసికి దుఃఖం \\n\\t\\t\\t వ్యక్తిగత శ్రద్ధలేని నవతరనైజం\\n\\n\\t\\t\\t అణగారిపోతోంది ఆత్మీయము\\n\\t\\t\\t విద్యార్థి రక్షణే ప్రశ్నార్థకం \\n\\t\\t\\t ఎంపీసీ చేయని ఓయక్క \\n\\t\\t\\t ఎందాక కాలయాపన చేస్తావు \\n\\n\\t\\t\\t 3. చిన్ని ప్రార్థనా గుంపులు శూన్యం \\n\\t\\t\\t సినిమా సాహిత్యాలు సర్వం \\n\\t\\t\\t పాడైపోయే విద్యార్థుల ఆత్మీయం\\n\\t\\t\\t విడిపించలేదే విశ్వాసుల సైన్యం \\n\\n\\t\\t\\t అణగారిపోతోంది ఆత్మీయము\\n\\t\\t\\t విద్యార్థి రక్షణే ప్రశ్నార్థకం \\n\\t\\t\\t నడుస్తోంది యౌవ్వనం పాపంలో \\n\\t\\t\\t నిద్రపోతోంది విశ్వాసం శాంతంతో \\n\\n\\t\\t\\t నడిపించే అన్న లేక - బోధించే పెద్ద లేక \\n\\t\\t\\t క్రీస్తు యేసుని ప్రేమ లేక - ప్రార్థించే ఇల్లు లేక \\n\\n (ఆ... ఆ... ఆ... ఆ... ఆ... ఆ...)\\n\\n\",\n        \"local_category\": \"gospel\",\n        \"local_categorycount\": \"1\",\n        \"index_letter\": \"అ\",\n        \"song_chord\": \"\",\n        \"note\": \"\",\n        \"song\": [\n            {\n                \"id\": \"12\",\n                \"title\": \"12. అణగారి పోతున్నాయి ఎంపీసీలు \",\n                \"artist\": \"...సురేష్ ౼సిటీ ఆఫీస్, విజయవాడ\",\n                \"artwork\": \"../assets/images/web-logo.png\",\n                \"url\": \"https://vidhyarthigeethavali.com/uesi/audio_songs/new/12.mp3\"\n            }\n        ]\n    }\n]');
