INSERT INTO `up_comming_programs` (`id`, `title`, `description`, `date`, `venue`, `speakers`, `registration_link`, `invitation_image`, `scanner_image`, `status`) VALUES
(2, 'Writer\'s Workshop', '<div>\n<div><strong>రాయడం ధన్యతే!</strong> </div>\n<div>రాసే వారు లేనప్పుడు చదివే వారికి ఎలా చేరుతుంది? గొప్ప నాయకులు అందరూ గొప్ప చదువరులే(great leaders are great readers) అన్న నానుడి మనకు తెలిసినదే కదా!</div>\n<div>👉ప్రభు పనిని ముందుకు తీసుకువెళ్లడంలో రచయితల అవసరం ఉంది.</div>\n<div>👉అంతే గాక, విద్యార్థిలోకాన్ని చేరుకోవడానికి, విశ్వాసులను బలపరచడానికి ప్రభావశీల రచనల అవసరం చాలా ఉంది.</div>\n<div>👉ప్రభువును ఎరిగిన విశ్వాసులుగా ఆయన ప్రేమను, సత్యాన్ని ఇతరులతో, సహ-విశ్వాసులతో పంచుకోవటానికి, రాయడం దేవుడు మనకిచ్చిన ధన్యత</div>\n<div>👉రండి, రాయడం నేర్చుకుందాం. పైన ఇవ్వబడిన లింక్ ద్వారా మీ పేరును రిజిస్ట్రేషన్ చేయండి.</div>\n<div><strong>గమనిక:</strong> రిజిస్ట్రేషన్స్ కొరకు ఆఖరు తేదీ 05.11.2023 - లిటరేచర్ డిపార్ట్మెంట్, యూఈఎస్ఐ - తెలంగాణ.</div>\n</div>', '10th - 12th Nov, 2023', 'UESI-TS Study Center, Jinnaram', '<div>\n<div>👉<strong>Devotions</strong> - Bro. Rajesh Dasari (SS)</div>\n<div>👉<strong>Biblical basis of Writing</strong> - Bro. Rajesh Dasari (SS)</div>\n<div>👉<strong>Article writing & Creative writing</strong> - Bro. Suresh Vanguri (Vijayawada)</div>\n<div>👉<strong>Story Writing & Poetry writing</strong> - Bro. Jason Bathula (Chirala)</div>\n<div>👉<strong>Translation & Book reading</strong> - Bro. Simon Sandepagu (Hyd)</div>\n</div>    ', 'https://docs.google.com/forms/d/e/1FAIpQLSdGbt5ZY5HBNtvO5X0_dq3revQYYVwev7QD49Y6N07rczuaOg/viewform?vc=0&c=0&w=1&flr=0', 'https://vidhyarthigeethavali.com/uesi/up_comming_programs/writers_workshop_invitation_image.jpeg', 'https://vidhyarthigeethavali.com/uesi/up_comming_programs/writers_workshop_scanner.png', 0),
(3, 'Writer\'s Workshop', '<div>\r\n<div><strong>రాయడం ధన్యతే!</strong> </div>\r\n<div>రాసే వారు లేనప్పుడు చదివే వారికి ఎలా చేరుతుంది? గొప్ప నాయకులు అందరూ గొప్ప చదువరులే(great leaders are great readers) అన్న నానుడి మనకు తెలిసినదే కదా!</div>\r\n<div>👉ప్రభు పనిని ముందుకు తీసుకువెళ్లడంలో రచయితల అవసరం ఉంది.</div>\r\n<div>👉అంతే గాక, విద్యార్థిలోకాన్ని చేరుకోవడానికి, విశ్వాసులను బలపరచడానికి ప్రభావశీల రచనల అవసరం చాలా ఉంది.</div>\r\n<div>👉ప్రభువును ఎరిగిన విశ్వాసులుగా ఆయన ప్రేమను, సత్యాన్ని ఇతరులతో, సహ-విశ్వాసులతో పంచుకోవటానికి, రాయడం దేవుడు మనకిచ్చిన ధన్యత</div>\r\n<div>👉రండి, రాయడం నేర్చుకుందాం. పైన ఇవ్వబడిన లింక్ ద్వారా మీ పేరును రిజిస్ట్రేషన్ చేయండి.</div>\r\n<div><strong>గమనిక:</strong> రిజిస్ట్రేషన్స్ కొరకు ఆఖరు తేదీ 05.11.2023 - లిటరేచర్ డిపార్ట్మెంట్, యూఈఎస్ఐ - తెలంగాణ.</div>\r\n</div>', '10th - 12th Nov, 2023', 'UESI-TS Study Center, Jinnaram', '<div>\r\n<div>👉<strong>Devotions</strong> - Bro. Rajesh Dasari (SS)</div>\r\n<div>👉<strong>Biblical basis of Writing</strong> - Bro. Rajesh Dasari (SS)</div>\r\n<div>👉<strong>Article writing & Creative writing</strong> - Bro. Suresh Vanguri (Vijayawada)</div>\r\n<div>👉<strong>Story Writing & Poetry writing</strong> - Bro. Jason Bathula (Chirala)</div>\r\n<div>👉<strong>Translation & Book reading</strong> - Bro. Simon Sandepagu (Hyd)</div>\r\n</div>    ', 'https://docs.google.com/forms/d/e/1FAIpQLSdGbt5ZY5HBNtvO5X0_dq3revQYYVwev7QD49Y6N07rczuaOg/viewform?vc=0&c=0&w=1&flr=0', 'https://vidhyarthigeethavali.com/uesi/up_comming_programs/writers_workshop_invitation_image.jpeg', 'https://vidhyarthigeethavali.com/uesi/up_comming_programs/writers_workshop_scanner.png', 0);
